INSERT INTO `codes` VALUES (1,'getInt Java','[B][URL=\"http://www.cyberforum.ru/java-j2se/thread1117934.html#post5894333\"]getInt()[/URL][/B]\r\n[JAVA]public static int getInt()\r\n{\r\n    Scanner in = new Scanner(System.in);\r\n    String s = null;\r\n    Pattern p = Pattern.compile(\"^\\\\d+$\");\r\n    Matcher m = null;\r\n \r\n    do\r\n    {\r\n        System.out.println(\"Введите целое число\");\r\n        s = in.nextLine();\r\n        m = p.matcher(s);\r\n    } while(!m.matches());\r\n \r\n    return Integer.parseInt(s);\r\n}[/JAVA]\r\n[JAVA]....\r\nint x = getInt();[/JAVA]','094c7c6655349ae3191d126fcfaea996166b71c1',1,'2014-03-14 18:04:13','2015-02-17 07:07:12',1,1,''),(2,'Unnamed #2','[C_CPP]#include <iostream>\r\n#include <fstream>\r\n\r\nint main(int argc, char *argv[])\r\n{\r\n    const char * filename = \"./file.txt\";\r\n    \r\n    std::fstream file(filename);\r\n    if(!file)\r\n        return 1;\r\n    std::string text(\r\n        (std::istreambuf_iterator<char>(file)),\r\n        std::istreambuf_iterator<char>()\r\n    );\r\n                 \r\n    int pos = text.find_last_of();\r\n    if(-1 == pos)\r\n    {\r\n        if(!text.size())\r\n            return 2;\r\n        pos = 0;\r\n    }\r\n    text.erase(pos, text.size() - pos + 1);\r\n    \r\n    file.close();\r\n    \r\n    file.open(filename, std::ios::out);\r\n    file << text;\r\n    file.close();\r\n\r\n    return 0;\r\n}[/C_CPP]','199ffd8bc7ed623f54f6b8b0b2246363990b2f7f',1,'2014-03-15 15:33:53','2015-10-08 14:24:41',1,1,''),(3,'Unnamed #3','[PHP]<?php\r\n$text = \'http://site.ru foo bar http://site.com,     lorem http://cyberforum.ru f http://101.ru/?an=port_channel_mp3&channel=150 ffff\r\nhttp://google.com/ fdfd\';\r\n\r\nfunction reduceLinks($text, $reducer = \'bitly\')\r\n{\r\n	$reducers = array(\'bitly\', \'kwnme\', \'adfly\', \'toly\', \'l4uin\', \'isgd\', \'supr\', \'tinyurl\');\r\n	if(!in_array(strtolower($reducer), $reducers))\r\n		exit(\'Unknown reducer. Known reducers: \' . join(\', \', $reducers));\r\n	$reducer = \'short\' . $reducer;\r\n	foreach(preg_split(\'/[,!\\s]+?/s\', $text, -1, PREG_SPLIT_NO_EMPTY) as $url)\r\n		if(filter_var($url, FILTER_VALIDATE_URL))\r\n			$text = str_replace(trim($url), $reducer(trim($url)), $text);\r\n	return $text;\r\n}\r\n// Bit.ly shortener\r\nfunction shortBitly($source) {\r\n	$login = \'test4f\';\r\n	$access_token = \'356b65bfd49f27482a3fb2bab81348b00bda4d86\';\r\n	$apikey = \'R_88fc44a9bf544fb686ed9d696a834b3a\';\r\n	$url = file_get_contents(\'http://api.bit.ly/shorten?version=2.0.1&longUrl=\' . urlencode($source) . \'&login=\' . $login . \'&apiKey=\' . $apikey);\r\n	$content = json_decode($url,true);\r\n	if(isset($content, $content[\'results\'], $content[\'results\'][$source]))\r\n		return urldecode($content[\'results\'][$source][\'shortUrl\']);\r\n	else\r\n		return urldecode($source);\r\n}\r\n// TinyURL shortener\r\nfunction shortTinyURL($source) {\r\n	return file_get_contents(\'http://tinyurl.com/api-create.php?url=\' . $source);\r\n} \r\n// Su.pr shortener\r\nfunction shortSupr($source) {\r\n	return file_get_contents(\'http://su.pr/api?url=\' . $source);\r\n}\r\n// Is.gd shortener\r\nfunction shortIsgd($source) {\r\n	return file_get_contents(\'http://www.is.gd/api.php?longurl=\' . $source);\r\n}\r\n// L4u.in shortener\r\nfunction shortL4uin($source) {\r\n	return file_get_contents(\'http://www.l4u.in/?module=ShortURL&file=Add&mode=API&url=\' . $source);\r\n}\r\n// To.ly shortener\r\nfunction shortToly($source) {\r\n	$ch = curl_init();\r\n	curl_setopt($ch, CURLOPT_URL, \"http://to.ly/api.php?longurl=\".urlencode($source));\r\n	curl_setopt($ch, CURLOPT_RETURNTRANSFER,1);\r\n	curl_setopt($ch, CURLOPT_HEADER, 0);\r\n	$shorturl = curl_exec ($ch);\r\n	curl_close ($ch);\r\n	return $short_url;\r\n}\r\n// Adf.ly shortener\r\nfunction shortAdfly($source) {\r\n	$APIKey = \'YOUR_API_KEY\';\r\n	$UserID = \'YOUR_USER_ID\';\r\n	$ShortType = \'int\'; // or \'banner\'\r\n	return file_get_contents(\'http://adf.ly/api.php?key=\' . $APIKey . \'&uid=\' . $UserID . \'&advert_type=\' . $ShortType . \'&url=\' . $source);\r\n}\r\n// Kwn.me shortener\r\nfunction shortKwnme($source) {\r\n	return file_get_contents(\'http://kwn.me/t.php?process=1&url=\' . $source);\r\n}\r\n\r\n\r\necho PHP_EOL, $text, PHP_EOL, PHP_EOL, reduceLinks($text, \'tinyurl\'), PHP_EOL;[/PHP]','0fb062bebe4ea8ecbf3192c018e6250efb4c6039',1,'2014-03-15 17:13:08','2014-05-14 13:25:14',1,1,NULL),(4,'Горячие клавиши в приложении, использование цифр, нарисованных в Photoshop','[VISUALBASIC]Public Class Form1\r\n    Private Const WM_HOTKEY As Integer = &H312\r\n    Public Declare Auto Function RegisterHotKey Lib \"user32\" (ByVal hWnd As IntPtr, ByVal id As Integer, ByVal fsModifiers As Integer, ByVal vk As Integer) As Boolean\r\n    Public Declare Auto Function UnregisterHotKey Lib \"user32\" (ByVal hWnd As IntPtr, ByVal id As Integer) As Boolean\r\n    Dim Pos As Point\r\n    Dim Koeff As Double\r\n    Dim BM As New Bitmap(My.Resources.Цифры)\r\n    Dim LetterWidth = BM.Width / 10\r\n    Dim L(9) As Bitmap\r\n    Dim Cnt As Integer = 0\r\n    Dim Center As Integer\r\n    Private Sub Form1_DoubleClick(ByVal sender As Object, ByVal e As System.EventArgs) Handles Me.DoubleClick\r\n        Close()\r\n    End Sub\r\n    Private Sub Form1_MouseMove(ByVal sender As Object, ByVal e As System.Windows.Forms.MouseEventArgs) Handles Me.MouseMove\r\n        WndProc(Message.Create(Me.Handle, &HA1, CType(2, IntPtr), 0))\r\n        Me.Capture = False\r\n    End Sub\r\n\r\n\r\n    Protected Overrides Sub WndProc(ByRef m As System.Windows.Forms.Message)\r\n        MyBase.WndProc(m)\r\n        If (m.Msg = WM_HOTKEY) Then\r\n            Dim hotKeyId As Integer = m.WParam.ToInt32()\r\n            If hotKeyId = 1020 Then\r\n                Cnt += 1\r\n                Write(Cnt)\r\n            End If\r\n        End If\r\n    End Sub\r\n\r\n    Private Sub Form1_Load(ByVal sender As System.Object, ByVal e As System.EventArgs) Handles MyBase.Load\r\n        RegisterHotKey(Me.Handle, 1020, Nothing, 192)\r\n        Pos = Location\r\n        Center = Screen.PrimaryScreen.WorkingArea.Width / 2 - Me.Width / 2\r\n        Koeff = Top / (Center - Left)\r\n        For I As Integer = 0 To 9\r\n            L(I) = New Bitmap(LetterWidth, BM.Height)\r\n            Dim G As Graphics = Graphics.FromImage(L(I))\r\n            G.DrawImage(BM, New Rectangle(0, 0, L(I).Width, L(I).Height), New Rectangle(LetterWidth * I, 0, L(I).Width, L(I).Height), GraphicsUnit.Pixel)\r\n        Next\r\n        Write(Cnt)\r\n        Dim Th As New System.Threading.Thread(AddressOf MoveToUp)\r\n        Th.Start(True)\r\n    End Sub\r\n\r\n    Sub MoveToUp(ByVal Opac As Boolean)\r\n        Do While Top > 0\r\n            If Left > Center Then\r\n                Left -= 4\r\n            Else\r\n                Left += 4\r\n            End If\r\n\r\n            Top = (Center - Left) * Koeff\r\n            If Opac = True Then\r\n                Me.Opacity = 1 - Top / Pos.Y\r\n            End If\r\n            System.Threading.Thread.Sleep(2)\r\n        Loop\r\n        Me.Top = 0 : Left = Center\r\n    End Sub\r\n\r\n    Sub Write(ByVal Cnt As Integer)\r\n        Dim Bmp As New Bitmap(Cnt.ToString.Length * LetterWidth, BM.Height)\r\n        Dim G As Graphics = Graphics.FromImage(Bmp)\r\n        For I As Integer = 0 To Cnt.ToString.Length - 1\r\n            G.DrawImage(L(Val(Cnt.ToString.ToArray(I))), New Rectangle(I * LetterWidth - (I * 5), 0, LetterWidth, BM.Height))\r\n        Next\r\n        PictureBox1.BackgroundImage = Bmp\r\n        Application.DoEvents()\r\n        My.Computer.Audio.Play(Application.StartupPath & \"add.wav\", AudioPlayMode.Background)\r\n        If Cnt = 10 Then\r\n            My.Computer.Audio.Play(Application.StartupPath & \"\\10.wav\", AudioPlayMode.WaitToComplete)\r\n        End If\r\n        If Cnt = 50 Then\r\n            My.Computer.Audio.Play(Application.StartupPath & \"\\50.wav\", AudioPlayMode.WaitToComplete)\r\n        End If\r\n        If Cnt = 100 Then\r\n            My.Computer.Audio.Play(Application.StartupPath & \"\\100.wav\", AudioPlayMode.WaitToComplete)\r\n        End If\r\n        If Cnt = 200 Then\r\n            My.Computer.Audio.Play(Application.StartupPath & \"\\200.wav\", AudioPlayMode.WaitToComplete)\r\n        End If\r\n        If Cnt = 300 Then\r\n            My.Computer.Audio.Play(Application.StartupPath & \"\\300.wav\", AudioPlayMode.WaitToComplete)\r\n        End If\r\n    End Sub\r\n\r\n    Private Sub Form1_FormClosing(ByVal sender As Object, ByVal e As System.Windows.Forms.FormClosingEventArgs) Handles Me.FormClosing\r\n        My.Computer.FileSystem.WriteAllText(Application.StartupPath & \"Stat.txt\", Cnt & vbTab & Now.ToShortDateString & vbTab & Now.ToLongTimeString & vbCrLf, True)\r\n    End Sub\r\n\r\n    Private Sub PictureBox1_Click(ByVal sender As Object, ByVal e As System.EventArgs) Handles PictureBox1.Click\r\n        Cnt += 1\r\n        Write(Cnt)\r\n    End Sub\r\n\r\n    Private Sub PictureBox1_DoubleClick(ByVal sender As Object, ByVal e As System.EventArgs) Handles PictureBox1.DoubleClick\r\n        Cnt += 1\r\n        Write(Cnt)\r\n        Cnt += 1\r\n        Write(Cnt)\r\n    End Sub\r\n\r\n    Private Sub Form1_MouseClick(ByVal sender As Object, ByVal e As System.Windows.Forms.MouseEventArgs) Handles Me.MouseClick\r\n        If e.Button = Windows.Forms.MouseButtons.Right Then\r\n            Pos = Location\r\n            Koeff = Top / (Center - Left)\r\n            MoveToUp(False)\r\n        End If\r\n    End Sub\r\nEnd Class[/VISUALBASIC]','bbfe230410a43ccae0d1d4cebfb204602566c37e',1,'2014-03-16 12:24:15','2014-05-03 16:56:15',1,NULL,NULL),(5,'WxPython','[PYTHON]#!/usr/bin/env python\r\n# -*- coding: utf-8 -*-\r\n \r\nimport wx\r\n\r\nclass Form1(wx.Frame):\r\n  def __init__(self):\r\n    wx.Frame.__init__(self, None, wx.ID_ANY, \'Исходная форма\', pos=(120, 150), size=(350, 250))\r\n\r\n    self.SetBackgroundColour(\"green\")\r\n    #создаем кнопку 1\r\n    self.button1 = wx.Button(self, id=-1, label=\'Кнопка 1\', pos=(8, 8), size=(175, 28))\r\n    #и привязываем к ней событие button1Click\r\n    self.button1.Bind(wx.EVT_BUTTON, self.button1Click)\r\n    #создаем кнопку 2\r\n    self.button2 = wx.Button(self, id=-1, label=\'Кнопка 2\', pos=(8, 38), size=(175, 28))\r\n\r\n    #отображаем форму\r\n    self.Show(True)\r\n        \r\n  def button1Click(self, event):\r\n    self.SetTitle(\"ААА жмякнули по Кнопке 1!!!\") #устанавливаем Caption формы\r\n\r\nclass Form2(wx.Frame):\r\n  #изменяем конструктор\r\n  def __init__(self, frame):\r\n    wx.Frame.__init__(self, None, wx.ID_ANY, \'Форма для действий\', pos=(500, 150), size=(320, 250))\r\n\r\n    self.SetBackgroundColour(\"green\")\r\n    #сохраняем переданный объект формы в переменную экземпляра (для обращения из других методов)\r\n    self.frame = frame\r\n\r\n    #создаем кнопки, устанавливаем события клика\r\n    self.button1 = wx.Button(self, id=-1, label=\'Скрыть кнопку\', pos=(8, 8), size=(175, 28))\r\n    self.button1.Bind(wx.EVT_BUTTON, self.button1Click)\r\n\r\n    self.button2 = wx.Button(self, id=-1, label=\'Показать кнопку\', pos=(8, 38), size=(175, 28))\r\n    self.button2.Bind(wx.EVT_BUTTON, self.button2Click)\r\n    self.button2.Hide() #скрываем вторую кнопку до необходимости\r\n\r\n    #отображаем форму\r\n    self.Show(True)\r\n        \r\n  def button1Click(self, event):\r\n    self.frame.button1.Hide() #скрываем кнопку из формы, которую передали в конструктор\r\n    self.SetTitle(\"Скрыли кнопку\")\r\n    self.button1.Hide() #скрываем одну кнопку\r\n    self.button2.Show() #и отображаем вторую\r\n        \r\n  def button2Click(self, event):\r\n    self.SetTitle(\"Отобразили кнопку\")\r\n    self.frame.button1.Show() #отображаем кнопку из формы, которую передали в конструктор\r\n    self.button2.Hide()\r\n    self.button1.Show()\r\n \r\napplication = wx.PySimpleApp()\r\n#создаем первую форму\r\nwindow = Form1()\r\n#создаем вторую форму, передавая в конструктор первую\r\nwindow2 = Form2(window)\r\n#еще какие-то действия с формами..\r\n\r\n#запускаем приложение\r\napplication.MainLoop()[/PYTHON]','0d83ce49d4e50d468a64d11151003f01cc320dc6',1,'2014-03-21 17:15:47','2014-05-14 13:25:29',1,1,NULL),(6,'Emacs config','[COMMON_LISP];; Set up the Common Lisp environment\r\n;; Настройка Common Lisp окружения\r\n(add-to-list \'load-path \"/usr/share/common-lisp/source/slime/\")\r\n(setq inferior-lisp-program \"/usr/bin/sbcl\")\r\n(require \'slime)\r\n(slime-setup)\r\n\r\n;; Text and the such\r\n;; Use colors to highlight commands, etc.\r\n(global-font-lock-mode t) \r\n;; Disable the welcome message\r\n(setq inhibit-startup-message t)\r\n;; Format the title-bar to always include the buffer name\r\n(setq frame-title-format \"emacs - %b\")\r\n;; Display time\r\n(display-time)\r\n;; Make the mouse wheel scroll Emacs\r\n(mouse-wheel-mode t)\r\n;; Always end a file with a newline\r\n(setq require-final-newline t)\r\n;; Stop emacs from arbitrarily adding lines to the end of a file when the\r\n;; cursor is moved past the end of it:\r\n(setq next-line-add-newlines nil)\r\n;; Flash instead of that annoying bell\r\n(setq visible-bell t)\r\n;; Remove icons toolbar\r\n(if (> emacs-major-version 20)\r\n(tool-bar-mode -1))\r\n;; Use y or n instead of yes or not\r\n(fset \'yes-or-no-p \'y-or-n-p) \r\n\r\n(set-language-environment \'utf-8)\r\n(setq slime-net-coding-system \'utf-8-unix)\r\n\r\n(defun faces_x ()\r\n;; these are used when in X\r\n(custom-set-faces\r\n\'(default ((t (:foreground \"wheat\" :background \"black\"))))\r\n\'(flyspell-duplicate ((t (:foreground \"Gold3\" :underline t :weight normal))))\r\n\'(flyspell-incorrect ((t (:foreground \"OrangeRed\" :underline t :weight normal))))\r\n\'(font-lock-comment-face ((t (:foreground \"SteelBlue1\"))))\r\n\'(font-lock-function-name-face ((t (:foreground \"gold\"))))\r\n\'(font-lock-keyword-face ((t (:foreground \"springgreen\"))))\r\n\'(font-lock-type-face ((t (:foreground \"PaleGreen\"))))\r\n\'(font-lock-variable-name-face ((t (:foreground \"Coral\"))))\r\n\'(menu ((((type x-toolkit)) (:background \"light slate gray\" :foreground \"wheat\" :box (:line-width 2 :color \"grey75\" :style released-button)))))\r\n\'(mode-line ((t (:foreground \"black\" :background \"light slate gray\"))))\r\n\'(tool-bar ((((type x w32 mac) (class color)) (:background \"midnight blue\" :foreground \"wheat\" :box (:line-width 1 :style released-button))))))\r\n(set-cursor-color \"deep sky blue\")\r\n(set-foreground-color \"wheat\")\r\n(set-background-color \"black\")\r\n(set-face-foreground \'default \"wheat\")\r\n(set-face-background \'default \"black\"))\r\n(defun faces_nox ()\r\n;; these are used when in terminal\r\n(custom-set-faces\r\n\'(default ((t (:foreground \"white\" :background \"black\"))))\r\n\'(font-lock-comment-face ((t (:foreground \"magenta\"))))\r\n\'(font-lock-function-name-face ((t (:foreground \"red\"))))\r\n\'(font-lock-keyword-face ((t (:foreground \"green\"))))\r\n\'(font-lock-type-face ((t (:foreground \"blue\"))))\r\n\'(font-lock-string-face ((t (:foreground \"cyan\"))))\r\n\'(font-lock-variable-name-face ((t (:foreground \"blue\"))))\r\n\'(menu ((((type x-toolkit)) (:background \"white\" :foreground \"black\" :box (:line-width 2 :color \"grey75\" :style released-button)))))\r\n\'(modeline ((t (:foreground \"blue\" :background \"white\")))))\r\n(set-cursor-color \"blue\")\r\n(set-foreground-color \"white\")\r\n(set-background-color \"black\")\r\n(set-face-foreground \'default \"white\")\r\n(set-face-background \'default \"black\"))\r\n(if window-system\r\n(faces_x)\r\n(faces_nox))\r\n\r\n(ido-mode t) \r\n(show-paren-mode t)[/COMMON_LISP]','c8a21697d0336df37fdaf475e4d372d45a378379',1,'2014-03-23 07:16:26','2014-05-14 13:25:38',1,1,NULL),(7,'.gitignore','[RUBY]*.rbc\r\n*.sassc\r\n.sass-cache\r\ncapybara-*.html\r\n.rspec\r\n.rvmrc\r\n/.bundle\r\n/vendor/bundle\r\n/log/*\r\n/tmp/*\r\n/db/*.sqlite3\r\n/public/system/*\r\n/cov