    array (\r\n      0 => \'Гость\',\r\n    ),\r\n  ),\r\n  \'Заблокирован\' => array (\r\n    \'type\' => 2,\r\n    \'description\' => \'\',\r\n    \'bizRule\' => NULL,\r\n    \'data\' => NULL,\r\n    \'children\' => \r\n    array (\r\n      0 => \'Гость\',\r\n    ),\r\n  ),\r\n  \'Пользователь\' => array (\r\n    \'type\' => 2,\r\n    \'description\' => \'\',\r\n    \'bizRule\' => NULL,\r\n    \'data\' => NULL,\r\n    \'children\' => \r\n    array (\r\n      0 => \'Гость\',\r\n      1 => \'viewUsers\',\r\n      2 => \'readUser\',\r\n      3 => \'createArticle\',\r\n      4 => \'updateOwnData\',\r\n    ),\r\n  ),\r\n  \'Модератор\' => array (\r\n    \'type\' => 2,\r\n    \'description\' => \'\',\r\n    \'bizRule\' => NULL,\r\n    \'data\' => NULL,\r\n    \'children\' => \r\n    array (\r\n      0 => \'Пользователь\',\r\n      1 => \'updateUser\',\r\n      2 => \'updateArticle\',\r\n      3 => \'allowArticle\',\r\n    ),\r\n  ),\r\n  \'Администратор\' => array (\r\n    \'type\' => 2,\r\n    \'description\' => \'\',\r\n    \'bizRule\' => NULL,\r\n    \'data\' => NULL,\r\n    \'children\' => \r\n    array (\r\n      0 => \'Модератор\',\r\n      1 => \'banUser\',\r\n      2 => \'changeRole\',\r\n      3 => \'createCategory\',\r\n      4 => \'allowCategory\',\r\n      5 => \'updateCategory\',\r\n      6 => \'deleteCategory\',\r\n    ),\r\n  ),\r\n  \'Создатель\' => array (\r\n    \'type\' => 2,\r\n    \'description\' => \'\',\r\n    \'bizRule\' => NULL,\r\n    \'data\' => NULL,\r\n    \'children\' => \r\n    array (\r\n      0 => \'Администратор\',\r\n      1 => \'deleteUser\',\r\n    ),\r\n  ),\r\n);[/PHP]','4394f72b6e6d4e5909341eec55ae0e991d07e8a2',1,'2014-03-28 14:31:04','2014-05-14 13:26:04',1,1,NULL),(9,'Unnamed #9','[PHP]<?php\r\nfunction add_image($page)\r\n{\r\n    $images = [\'main\' => \'image1.jpg\', \'contact\' => \'image2.jpg\', \'about\' => \'image3.png\'];\r\n    return isset($images[$page]) ? $images[$page] : \'default-img.jpg\';\r\n}\r\n?>\r\n.....\r\n<ul class=\"slider\">\r\n<?php echo add_image(\'....\'); ?>\r\n<li>...</li>\r\n.....\r\n</ul>[/PHP]','bbb020b82fe8ed0aba1d207bb8953bc21b17f64c',1,'2014-03-30 12:36:52','2014-05-14 13:26:32',1,1,NULL),(10,'Unnamed #10','[VISUALBASIC]Function IsSimple (ByVal n As Integer)\r\n    Dim i As Integer, last As Integer = n - 1\r\n    For i = 2 to last\r\n        Return False If n % i = 0            \r\n    Next\r\n    Return True\r\nEnd Function[/VISUALBASIC]','3ff9c98987614ffa7620480a510981374c6c90e0',1,'2014-03-31 18:08:12','2014-05-14 13:26:53',1,1,NULL),(11,'Unnamed #11','Чем бы дитя ни тешилось, лишь бы туда, куда не дано, не лезло..\r\n[URL=\"http://www.cyberforum.ru/about-forum/announcement8.html\"]Как правильно задавать вопросы[/URL]\r\n[COLOR=\"Gray\"][FONT=\"Lucida Console\"]Вечный ученик и маньяк деталей (с) [/FONT][/COLOR]','daa8d525d747f5fd66adf7214610998a2426148d',1,'2014-04-04 20:42:41','2014-06-16 11:40:04',1,1,NULL),(12,'Unnamed #12','[RUBY]#!/usr/bin/env ruby\r\n# -*- coding: utf-8 -*-\r\n\r\nrequire \'watir-webdriver\'\r\nrequire_relative \'string\'\r\n\r\nclass Browser\r\n\r\n  def initialize\r\n    @content = nil\r\n    @browser = nil\r\n    @link = nil\r\n    @links = nil\r\n    @client = nil\r\n    @info = {}\r\n  end\r\n\r\n  def close\r\n    @browser.close\r\n  end\r\n\r\n  def client timeout=180\r\n    @client ||= Selenium::WebDriver::Remote::Http::Default.new\r\n    @client.timeout ||= timeout\r\n  end\r\n\r\n  def browser browser=:ff\r\n    client\r\n    @browser ||= Watir::Browser.new :ff, :http_client => @client\r\n    @browser ||= Watir::Browser.new\r\n  end\r\n\r\n  def open link \r\n    browser\r\n    puts \'open link \' + link + \'...\'\r\n    @link = link\r\n    @browser.goto @link\r\n  end\r\nend[/RUBY]','63b8e02e837913d409df5684dd25e440f2343b8b',1,'2014-04-22 13:34:48','2014-05-14 15:35:46',1,1,NULL),(13,'Unnamed #13','[JAVASCRIPT]$(\"a[id^=thread_title]\").each(function() {\r\n  addModerActions(this)\r\n  $(this).click(function() {\r\n    $(this).css(\"color\", $(this).css(\"color\") == \"red\" ? \"#D38A8A\" : \"#CCC\")\r\n  })\r\n})[/JAVASCRIPT]','1482efd3dc7e133a08a5d73deb831f3a077187ab',1,'2014-04-24 13:05:24','2014-05-14 15:35:35',1,1,NULL),(14,'UserScript','[JAVASCRIPT]// ==UserScript==\r\n// @name ModerLinks\r\n// @include http://www.cyberforum.ru/*\r\n// @require  http://ajax.googleapis.com/ajax/libs/jquery/1.4.2/jquery.min.js\r\n// @version 0.5\r\n// @grant unsafeWindow\r\n// ==/UserScript==\r\n(function (window, undefined) {\r\n    var w = typeof unsafeWindow != undefined ? unsafeWindow : window;\r\n    if (w.self != w.top || ! /^http:\\/\\/(?:www\\.)?cyberforum\\.ru/.test(w.location.href))\r\n        return\r\n    var\r\n        params = {\r\n            checkVisitedLinks: true, //снятие выделения жирным с посещенных ссылок\r\n            repairShowHidePost: true, //скрывать/отображать сообщения по нажатию \"+\"\r\n            maxTitleLength: 110, //максимальная длина заголовка\r\n            minWordsInTitle: 2, //минимальное число слов в заголовке\r\n        }\r\n    //пробегаемся по каждой ссылке на тему\r\n    $(\"a[id^=thread_title]\").each(function() {\r\n        //добавляем дополнительные кнопки\r\n        addModerActions(this)\r\n        params.checkVisitedLinks && visitedLinks(this)\r\n        params.repairShowHidePost && repairShowPost(this)          \r\n    })\r\n    function visitedLinks(el)\r\n    {\r\n        $(el).click(function() {\r\n            $(el).css(\"font-weight\", \"normal\")\r\n        })\r\n    }\r\n    function repairShowPost(el)\r\n    {\r\n        $(el).parent().find(\"img[id^=vbpostimg_]\").click(function(e) {\r\n            $(\"table#post\" + el.id.replace(/\\D+/g, \'\')).toggle()\r\n            $(el).attr(\"src\", \"/images/buttons/expand\" + -1 !== el.src.indexOf(\"_collapsed\") ? \"_collapsed.gif\" : \".gif\")\r\n        })\r\n    }\r\n    function addModerActions(elem)\r\n    {\r\n        //проверяем заголовок (для выделения цветом \"невалидных\" ссылок)\r\n        checkTitle(elem, null, true)\r\n        //создаем нашу кнопку\r\n        var\r\n            lnk = $(\'<a href=\"#\" style=\"cursor:pointer;float:right;margin-right:15px\">&nbsp;</a>\'),\r\n            title = checkTitle(elem, null, false)\r\n        lnk.html(\'<img src=\"/images/misc/userfield_edit.gif\" alt=\"Исправить заголовок\" />\')\r\n        //добавляем нашу кнопку к ссылке\r\n        $(elem).parent().append(lnk)\r\n        $(elem).parent().append(\r\n        \'<span class=\"ajax_load\" style=\"float:right;color:#666;font-size:11px\">\\\r\n        Загрузка... <img style=\"width:13px\" src=\"/images/misc/progress.gif\">\\\r\n        </span>\'\r\n        )\r\n        lnk.click(function(e) {\r\n            e.preventDefault()\r\n            //при нажатии на кнопку отображаем диалог изменения заголовка\r\n            $(\".ajax_load\").show()\r\n            editTitle(elem, title)\r\n        })\r\n        $(\".ajax_load\").hide()\r\n        //делаем возможным использовать двойной клик мышкой при наличии нашего поля ввода\r\n        $(elem).parent().dblclick(function(e) {\r\n            if($(\"#new_title\").length)\r\n                return false\r\n            //а также меняем цвет ссылки на стандартный (если изменяли не этим скриптом)\r\n            $(elem).css(\"color\", \"#006000\")\r\n        })\r\n    }\r\n    function checkTitle(elem, title, status)\r\n    {\r\n        if(!title)\r\n            title = $(elem).text()\r\n        title = title.replace(/([-,;!?\\s])\\s*?\\1+/g, \"$1\").replace(/(\\s)\\s+/g, \"$1\")\r\n        \r\n        var\r\n            matches = title.match(/\\s+/g), //поиск пробелов (для нахождения количества слов) в заголовке\r\n            orig_title = title,\r\n            word_matches = null,\r\n            //запрещенные слова\r\n            words = /\\s*?(?:мерный|функц[ыи]{2,}|цикл[уеыаоэюьия][ъь]|структур|масс?ив|списо?к|зада(?:ч|ни)|чайник|нович|требу[юе]т|(?:под|рас?)?скажи|нуже?н|необходим|здрав?(?:ия|ствуй)|пр[еи]ве[дт]|he+?lp|пл(?:и)+?[сз]|пр[ао]блем|р[ие]шит|п[ао]м[ао][чщг]|срочн|вопрос?|х[эе]лп|problem|trouble|question|pomog(?:i)?|please?|пожалуйста).*(?=[^a-zа-яё])?\\s*?/gi\r\n        //регулярки и соответствующие замены для исправления заголовка\r\n        var replaces = [\r\n            [/((?!н[аео]|[вус]|из-?з?а?|под)[^.?!,;:-])\\s+?((?:(?:н[аео]|[вус]|из-?з?а?|под)\\s+?)?(?:как|[а-яё]+?дя|куда|котор[аыуо][еюяймх]|[а-яё]+?ю[шщ][уиаею][егйюямх]|а|где|что\\s*?бы|то|если)[^а-яё])/gi , \"$1, $2\"],\r\n            [/([-,;!?\\s])\\s+?\\1+/g, \"$1\"],\r\n            [/^[^a-z\\dа-яё«“”„\"\'\\[]+/gi, \"\"],\r\n            [/кол-в([аоу])/gi, \"количеств$1\"],\r\n            [/[еэ]л(?:емен|-)т/gi, \"элемент\"],\r\n            [/[A-Z]{4,}|[А-ЯЁ]{2,}/g, lowercase], //удаление капса. Если удалять все заглавные буквы - [/[A-ZА-ЯЁ]+?/g, lowercase],\r\n            [/([жш])ы/gi, \"$1и\"],\r\n            [/про(?:г|жк)(?=[ау])/gi, \"программ\"],\r\n            [/^[a-zа-яё]/, upcase],\r\n            [/(?:[.!?]\\s*)[а-яё]/gi, upcase],\r\n            [/\\s*([:.!?,]|\\S(?=\\())\\s*(?!NET|[,\\d])/g, \"$1 \"],\r\n            [/(н)айди.*?(?=[^a-zа-я])/gi, \"$1айти\"],\r\n            [/(вы?ве)ди.*?(?=[^a-zа-я])/gi, \"$1сти\"],\r\n            [/(узна|определи|реши|вычисли|созда)й?(?:те)?(?!ть)([^а-яё])/gi, \"$1ть$2\"],\r\n            [/(состав)ь?(?:те)?([^а-яё])/gi, \"$1ить$2\"],\r\n            [/(напи)ши(?:те)?([^а-яё])/gi, \"$1сать$2\"],\r\n            [/[^)a-zа-яё?\"»“”„\\]}+\'d]+$/gi, \"\"]\r\n        ],\r\n        //вводные слова\r\n        parenttheses = [\r\n            \"а(?:быть\\\\s+?может|вернее(?:\\\\s+?сказать)?|впрочем|главное|значит|лучше\\\\s+?сказать|между\\\\s+?прочим|может\\\\s+?быть|наоборот|например|следовательно|точнее)\",\r\n            \"б(?:е(?:з(?:\\\\s+?всякого)?(?:условно|\\\\s+?(?:шуток|сомнения))|сспорно)|лагодарение\\\\s+?богу|ог\\\\s+?даст|ол(?:ьш|е)е\\\\s+?того|ыть\\\\s+?может)\",\r\n            \"вдобавок\\\\s+?ко\\\\s+?всему\\\\s+?прочему\",\r\n            \"ве(?:р(?:и(?:шь|те)\\\\s+?ли|(?:нее(?:\\\\s+?(?:говоря|сказать))?|оятн(?:о|ее\\\\s+?всего)))|стимо)\",\r\n            \"в(?:и(?:шь|д(?:ать|имо|ит\\\\s+?бог|и(?:шь|те)\\\\s+?ли|но))|\\\\s+?конце\\\\s+?концов|не(?:\\\\s+?всякого)?\\\\s+?сомнения|\\\\s+?общем(?:-то)?|о\\\\s+?всяком\\\\s+?случае)\",\r\n            \"в(?:о?[\\\\s-](?:первых|вторых|третьих)|о(?:зможно|истину|образи(?:те)?(?:\\\\s+?себе)?|обще(?:-то)?(?:\\\\s+?говоря)?)|(?:прочем|ыходит|\\\\s+?(?:принципе|самом\\\\s+?деле|свою\\\\s+?очередь|сущности(?:\\\\s+?говоря)?|частности)))\",\r\n            \"(?:грешным|главным)\\\\s+?делом\",\r\n            \"(?:грубо\\\\s+?)?говоря\",\r\n            \"д(?:а\\\\s+?и\\\\s+?то\\\\s+?сказать|ай\\\\s+?бог\\\\s+?память|опустим|ругими\\\\s+?словами)\",\r\n            \"е(?:сли\\\\s+?(?:позволи(?:те|ишь)|угодно|хо(?:чешь|тите)(?:\\\\s+?знать)?)|стественно)\",\r\n            \"знамо(?:\\\\s+?дело)?\",\r\n            \"(?:и\\\\s+?)?вообще(?!-то)\",\r\n            \"и(?:\\\\s+?(?:кроме\\\\s+?того|лучше\\\\s+?того|наоборот)|наче(?:\\\\s+?говоря|\\\\s+?сказать)?|\\\\s+?(?:однако|правда|таким\\\\s+?образом|того\\\\s+?(?:лучше|хуже)))\",\r\n            \"ка(?:ж(?:ется|ись)|залось(?: бы)?|к (?:(?:бы т(?:о|ам) ни было|вам известно|вид(?:ите|ишь|но)|водится|всегда|выясн(?:илось|яется)|говор(?:илось|ится|ят)|знать|известно|исключение|(?:по|на) заказу?|назло|например|нарочно|ни говори(?:те)?|странно|обычно|оказ(?:алось|ывается)|полагается|положено|правило|принято(?: говорить)?|сказать|следствие|это ни странно)))\",\r\n            \"к\\\\s+?(?:вашему\\\\s+?сведению|несчастью|огорчению)\",\r\n            \"ко(?:нечно|ротко\\\\s+?говоря|роче(?:\\\\s+?говоря)?|всему\\\\s+?прочему)\",\r\n            \"к\\\\s+?(?:примеру(?:\\\\s+?сказать)?|прискорбию|радости(?:\\\\s+?своей)?|слову(?:\\\\s+?сказать)?|сожалению)\",\r\n            \"к(?:роме\\\\s+?(?:всего\\\\s+?прочего|э?того|шуток)|стати(?:\\\\s+?говоря|\\\\s+?сказать)?)\",\r\n            \"к\\\\s+?(?:стыду(?:\\\\s+?своему)?|счастью|твоему\\\\s+?сведению|удивлению|ужасу|чести)\",\r\n            \"м(?:ол|ягко\\\\s+?(?:выражаясь|говоря)|ало\\\\s+?того|ожно\\\\s+?сказать|ежду\\\\s+?(?:нами(?:\\\\s+?говоря)?|прочим))\",\r\n            \"н(?:е(?:бось|сомненно)|а(?:верное?|до\\\\s+?полагать|(?:конец|оборот|пример|против|\\\\s+?(?:мой\\\\s+?взгляд|несчастье|первый\\\\s+?взгляд|самом\\\\s+?деле|счастье|твой\\\\s+?взгляд|худой\\\\s+?конец))))\",\r\n            \"(?:но\\\\s+?)?(?:кроме\\\\s+?того|вообще[\\s-]то)\",\r\n            \"о(?:днако(?:\\\\s+?же)?|пределенно|ткровенно(?:\\\\s+?говоря|\\\\s+?сказать)?|чевидно)\",\r\n            \"по(?:-вашему(?:\\\\s+?мнению)?|вери(?:те|шь)\\\\s+?ли|(?:\\\\s+?всей\\\\s+?|-)(?:вероятности|видимо(?:му|сти)))\",\r\n            \"по(?:ди|жалуй(?:ста)?|\\\\s+?идее|-ихнему|\\\\s+?крайней\\\\s+?мере|ложим(?:те)?|мимо\\\\s+?(?:всего(?:\\\\s+?прочего)|э?того)|мнится|нятное\\\\s+?дело)\",\r\n            \"по\\\\s+?(?:обыкновению|обычаю|определению|правде(?:\\\\s+?говоря|сказать)?|преданию|прогнозам|сведениям|своему\\\\s+?обыкновению|словам|слухам)\",\r\n            \"по(?:\\\\s+?(?:сути(?:\\\\s+?дела|\\\\s+?говоря)?|существу(?:\\\\s+?говоря)?|счастью)|[\\\\s-](?:твоему(?:\\\\s+?мнению)?)|хоже|просту\\\\s+?говоря)\",\r\n            \"(?:проще|правду)\\\\s+?говоря\",\r\n            \"право(?:\\\\s+?же)?\",\r\n            \"с(?:амо\\\\s+?собой(?:\\\\s+?разумеется)?|кажем|корее\\\\s+?всего|лучаем|(?:трого|обственно)(?:\\\\s+?говоря)?|соответственно|\\\\s+?позволения\\\\s+?сказать|прашивается|тало\\\\s+?быть|удя\\\\s+?по\\\\s+?всему)\",\r\n            \"т(?:ак\\\\s+?(?:или\\\\s+?иначе|сказать)|очнее\\\\s+?говоря)\",\r\n            \"что\\\\s+?ни\\\\s+?говори(?:те)?\",\r\n            \"шутка\\\\s+?(?:ли)?(?:\\\\s+?сказать)?\",\r\n            \"ясное?\\\\s+?дело\"\r\n        ]\r\n        function prnttheses(full, before, text, after) {\r\n            var ret = before\r\n            if(/[^-.,?!;:_]/i.test(before))\r\n                ret += \", \"\r\n            ret += text\r\n            if(/[^-.,?!;:_]/i.test(after))\r\n                ret += \", \"\r\n            return ret + after\r\n        }\r\n        function upcase(match) {\r\n            return \" \" + match.toUpperCase()\r\n        }\r\n        function lowercase(match) {\r\n            var exceptions = [\r\n                \"бд\", \"vb[as]?\", \"\\\\.?net\", \"asp\",\"com\",\"ole\",\"qt\",\"ios\",\"api\",\"w[cp]?f\",\"linq\",\"cli\",\"xna\",\"mvc\",\r\n                \"gui\",\"ide\",\"abc\",\"sql\",\"olap\",\"mdx\",\"[mnt]?asm\",\"d?[mo]s\",\"о(?:с|оп)\",\"uml\",\"gpss?\",\"sap\",\"nav\",\"ax\",\r\n                \"m?x[sm]l\",\"iis\",\"xampp\",\"rpg\",\"fps\",\"cd\",\"dvd\",\"bd\",\"db\",\"ssd\",\"ups\",\"bios\",\"bsod\",\"cmd\",\"bat\",\"faq\",\r\n                \"sca[ld]a\",\"кип\",\"plc\",\"свч\",\"amd\",\"intel\",\"access\",\"oracle\",\"html?\",\"php\",\"css?\",\"oop\",\"по\",\"no[dt]e\"\r\n            ]\r\n            return (new RegExp(exceptions.join(\"|\"), \"i\")).test(match) ? match : match.toLowerCase()\r\n        }\r\n        //убираем запрещенные слова\r\n        if(status && (word_matches = title.trim().match(words)))\r\n            for(var i = 0; i < word_matches.length; ++i)\r\n                if(!matches || matches.length < params.minWordsInTitle)\r\n                    title = title.replace(word_matches[i], \"\")\r\n                    \r\n        //поиск вводных слов и выделение запятыми\r\n        for(var i = 0; i < parenttheses.length; ++i)\r\n            title = title.replace(new RegExp(\"((?![-.?!:;_]).?)\\\\s*?(\" + parenttheses[i] + \")(?![а-яёa-z])\\\\s*?(.?)\", \'gi\'), prnttheses)\r\n            \r\n        //исправляем заголовок\r\n        for(var i = 0; i < replaces.length; ++i)\r\n            title = title.replace(replaces[i][0], replaces[i][1]).trim()\r\n        //если не найдено пробелов, или он только один, или исходный заголовок отличается от исправленного,\r\n        //то меняем цвет текущей ссылки на тему на красный\r\n        if(!matches || matches.length < params.minWordsInTitle || title != orig_title)\r\n            $(elem).css(\"color\",\"red\")\r\n            \r\n        if(/^(?:как|что|куда|почему|зачем)(?=[a-zа-яё ]).*?[^?]$/i.test(title))\r\n            title += \"?\"\r\n            \r\n        //если длина текста больше 120 (максимально допустимый), то заменяем последние два символа на \"..\"\r\n        if(title.length > params.maxTitleLength || title.length == params.maxTitleLength - 2 && !status)\r\n            title = title.substr(0, params.maxTitleLength - 2) + \"..\"\r\n        return title\r\n    }\r\n    function editTitle(elem, title)\r\n    {\r\n        //грузим текст, ищем в нем ключевые слова для определения заголовка\r\n        var\r\n            text = sendRequest(\r\n                \'/vbpost_ajax.php\',\r\n                \'ajax=1&do=vbpostget&postid=\',\r\n                $(elem).parent().find(\"img\").attr(\"id\").substring(10)\r\n            ),\r\n            new_titles = text.match(/[^)\\d:,.!?>-]*?(?:(?:и[зс]|под?)править|(?:у|до)ка(?:за|жи)|(?:из|от)образи|заменит|провести|постро|[ао]предели|[нз]а(?:полнит|пи[сш][^ь])|скольк|как|най[тд]и|переве[сд]|(?:рас)?положи|сформир|сдела(?:ть|й)|провер(?:[яи]ть|ьте)|(?:под|рас)?счита|выве[сд]|(?:на|о)(?:печат|пи(?:са|ши))|(?:со)?став[иь]т|вы(?:раз|числ)и|реализ(?:уй|ова)|реши|созда|разработа|узна).+(?![:;.!?])/gi)\r\n            \r\n        //если нашли одно из ключевых слов, то прогоняем его через наши фильтры\r\n        if(new_titles)\r\n        {\r\n            for(var i = 0; i < new_titles.length; ++i)\r\n                new_titles[i] = checkTitle(elem, new_titles[i].replace(/<br><b style=\'color:\\s*?#8282A7;font-style:italic;margin-left:5px\'>.*?<br>/gi, \'\'), false)\r\n            title = new_titles[0]\r\n        }\r\n        var titles = new_titles ? new_titles.length : 0\r\n        //удаляем старый блок (если был) и добавляем наше диалоговое окно с дополнительными кнопками\r\n        $(\"#box\").remove()\r\n        $(elem).parent().append(\r\n            \"<div id=\'box\'><b>Текст сообщения</b>:<br>\" + text +\r\n            \"<br><br>Исправить заголовок?<br><b>Предлагаемый заголовок</b>:<br>\" +\r\n            \"<form><textarea id=\'new_title\' maxlength=\'\" + params.maxTitleLength +\r\n            \"\' style=\'padding:5px;height:50px;width:400px\'>\" + checkTitle(elem, title, false) +\r\n            \"</textarea></form></div>\"\r\n        )\r\n        $(\"#box\").append(\r\n            \"<br><a href=\'#\' id=\'fill_title\' style=\'cursor:pointer;margin:5px;margin-left:250px;\' title=\'Дополнить заголовок\'><img style=\'width:15px;height:15px\' src=\'/images/misc/mgc_cb_evo/mgc_cb_evo_full.gif\' alt=\'Дополнить заголовок\' /></a>\" +\r\n            \"<a href=\'#\' id=\'edit_title\' style=\'cursor:pointer;margin:5px;margin-left:5px;\' title=\'Исправить заголовок\'><img src=\'/images/misc/userfield_edit.gif\' alt=\'Исправить заголовок\' /></a>\" + \r\n            \"<a href=\'#\' id=\'old_title\' style=\'margin:5px;margin-left: 5px\' title=\'Вставить текущий заголовок\'><img src=\'/images/misc/blog/lightning.gif\'></a>\" + \r\n            (titles > 1 ? \"<a href=\'#\' id=\'next_title_0\' style=\'text-decoration:none;cursor:pointer;margin:5px;\' title=\'Следующий заголовок\'><img src=\'/images/statusicon/subforum_new.gif\' alt=\'Следующий заголовок\' /> (\" + titles + \")</a>\" : \"\") +\r\n            \"<a href=\'#\' id=\'cancel\' <a href=\'#\' style=\'margin:5px;margin-left:25px;font-weight:bold\'>Отмена</a>\" +\r\n            \"<a href=\'#\' id=\'ok\' style=\'margin:5px;margin-left:15px;font-weight:bold\'>Ок</a>\" +\r\n            \"<br>\"\r\n        )\r\n        //При нажатии Enter сохраняем, при нажатии Esc отменяем редактирования (альтернатива кнопкам Ок и Отмена)\r\n        $(\"#new_title\").keypress(function(e) {\r\n            if(e.which !== 13 && e.which !== 27)\r\n                return;\r\n            e.preventDefault()\r\n            $(\"#box > a#\" + (e.which === 13 ? \"ok\" : \"cancel\")).trigger(\"click\")\r\n        })\r\n        $(\"#box > a\").click(function(e) {\r\n            e.preventDefault()\r\n            if(/^next_title_/i.test(this.id))\r\n            {\r\n                var id = this.id.replace(/\\D+/, \"\")\r\n                if(!new_titles)\r\n                    return\r\n                if(++id == new_titles.length)\r\n                    id = 0\r\n                $(this).attr(\"id\", \"next_title_\" + id)\r\n                $(\"#new_title\").val(new_titles[id])\r\n                return\r\n            }\r\n            //В зависимости от нажатой кнопки, либо вставляем старый заголовок,\r\n            //либо прогоняем текущий заголовок из поля ввода через фильтры и выходим из функции\r\n            if(this.id == \"edit_title\" || this.id == \"old_title\")\r\n            {\r\n                $(\"#new_title\").val(this.id == \"old_title\" ? $(elem).text() : checkTitle(elem, $(\"#new_title\").val(), false))\r\n                return\r\n            }\r\n            //Если нажали \"Дополнить заголовок\"\r\n            if(this.id == \"fill_title\")\r\n            {\r\n                var t = $(\"#box\").text().replace(/,/g,\'\').replace(/(\\s)\\s+/g,\"$1\").match(\r\n                    new RegExp(RegExp.escape($(\"#new_title\").val().replace(/\\.*$/g, \'\').replace(/,/g,\'\').replace(/(\\s)\\s+/g,\"$1\")) + \".+?[.,!?]\", \'im\')\r\n                )\r\n                if(t)\r\n                    $(\"#new_title\").val(checkTitle(elem, t[0], false))\r\n                return\r\n            }\r\n            //если нажали \"Отмена\", то изменяем цвет ссылки на стандартный, удаляем лишнее и выходим из функции\r\n            if($(this).text() == \"Отмена\")\r\n            {\r\n                $(elem).css(\"color\", \"#000080\")\r\n                $(\"#box\").remove()\r\n                return\r\n            }\r\n            //отправляем запрос на изменение заголовка\r\n            sendRequest(\r\n                \'/ajax.php\',\r\n                \'do=updatethreadtitle&securitytoken=\' + $(\"input[name=\'securitytoken\']\").val() + \'&title=\' + escape($(\"#new_title\").val()) + \'&t=\',\r\n                elem.href.match(/(?:thread)(\\d+)/i)[1]\r\n            )\r\n            //меняем цвет ссылки, изменяем заголовок\r\n            $(elem).css(\"color\", \"#006000\")\r\n            $(elem).text($(\"#new_title\").val())\r\n            //если еще не добавляли галку, то добавляем\r\n            if(!$(elem).parent().find(\"img.success\").length)\r\n                $(elem).parent().append(\"<img class=\'success\' src=\'/images/misc/tick.png\' />\")\r\n            $(\"#box\").remove()\r\n        })\r\n    }\r\n    function sendRequest(url, params, id)\r\n    {\r\n        var\r\n            t = $($.ajax({\r\n                    type: \"POST\",\r\n                    url: url,\r\n                    data: params + id,\r\n                    async: false,\r\n                    contentType: \"application/x-www-form-urlencoded; charset=UTF-8\"\r\n                }).response).find(\"#post_message_\" + id)\r\n        if(!t.length)\r\n            return\r\n        var ret = htmlspecialchars(t.text())\r\n        t.find(\"table\").each(function() {\r\n            if(!$(this).attr(\"class\"))\r\n                return\r\n            ret = ret.replace(\r\n                htmlspecialchars($(this).text()),\r\n                \"<br><b style=\'color:#8282A7;font-style:italic;margin-left:5px\'>Код \" +\r\n                ($(this).attr(\"class\") == \"unknown\" ? \"Code\" : $(this).attr(\"class\")) + \"</b><br>\"\r\n            )\r\n        })\r\n        \r\n        $(\".ajax_load\").hide()\r\n        \r\n        return ret.substring(0, 1500)\r\n    }\r\n    //защита от XSS\r\n    function htmlspecialchars(string) {\r\n        return $(\'<span>\').text(string).html()\r\n    }\r\n    RegExp.escape = function(s) {\r\n        return s.replace(/[$-\\/?[-^{|}]/g, \'\\\\$&\');\r\n    }\r\n})(window)[/JAVASCRIPT]','07ce8ae2b67534f77da64d6ab2654ad929e2072d',1,'2014-04-25 04:14:42','2015-03-06 12:37:01',0,1,'cyberforum.ru'),(15,'Unnamed #15','[C_CPP]#include <iostream>\r\n\r\nstruct foo\r\n{\r\n    int x;\r\n};\r\n\r\nint main()\r\n{\r\n    foo f1;\r\n    foo *f2 = &f1;\r\n    \r\n    f1.x = 10;\r\n    std::cout << f1.x << std::endl;\r\n    //меняем значение через указатель\r\n    f2->x = 20;\r\n    std::cout << f1.x << std::endl;\r\n    //смотрим адреса переменных\r\n    std::cout << &f1 << \" == \" << f2 << \" => \" << &f2 << std::endl;\r\n}[/C_CPP]\r\n[C_CPP]10\r\n20\r\n0xbf8bbf18 == 0xbf8bbf18 => 0xbf8bbf1c[/C_CPP]\r\n','fba76373e60724502af4d1ec2da7e9ae1b72c68a',1,'2014-04-25 16:38:27','2015-09-10 12:34:14',1,1,''),(16,'Михайло!2','[VISUALBASIC]        If Cnt = 10 Then\r\n            My.Computer.Audio.Play(Application.StartupPath & \"\\10.wav\", AudioPlayMode.WaitToComplete)\r\n        End If\r\n        If Cnt = 50 Then\r\n            My.Computer.Audio.Play(Application.StartupPath & \"\\50.wav\", AudioPlayMode.WaitToComplete)\r\n        End If\r\n        If Cnt = 100 Then\r\n            My.Computer.Audio.Play(Application.StartupPath & \"\\100.wav\", AudioPlayMode.WaitToComplete)\r\n        End If\r\n        If Cnt = 200 Then\r\n            My.Computer.Audio.Play(Application.StartupPath & \"\\200.wav\", AudioPlayMode.WaitToComplete)\r\n        End If\r\n        If Cnt = 300 Then\r\n            My.Computer.Audio.Play(Application.StartupPath & \"\\300.wav\", AudioPlayMode.WaitToComplete)\r\n        End If[/VISUALBASIC]','1210ee6d4e9289367103f3f64c1c137d36e1f69e',1,'2014-05-03 16:56:41','2014-05-03 16:56:56',1,NULL,NULL),(17,'Get Image from Ucoz','[PHP]<?php\r\nheader(\'Content-type: image/png\');\r\n$curl = curl_init(\'http://pamirych.ru/res/55.png\');\r\ncurl_setopt($curl, CURLOPT_RETURNTRANSFER, true);\r\ncurl_setopt($curl, CURLOPT_HEADER, false);\r\ncurl_setopt($curl, CURLOPT_USERAGENT, \'Mozilla/5.0 (X11; Linux i686) AppleWebKit/537.36 (KHTML, like Gecko) Ubuntu Chromium/34.0.1847.116 Chrom