ed #21','[VISUALBASIC]\'При старте программы открываю соединение\r\n\r\n            Dim BD() As String = IO.Directory.GetFiles(Environment.GetFolderPath(Environment.SpecialFolder.ApplicationData) & \"\\Mozilla\\Firefox\\Profiles\", \"places.sqlite\", IO.SearchOption.AllDirectories)\r\n            SQLconnect.ConnectionString = \"Data Source=\" & BD(0)\r\n            SQLconnect.Open()\r\n            Info(\"Добавление в BaseList начато\")\r\n            da.SelectCommand = New SQLiteCommand(\"SELECT * FROM [moz_places] WHERE url like \'%cyberforum%\'\", SQLconnect) \'\r\n            da.Fill(tbl)\r\n\r\n\r\n\r\n\r\n\'Один из методов, добавление данных в БД в цикле\r\n\r\n        Dim InsCommand As SQLite.SQLiteCommand\r\n        For I As Integer = 0 To Lnks.Count - 1\r\n            InsCommand = New SQLite.SQLiteCommand(\"INSERT INTO [moz_places] (url, title, rev_host, visit_count, hidden, typed, favicon_id, frecency, last_visit_date, guid) \" & _\r\n                    \"VALUES (\'\" & Lnks(I) & \"\', \'\', \'\', \'\', \'0\', \'0\', \'0\', \'0\', \'1355222226671000\', \'\" & GUID.NewGuid.ToString & \"\')\", SQLconnect)\r\n            InsCommand.ExecuteNonQuery()\r\n            Stat(Lnks(I), I + 1, CInt(((I + 1) / (Lnks.Count)) * 100))\r\n        Next\r\n\r\n\r\n\r\n\'Закрытие программы и соединения[/VISUALBASIC]','005e5ebff5ee73969fa1259711075da855d45990',1,'2014-05-13 09:17:38','2014-05-13 09:17:38',1,NULL,NULL),(23,'Михайло жгет','[B]1000000[/B] записей MySQL\r\n[PHP]<?php\r\nini_set(\'max_execution_time\', 1000);\r\nset_time_limit(1000);\r\n\r\n$start = microtime(true);\r\n\r\ntry\r\n{\r\n	$db = new PDO(\'mysql:host=localhost;dbname=test\', \'user\', \'pass\');\r\n	$db->setAttribute(PDO::ATTR_ERRMODE, PDO::ERRMODE_EXCEPTION);\r\n	$db->exec(\'DROP TABLE IF EXISTS `test`\');\r\n	$db->exec(\'CREATE TABLE `test`(\r\n				`id` INTEGER PRIMARY KEY AUTO_INCREMENT,\r\n				`name` VARCHAR(255) DEFAULT NULL,\r\n				`value`  VARCHAR(255) DEFAULT NULL\r\n				) ENGINE=MyISAM CHARSET=utf8 COLLATE=utf8_general_ci;\');\r\n	\r\n	$res = $db->prepare(\'INSERT INTO `test`(`id`, `name`, `value`) VALUES (NULL, :name, :value)\');\r\n	for($i = 0; $i < 1000000; ++$i)\r\n		$res->execute(array(\':name\' => \'foo \' . $i, \':value\' => (\'value \' . $i)));\r\n	$res = $db->query(\'SELECT COUNT(1) FROM `test`\');\r\n	$count = $res->fetch(PDO::FETCH_NUM);\r\n	echo $count[0];\r\n}\r\ncatch(PDOException $e) {\r\n	echo $e->getMessage();\r\n}\r\n\r\nprintf(\"\\n\\nСкрипт выполнялся %.4F сек.\\n\", microtime(true) - $start);[/PHP]\r\n[C]1000000\r\n\r\nСкрипт выполнялся 51.7686 сек.[/C]\r\n[B]1000000[/B] записей MongoDB\r\n[PHP]<?php\r\nini_set(\'max_execution_time\', 1000);\r\nset_time_limit(1000);\r\n\r\n$start = microtime(true);\r\n\r\ntry\r\n{\r\n	$connect = new MongoClient();\r\n	$connect->test->drop();\r\n	$table = $connect->test->test;\r\n	for($i = 0; $i < 1000000; ++$i)\r\n		$table->insert(array(\'name\' => \'foo \' . $i, \'value\' => \'value \' . $i));\r\n	echo $table->count();\r\n}\r\ncatch(Exception $e) {\r\n	echo $e->getMessage();\r\n}\r\n\r\nprintf(\"\\n\\nСкрипт выполнялся %.4F сек.\\n\", microtime(true) - $start);[/PHP]\r\n[C]1000000\r\n\r\nСкрипт выполнялся 103.1145 сек.[/C]\r\n[B]1000[/B] записей SQLite\r\n[PHP]<?php\r\nini_set(\'max_execution_time\', 1000);\r\nset_time_limit(1000);\r\n\r\n$start = microtime(true);\r\n\r\ntry\r\n{\r\n	$db = new PDO(\'sqlite:./test.db\');\r\n	$db->setAttribute(PDO::ATTR_ERRMODE, PDO::ERRMODE_EXCEPTION);\r\n	$db->exec(\'DROP TABLE IF EXISTS `test`\');\r\n	$db->exec(\'CREATE TABLE `test`(\r\n				`id` INTEGER PRIMARY KEY,\r\n				`name` VARCHAR(255) DEFAULT NULL,\r\n				`value`  VARCHAR(255) DEFAULT NULL\r\n				);\');\r\n	\r\n	$res = $db->prepare(\'INSERT INTO `test`(`name`, `value`) VALUES (:name, :value)\');\r\n	for($i = 0; $i < 1000; ++$i)\r\n		$res->execute(array(\':name\' => \'foo \' . $i, \':value\' => \'value \' . $i));\r\n	$res = $db->query(\'SELECT COUNT(1) FROM `test`\');\r\n	$count = $res->fetch(PDO::FETCH_NUM);\r\n	echo $count[0];\r\n}\r\ncatch(PDOException $e) {\r\n	echo $e->getMessage();\r\n}\r\n\r\nprintf(\"\\n\\nСкрипт выполнялся %.4F сек.\\n\", microtime(true) - $start);[/PHP]\r\n[C]1000\r\n\r\nСкрипт выполнялся 162.4012 сек.[/C]','101a78521d9a1fc3c51c445add1829d77227d1e1',1,'2014-05-13 11:37:23','2014-05-14 13:24:46',0,1,NULL),(24,'Unnamed #24','[RUBY]text = \'\r\nfor(i=0;i<5;i++)\r\n{\r\n  ........\r\n  for(.....)\r\n  {\r\n    ........\r\n    for(.....)\r\n    {\r\n      for (...)\r\n        for(...)\r\n         f\r\n    }\r\n    for(.....)\r\n    {\r\n      for (...)\r\n        for(...)\r\n         f\r\n    }\r\n    for(.....)\r\n    {\r\n      for (...)\r\n        for(...)\r\n         f\r\n    }\r\n      for (...)\r\n        f\r\n  }\r\n  \r\n}\r\nfor (...)\r\n  f\r\nfor (...)\r\n  f\'\r\n\r\nclass CountCycles\r\n\r\n  attr_reader :count\r\n\r\n  def initialize text\r\n    @text = text\r\n    @found = false\r\n    @count = 0\r\n    @brackets = 0\r\n    @length = text.length\r\n  end\r\n\r\n  def calculate\r\n  \r\n    ind = @text.index \'for\'\r\n\r\n    until ind.nil?\r\n      i = 1\r\n      \r\n      if @found \r\n        @count += 1\r\n        @text.sub! \'for\', \'\'\r\n        break unless (ind = @text.index \'for\')\r\n        \r\n        ind += 3\r\n        \r\n        i = search ind\r\n        break if i.nil?\r\n        #если нашли скобку\r\n        if @text[ind + i, 1] == \'{\'\r\n          @brackets += 1\r\n        end\r\n        i += 1 until @text[ind + i] == \'}\' or @text[ind + i, 3] == \'for\'\r\n        @brackets -= 1 if @text[ind + i] == \'}\'\r\n        break if i >= @length or @brackets.zero?\r\n        if @text[ind + i, 3] == \'for\'\r\n          i += 1 until @text[ind + i] == \')\'\r\n          i += 1\r\n          @count += 1\r\n          break if i >= @length\r\n          @text.sub! \'for\', \'\'\r\n        end\r\n      else\r\n        ind += 3\r\n        i = search ind\r\n        break if i.nil?\r\n        #если нашли фигурную скобку\r\n        if @text[ind + i] == \'{\'\r\n          @found = true\r\n          @brackets = 0\r\n        end\r\n      end\r\n    end\r\n  end\r\n  \r\n  private\r\n  \r\n  def search ind\r\n    i = 1\r\n    #ищем скобку\r\n    i += 1 until @text[ind + i] == \')\'\r\n    i += 1\r\n    return nil if i >= @length\r\n    #пропускаем пробелы\r\n    i += 1 while @text[ind + i + 1, 1] =~ /s/\r\n    i += 1\r\n    return i >= @length ? nil : i\r\n  end\r\nend\r\n\r\ncounter = CountCycles.new(text)\r\ncounter.calculate\r\nputs counter.count[/RUBY]\r\n[C]administrator@programmer:~/Ruby$ ruby test.rb\r\n11\r\nadministrator@programmer:~/Ruby$[/C]','372256b20251cd593cd00667eb99daf0bfa7ac48',1,'2014-05-14 07:32:05','2014-05-14 07:32:39',1,NULL,NULL),(25,'GUI on Ruby (with Green Shoes)','[RUBY]#!/usr/bin/env ruby\r\n# -*- coding: utf-8 -*-\r\n\r\nrequire \'green_shoes\'\r\n\r\n\r\n# are the values ​​in the text fields numbers?\r\ndef check_int?(comment, objects = {})\r\n  # if some attributes is nil\r\n  return false if objects[:num_1].nil? || objects[:num_2].nil? || comment.nil?\r\n\r\n  if objects[:num_1].text =~ /\\A\\d+?\\z/ && objects[:num_2].text =~ /\\A\\d+?\\z/\r\n    comment.text = \'OK\'\r\n    true\r\n  else\r\n    comment.text = \'Введено неверное значение\'\r\n    false\r\n  end\r\nend\r\n\r\n# lock the buttons from pressing them\r\ndef lock_buttons(*buttons)\r\n  buttons.map! do |btn|\r\n    btn.state = \"disabled\"\r\n  end\r\nend\r\n\r\n# unlock the buttons\r\ndef unlock_buttons(*buttons)\r\n  buttons.map! do |btn|\r\n    btn.state = nil\r\n  end\r\nend\r\n\r\n\r\n# create GUI with Shoes :)\r\nShoes.app width: 500, height: 500, title: \'Форма 1\' do\r\n\r\n  # first layer\r\n  stack :margin => 30 do\r\n\r\n    # some else layer)\r\n    stack :margin => 10 do\r\n      para \"ФИО\"\r\n      @fio = edit_line\r\n    end\r\n\r\n    # some else layer)\r\n    stack :margin => 10 do\r\n      para \"Номер группы\"\r\n      @group_number = edit_line\r\n    end\r\n\r\n    # some else layer)\r\n    stack do\r\n      para \"Сейчас\"\r\n      # output current date and time with timer\r\n      @time = para Time.now.strftime(\"%d.%m.%Y            %H:%M:%S\")\r\n      animate 1 do\r\n        @time.text = Time.now.strftime(\"%d.%m.%Y            %H:%M:%S\")\r\n      end\r\n    end\r\n\r\n    # some else layer)\r\n    stack do\r\n\r\n      # first button\r\n      button \"Старт\" do\r\n\r\n        # create new form\r\n        Shoes.app title: \'Задание к билету № n\', width: 500, height: 500 do\r\n          # some layer)\r\n          stack do\r\n\r\n            # first edit\r\n            @num_1 = edit_line do\r\n              # check value on key press\r\n              unless check_int? @comment, num_1: @num_1, num_2: @num_2\r\n                lock_buttons @plus, @minus, @multiplication, @division\r\n              else\r\n                unlock_buttons @plus, @minus, @multiplication, @division\r\n              end\r\n            end\r\n\r\n            # second edit\r\n            @num_2 = edit_line do\r\n              # check value on key press\r\n              unless check_int? @comment, num_1: @num_1, num_2: @num_2\r\n                lock_buttons @plus, @minus, @multiplication, @division\r\n              else\r\n                unlock_buttons @plus, @minus, @multiplication, @division\r\n              end\r\n            end\r\n\r\n            # comment label for status text\r\n            @comment = para \"Комментарий\"\r\n\r\n            # command layer\r\n            stack do\r\n              para \"Команды\"\r\n\r\n              # math buttons. On click values from edit inputs ​​are checked and expressions are executed if everything is OK\r\n\r\n              # plus\r\n              @plus = button \"+\", state: \"disabled\" do\r\n                @result.text = (@num_1.text.to_i + @num_2.text.to_i).to_s\r\n                @list_of_results.text += \"#{@num_1.text} + #{@num_2.text} = #{@result.text}\\n\"\r\n              end\r\n\r\n              # minus\r\n              @minus = button \"-\", state: \"disabled\" do\r\n                @result.text = (@num_1.text.to_i - @num_2.text.to_i).to_s\r\n                @list_of_results.text += \"#{@num_1.text} - #{@num_2.text} = #{@result.text}\\n\"\r\n              end\r\n\r\n              # multiplication\r\n              @multiplication = button \"*\", state: \"disabled\" do\r\n                @result.text = (@num_1.text.to_i * @num_2.text.to_i).to_s\r\n                @list_of_results.text += \"#{@num_1.text} * #{@num_2.text} = #{@result.text}\\n\"\r\n              end\r\n\r\n              # division Value 2 couldn\'t be a zero\r\n              @division = button \"/\", state: \"disabled\" do\r\n                unless @num_2.text.to_i == 0\r\n                  @result.text = (@num_1.text.to_i / @num_2.text.to_i).to_s\r\n                  @list_of_results.text += \"#{@num_1.text} / #{@num_2.text} = #{@result.text}\\n\"\r\n                else\r\n                  alert \"Ошибка: деление на ноль\"\r\n                  @result.text = \"0\"\r\n                  @list_of_results.text += \"#{@num_1.text} / #{@num_2.text} - Ошибка: деление на ноль\\n\"\r\n                end\r\n              end\r\n\r\n              # some function..\r\n              @function = button \"Функция\" do\r\n                #TODO: write function...\r\n              end\r\n\r\n              # reset edit values\r\n              @c = button \"C\" do\r\n                @num_1.text = @num_2.text = @result.text = \"0\"\r\n              end\r\n\r\n            end # end stack\r\n\r\n            #result fields\r\n            stack do\r\n              para \"Результат\"\r\n              @result = edit_line\r\n              @list_of_results = edit_box scroll: true, width: 300\r\n            end\r\n\r\n          end # end stack\r\n\r\n        end # end created Sub App\r\n\r\n      end # end Button \"Start\"\r\n\r\n      # exit from application\r\n      button \"Выход\" do\r\n        exit 0\r\n      end\r\n\r\n    end # end stack\r\n\r\n  end # end stack\r\n\r\nend # end App[/RUBY]','1f7a31ee055ceaee0357eaca05472c2b64d454ed',1,'2014-05-14 10:26:00','2014-06-12 10:30:30',0,1,NULL),(26,'JDK way to nextInt()','[JAVA]    public int nextInt(int radix) {\r\n        // Check cached result\r\n        if ((typeCache != null) && (typeCache instanceof Integer)\r\n            && this.radix == radix) {\r\n            int val = ((Integer)typeCache).intValue();\r\n            useTypeCache();\r\n            return val;\r\n        }\r\n        setRadix(radix);\r\n        clearCaches();\r\n        // Search for next int\r\n        try {\r\n            String s = next(integerPattern());\r\n            if (matcher.group(SIMPLE_GROUP_INDEX) == null)\r\n                s = processIntegerToken(s);\r\n            return Integer.parseInt(s, radix);\r\n        } catch (NumberFormatException nfe) {\r\n            position = matcher.start(); // don\'t skip bad token\r\n            throw new InputMismatchException(nfe.getMessage());\r\n        }\r\n    }[/JAVA]','046f9d0ecc8010021b66f8c4b184f097338e80a9',1,'2014-05-14 10:44:42','2014-06-04 07:10:19',1,NULL,NULL),(27,'Магирусу','Уважаемый [B]mik-a-el[/B]. Несколько дней тому назад, вы неожиданно для меня и без предупреждений обнулили мою репутацию на форуме. Если вы думаете что меня это не заинтересовало или же мне нечего сказать вам или вашему коллеге почетному-модератору magirus, то вы ошибаетесь. На самом деле я был очень занят на работе и не смог отправить вам мое сообщение. Извините. В первую очередь, хотел бы узнать причину по которой вы приняли решение обнулить мою репутацию. Если же это связано с \"накруткой\" репутации, то хочу обратить ваше внимание на следующий факт: каждый пользователь форума и даже новичок, имеет право просматривать сообщения других пользователей и благодарить их за размещенные в темах ответы столько раз сколько он посчитают нужным. Отсюда и берется \"накрутка\" репутации. Хочу вам напомнить, что согласно правилам форума, каждый пользователь может выражать благодарность за, понравившиеся ему, ответы других пользователей в темах, не более 20 раз в сутки: \"Общее количество спасибо и отзывов, которое может оставить один человек, ограничено и составляет 20 отзывов или спасибо в сутки.\" На практике, с технической точки зрения, \"накруткой репутации\" можно назвать ситуацию когда благодарности за ответы пользователя исходят от другого зарегистрировавшегося пользователя, который выполняет вход на форум с хоста с тем же IP-адресом, что и пользователь получающий благодарности. Одним словом, чем тратить свое время и время сист. администраторов сайта на отслеживание \"накруток репутации\" и т.п., я бы на вашем месте предпочел бы установить на сайте соответствующую защиту, например: sms-авторизацию при регистрации и входе на форум: каждый пользователь выполняющий регистрацию на сайте должен ввести контрольный номер моб. Регистрация нескольких пользователей с одним номером моб. невозможна. Вот собственно и все. Во-вторых, что касается рекомендации к награде, то согласно правилам форума, каждый пользователь имеет право рекомендовать самого себя к награде. По крайней мере существует такая техническая возможность. Если же вас и ваших коллег (таких как почетный модератор magirus) не устраивает это, то в ваших силах убрать технически возможность пользователя рекомендовать к награде самого себя. И, наконец, третее: как выразился ваш коллега супер-модератор magirus, я НЕ (!) \"орденопросец\". Удалив мою репутацию, своими действиями, вы выразили неуважение не только ко мне, но и к другим продвинутым участникам форума, которые не жалея своего личного времени в т.ч. и рабочего, сил, а также компьютерной техники, для помощи в решении задач для студентов и учащихся. Хочу Вам напомнить, что такая помощь как правило вознаграждается соответственно $$$. Своими действиями вы в первую очередь показали, что пока человек согласен работать помогая другим, не имея даже своего собственного имени на форуме, а только ник, всех все устраивает. И как только, человек опубликовал свои данные, или же попросил награду, пусть даже ошибочно, то такой пользователь форума стает нежелательным и никому не нужным. В заключении, Mi-ka-el, просил бы вас отнестись к вышесказанному с пониманием и восстановить репутацию которую я заслужил на форуме.\r\n\r\nС уважением, Артур Ратз. (zitxbit).\r\nmailto: arthur@ratz.com.ua','80803bc916221c768c359fd101ea787f2eaf6a1f',1,'2014-05-14 14:53:47','2014-07-25 08:47:15',1,NULL,'cyberforum.ru'),(28,'Unnamed #28','[B]Just for fun. Just for save.[/B]','ab0dbd43c1c8952f8fd976cd4c7bb89197f76616',1,'2014-05-18 17:11:22','2014-05-18 17:24:25',1,1,NULL),(29,'Unnamed #29','[java]import java.util.Collections;\r\nimport java.util.Arrays;\r\n\r\npublic class Test\r\n{\r\n	final static int len = 4;\r\n	static void printArray(int first, int last)\r\n	{\r\n		System.out.printf(\"%d \", last);\r\n		if(last > first)\r\n			printArray(first, --last);\r\n		else\r\n			return;\r\n	}\r\n\r\n	public static void main(String[] args)\r\n	{\r\n		int[] arr = {4, 5, 6};\r\n		Arrays.sort(arr);\r\n		\r\n		int min = arr[0];\r\n		int max = arr[arr.length - 1];\r\n		\r\n		printArray(getFirst(min), getLast(max));\r\n	}\r\n\r\n	public static int getLast(int max)\r\n	{\r\n		String ret = String.valueOf(max);\r\n		for(int i = 1; i < len; ++i)\r\n			ret += max;\r\n		return Integer.parseInt(ret);\r\n	}\r\n	public static int getFirst(int min)\r\n	{\r\n		String ret = String.valueOf(min);\r\n		for(int i = 1; i < len; ++i)\r\n			ret += min;\r\n		return Integer.parseInt(ret);\r\n	}\r\n}[/java]\r\n\r\n[c]6666 6665 6664 6663 6662 6661 6660 6659 6658 6657 6656 6655 6654 6653 6652 6651 6650 6649 6648 6647 6646 6645 6644 6643 6642 6641 6640 6639 6638 6637 6636 6635 6634 6633 6632 6631 6630 6629 6628 6627 6626 6625 6624 6623 6622 6621 6620 6619 6618 6617 6616 6615 6614 6613 6612 6611 6610 6609 6608 6607 6606 6605 6604 6603 6602 6601 6600 6599 6598 6597 6596 6595 6594 6593 6592 6591 6590 6589 6588 6587 6586 65