n        public TestDB()\r\n        {\r\n            dbPath = string.Format(\"{0}{1}\",AppDomain.CurrentDomain.BaseDirectory, \"TestDB.mdb\");\r\n            if (!File.Exists(dbPath))\r\n                throw new FileNotFoundException(\"Файл базы не найден!\");\r\n            else\r\n            {\r\n                string connStr = @\"Provider=Microsoft.Jet.OLEDB.4.0;Data Source=TestDB.mdb\";\r\n                dbConnection = new OleDbConnection(connStr);\r\n                dbConnection.Open(); \r\n            }\r\n        }\r\n        public void AddDataToBase(byte[] data)\r\n        {\r\n            if (ParseBuffer(data.ToList()))\r\n            {\r\n                OleDbParameter param = new OleDbParameter(\"@3\", SqlDbType.VarBinary);\r\n                param.Value = data;\r\n                string sql = string.Format(\"Insert Into Arcadia\" +\r\n                    \"(model, product, serial, data) Values\" +\r\n                    \"(\'{0}\',\'{1}\',\'{2}\',\'{3}\')\", Model, ProductNumber, SerialNumber, \"@3\");\r\n                using (OleDbCommand cmd = new OleDbCommand(sql, dbConnection))\r\n                {\r\n                    cmd.Parameters.Add(param);\r\n                    cmd.ExecuteNonQuery();\r\n                }\r\n            }\r\n        }\r\n        public List<byte> GetData(string key)\r\n        {\r\n            List<byte> data = new List<byte>();\r\n            string sql = \"Select * From Arcadia Where product Like \" + key;\r\n\r\n            using (OleDbCommand cmd = new OleDbCommand(sql, dbConnection))\r\n            {\r\n                OleDbDataReader dr = cmd.ExecuteReader();\r\n                while (dr.Read())\r\n                {\r\n                    data.AddRange((byte[])dr[\"data\"]);\r\n                }\r\n            }\r\n            return data;\r\n        }\r\n        public List<string> GetModels()\r\n        {\r\n            List<string> models = new List<string>();\r\n            string sql = \"Select model From Arcadia\";\r\n            using (OleDbCommand cmd = new OleDbCommand(sql, dbConnection))\r\n            {\r\n                OleDbDataReader dr = cmd.ExecuteReader();\r\n                while (dr.Read())\r\n                {\r\n                    models.Add((string)dr.GetValue(0));\r\n                }\r\n            }\r\n            return models;\r\n        }\r\n\r\n        //Метод проверки файла данных\r\n        public bool ParseBuffer(List<byte> list)\r\n        {\r\n            if (list.Count == 0 || list.Count > 0x4000)\r\n                return false;\r\n\r\n            //Start address\r\n            int startAddress = ((list[0] * 0x100) + list[1]) * 2 + 2;\r\n\r\n            //Check data length\r\n            if (startAddress >= list.Count - 25)\r\n                return false;\r\n\r\n            //Data marker\r\n            string marker = BitConverter.ToString(list.ToArray(), startAddress, 6).Replace(\"-\", \"\");\r\n\r\n            //Checking marker from enum\r\n            if (!Enum.IsDefined(typeof(Markers), long.Parse(marker)))\r\n                return false;\r\n\r\n            //Getting serial number\r\n            SerialNumber = BitConverter.ToString(list.GetRange(startAddress + 6, 6).ToArray())\r\n                            .Replace(\"-\", \"\")\r\n                            .Substring(0, 9);\r\n\r\n            //Getting product number\r\n            ProductNumber = BitConverter.ToString(list.GetRange(startAddress + 12, 6).ToArray())\r\n                            .Replace(\"-\", \"\")\r\n                            .Substring(0, 11);\r\n\r\n            //Getting model\r\n            Model = Encoding.ASCII.GetString(list.GetRange(startAddress + 18, 14)\r\n                                  .ToArray()).Replace(\"/\",\"\").Trim().Replace(\"\0\",\"\");\r\n\r\n            return true;\r\n        }\r\n        //Serial number property\r\n        public string SerialNumber\r\n        {\r\n            get;\r\n            private set;\r\n        }\r\n        //Product number property\r\n        public string ProductNumber\r\n        {\r\n            get;\r\n            private set;\r\n        }\r\n        //Model property\r\n        public string Model\r\n        {\r\n            get;\r\n            private set;\r\n        }\r\n        //Marker enumeration\r\n        enum Markers : long\r\n        {\r\n            WM_EVO_2 = 030609101111,\r\n            WM_Arcadia_1 = 030609101211,\r\n            WM_Arcadia_2 = 030609101212,\r\n            WM_Arcadia_3 = 030609101213,\r\n            WM_Arcadia_4 = 030609101214\r\n        }\r\n        //Data size enumeration\r\n        enum DataLength : byte\r\n        {\r\n            Serial_Number = 9,\r\n            Product_Number = 11,\r\n            Model = 14\r\n        }\r\n    }\r\n}\r\n[/CSHARP]','1e28d7377c682381bb0195071f367599cffb6a8e',1,'2014-06-04 08:43:46','2014-06-04 08:43:46',1,NULL,NULL),(35,'MyCode2','[CSHARP]\r\nusing System;\r\nusing System.Collections.Generic;\r\nusing System.ComponentModel;\r\nusing System.Data;\r\nusing System.Drawing;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Windows.Forms;\r\n\r\nusing System.IO;\r\n\r\nnamespace MyDataBaseTestProgram\r\n{\r\n    public partial class Form1 : Form\r\n    {\r\n        private TestDB test;\r\n        public Form1()\r\n        {\r\n            InitializeComponent();\r\n            this.Load += delegate { Load_Form(); };\r\n\r\n            button1.Click += delegate { TryToRead(); };\r\n        }\r\n        private void Load_Form()\r\n        {\r\n            try\r\n            {\r\n                test = new TestDB();\r\n            }\r\n            catch (Exception ex)\r\n            {\r\n                MessageBox.Show(ex.Message, \"Ошибка\");\r\n                return;\r\n            }\r\n        }\r\n\r\n        private void TryToRead()\r\n        {\r\n            if (test != null)\r\n            {\r\n                DirectoryInfo info = new DirectoryInfo(@\"C:ARC\");\r\n                FileInfo[] fInfo = info.GetFiles(\"*\", SearchOption.AllDirectories);\r\n                foreach (FileInfo i in fInfo)\r\n                {\r\n                    List<byte> temp = File.ReadAllBytes(i.FullName).ToList();\r\n                    test.AddDataToBase(temp.ToArray());\r\n                }\r\n\r\n                List<string> models = test.GetModels();\r\n\r\n                List<byte> data = test.GetData(\"24629080500\");\r\n            }\r\n            MessageBox.Show(\"Operation completed!\");\r\n\r\n        }\r\n    }\r\n}\r\n[/CSHARP]','1f2ac5daf1c7910101e3cff3039403097fc0da17',1,'2014-06-04 09:08:12','2014-06-04 09:08:12',1,NULL,NULL),(36,'а2007 запись в поля ole/memo','[VISUALBASIC]Private Sub ztype_DblClick(Cancel As Integer)\r\nMe.Refresh\r\n\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\r\nIf Me.ztype = \"x\" Then\r\nDebug.Print Me.zole.OLEType\r\n\'MsgBox Me.zole.OLEType\r\nDebug.Print Me.zole.OLETypeAllowed\r\n    zole.Class = \"Excel.Sheet\"    \' Set class name.\r\n    \' Specify type of object.\r\n    zole.OLETypeAllowed = acOLELinked\r\n    \' Specify source file.\r\n    zole.SourceDoc = \"c:\rabmmole.xls\"\r\n    \' Specify data to create link to.\r\n    zole.SourceItem = \"R1C1:R5C5\"\r\n    \' Create linked object.\r\n    zole.Action = acOLECreateLink\r\n    \' Adjust control size.\r\n    zole.SizeMode = acOLESizeZoom\r\n End If\r\n \'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\'\r\n If Me.ztype = \"t\" Then\r\nDebug.Print Me.zole.OLEType\r\n\'MsgBox Me.zole.OLEType\r\nDebug.Print Me.zole.OLETypeAllowed\r\n\'\'End Sub\r\n\'\'Sub Command1_Click()\r\n    zole.Class = \"notepad.text\"    \' Set class name.\r\n    \' Specify type of object.\r\n    \'zole.OLETypeAllowed = acOLELinked\r\n    \' Specify source file.\r\n    zole.SourceDoc = \"c:\rabmmole.a9\"\r\n    \' Specify data to create link to.\r\n    \'zole.SourceItem = \"R1C1:R5C5\"\r\n    \' Create linked object