 ss2\r\nMe.mm1 = ss1\r\nEnd If\r\n\r\n\r\nEnd Sub\r\n[/VISUALBASIC]','189266fe5d206c5cfd02c135bbe11fec2ac4abe0',1,'2014-06-05 04:02:28','2014-06-06 12:25:38',1,NULL,NULL),(38,'Unnamed #38','[CSHARP]\r\nusing System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Threading.Tasks;\r\n\r\nnamespace ConsoleApplication26\r\n{\r\n    class Program\r\n    {\r\n        public static event EventHandler myEvent;\r\n\r\n        static void Main(string[] args)\r\n        {\r\n            myEvent += Program_myEvent;  //Используем прямое указание на метод\r\n\r\n            myEvent += delegate { //Тут наши операторы... };     //Используем анонимный делегат\r\n\r\n            myEvent += (s,e) => { //Тут наши операторы... };     //Используем лямбда\r\n        }\r\n\r\n        static void Program_myEvent(object sender, EventArgs e)\r\n        {\r\n            //Тут наши операторы...\r\n        }\r\n       \r\n    }\r\n}\r\n}[/CSHARP]','ea9e434c5879fda5e2ed9e03062cc67e831676d1',1,'2014-06-06 15:59:28','2015-07-14 17:09:11',1,NULL,''),(39,'Unnamed #39','[CSHARP]using System;\r\nusing System.Collections.Generic;\r\nusing System.ComponentModel;\r\nusing System.Data;\r\nusing System.Drawing;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Threading.Tasks;\r\nusing System.Windows.Forms;\r\n\r\nnamespace WindowsFormsApplication1\r\n{\r\n    public partial class Form1 : Form\r\n    {\r\n        private bool created{ get; set; }\r\n\r\n        public Form1()\r\n        {\r\n            InitializeComponent();\r\n        }\r\n\r\n        private void button1_Click(object sender, EventArgs e)\r\n        {\r\n            MessageBox.Show(\"Hello, world!\");\r\n        }\r\n\r\n        private void button2_Click(object sender, EventArgs e)\r\n        {\r\n            changeBtnColor();\r\n        }\r\n\r\n        private void button3_Click(object sender, EventArgs e)\r\n        {\r\n            changeBtnColor();\r\n        }\r\n\r\n     