e void должностьToolStripMenuItem_Click(object sender, EventArgs e)\r\n        {\r\n            MessageBox.Show(\"Меню \'Должность\'\");\r\n        }\r\n\r\n        private void странаToolStripMenuItem_Click(object sender, EventArgs e)\r\n        {\r\n            MessageBox.Show(\"Меню \'Страна\'\");\r\n        }\r\n\r\n        private void регионToolStripMenuItem_Click(object sender, EventArgs e)\r\n        {\r\n            MessageBox.Show(\"Меню \'Регион\'\");\r\n        }\r\n\r\n        private void городToolStripMenuItem_Click(object sender, EventArgs e)\r\n        {\r\n            MessageBox.Show(\"Меню \'Город\'\");\r\n        }\r\n\r\n        private void иМНСToolStripMenuItem_Click(object sender, EventArgs e)\r\n        {\r\n            MessageBox.Show(\"Меню \'ИМНС\'\");\r\n        }\r\n    }\r\n}[/CSHARP]','dc5871c023dd87da80bb0d45c2062b72d4485d2d',1,'2014-06-17 01:27:25','2014-06-17 01:28:18',1,1,NULL),(40,'Unnamed #40','[SQL]SELECT\r\n    Сотрудники.Фамилия,\r\n    Сотрудники.Имя,\r\n    Сотрудники.Отчество,\r\n    Должности.Должность,\r\n    First(Должности.Ставка_в_день*Табель.Отработано_дней+NZ(Надбавки_за_стаж.Надбавка,0)+NZ(Удаленности.Надбавка,0)) AS К_выдаче\r\nFROM\r\n    ((((((Зарплаты\r\n        INNER JOIN Сотрудники ON Сотрудники.Код_сотрудника = Зарплаты.Код_сотрудника)\r\n        INNER JOIN Табель ON Табель.Код_сотрудника = Сотрудники.Код_сотрудника)\r\n        INNER JOIN Должности ON Должности.Код_должности = Сотрудники.Должность)\r\n        INNER JOIN Удаленности ON Удаленности.Код_удаленности = Сотрудники.Удаленность)\r\n        INNER JOIN Ученые_звания ON Ученые_звания.Код_ученого_звания = Сотрудники.Ученое_звание)\r\n        INNER JOIN Ученые_степени ON Ученые_степени.Код_ученой_степени = Сотрудники.Ученая_степень)\r\n        LEFT JOIN Надбавки_за_стаж ON Надбавки_за_стаж.Стаж = Сотрудники.Стаж\r\nGROUP BY Сотрудники.Фамилия, Сотрудники.Имя, Сотрудники.Отчество, Должности.Должность;[/SQL]','9c28a9f668173a322447587d2f175c96bd46a5e5',1,'2014-06-22 17:11:05','2014-06-22 17:11:05',1,1,NULL),(41,'CoffeeScript','[COFFEESCRIPT]$ ->\r\n  if $(\"#files ul li\").length\r\n    #show first tab\r\n    $(\"#files ul li a:first\").tab(\'show\')\r\n    $(\".tab-pane\").first().show()\r\n\r\n  #close tab on click \'x\'\r\n  $(document).on \'click\', \'#files ul li a .close_tab\', (e) ->\r\n    e.preventDefault\r\n    $.get \'/file/close_file\', {id: $(@).attr(\'data-id\')}, null, \'script\'\r\n    return false\r\n\r\n  #on tab click hide old tabs and show current\r\n  $(document).on \'click\', \'#files ul li a\', (e) ->\r\n    e.preventDefault()\r\n    $(\"#files .tab-pane\").children().removeClass(\'active\')\r\n    $(\"#files .tab-pane\").hide()\r\n    $(this).tab(\'show\')\r\n    $(\"#\" + @.className).parent().show()\r\n    $(\"#file\" + $(@).attr(\'data-id\')).show()\r\n\r\n  #open file on link dblclick\r\n  $(document).on \'dblclick\', \'.list-files a\', (e) ->\r\n    id = $(@).attr(\"data-id\")\r\n\r\n    if($(\".file#{id}\").length == 1)\r\n      $(\'#files ul li\').removeClass(\'active\')\r\n      $(\".file#{id}\").parent().addClass(\'active\')\r\n      $(\'#files .tab-pane\').children().removeClass(\'active\')\r\n      $(\'#files .tab-pane\').hide()\r\n      $(\".file#{id}\").tab(\'show\')\r\n      $(\"#file#{id}\").parent().show()\r\n      return false\r\n    else\r\n      $.get \'/file/open_file\', {id: id}, ->\r\n        $(\'#files ul li\').removeClass(\'active\')\r\n        $(\".file#{id}\").parent().addClass(\'active\')\r\n        $(\'#files .tab-pane\').children().removeClass(\'active\')\r\n        $(\'#files .tab-pane\').hide()\r\n        $(\".file#{id}\").tab(\'show\')\r\n        $(\"#file#{id}\").parent().show()\r\n      , \'script\'\r\n    return false\r\n\r\n  $(\'#tree\').fancytree\r\n    autoCollapse: true\r\n  $(\"#tree\").contextmenu\r\n    delegate: \"span.fancytree-title\",\r\n    menu: [\r\n      {title: \"Cut\", cmd: \"cut\", uiIcon: \"ui-icon-scissors\"},\r\n      {title: \"Copy\", cmd: \"copy\", uiIcon: \"ui-icon-copy\"},\r\n      {title: \"Paste\", cmd: \"paste\", uiIcon: \"ui-icon-clipboard\", disabled: false },\r\n      {title: \"----\"},\r\n      {title: \"Edit\", cmd: \"edit\", uiIcon: \"ui-icon-pencil\", disabled: true },\r\n      {title: \"Delete\", cmd: \"delete\", uiIcon: \"ui-icon-trash\", disabled: true },\r\n      {title: \"More\", children: [\r\n        {title: \"Sub 1\", cmd: \"sub1\"},\r\n        {title: \"Sub 2\", cmd: \"sub1\"}\r\n      ]}\r\n    ],\r\n    beforeOpen: (event, ui) ->\r\n      node = $.ui.fancytree.getNode(ui.target);\r\n      node.setFocus();\r\n      node.setActive();\r\n    ,\r\n    select: (event, ui) ->\r\n      node = $.ui.fancytree.getNode(ui.target);\r\n      #alert(\"select \" + ui.cmd + \" on \" + node);[/COFFEESCRIPT]','5d01fbcb8dd09020c2a5ed05dfdba5a9f8c8d963',1,'2014-08-03 13:18:51','2014-08-03 13:18:51',0,1,''),(42,'Форма','[CSHARP]using System;\r\nusing System.Collections.Generic;\r\nusing System.ComponentModel;\r\nusing System.Data;\r\nusing System.Drawing;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Windows.Forms;\r\n\r\nnamespace ildwine_Project\r\n{\r\n    public partial class Form1 : Form\r\n    {\r\n        ildwine_Class ildwine = new ildwine_Class();\r\n        public Form1()\r\n        {\r\n            InitializeComponent();\r\n            ildwine.handlerEvent += delegate\r\n            {\r\n                textBox1.Text = \"O-LO-LO, ildine!\";\r\n            };\r\n            button1.Click += delegate\r\n            {\r\n                ildwine.Class_Handler();\r\n            };\r\n        }\r\n    }\r\n}\r\n[/CSHARP]','d8faba460d1fc41fc61f42ba2ccc7f2208fcaaf1',1,'2014-08-03 13:20:08','2014-08-03 13:20:08',1,NULL,NULL),(43,'Класс','[CSHARP]using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ildwine_Project\r\n{\r\n    class ildwine_Class\r\n    {\r\n        public event EventHandler handlerEvent;\r\n        public void Class_Handler()\r\n        {\r\n            if (handlerEvent != null)\r\n                handlerEvent(this, EventArgs.Empty);\r\n        }\r\n    }\r\n}\r\n[/CSHARP]','164c2774545f875bf40d4cf917bf66cc95997b5c',1,'2014-08-03 13:20:51','2014-08-03 13:20:51',1,NULL,NULL),(44,'SF5 в Real48 от Язона','[PASCAL]//Функция перевода SF5 в Real48      \r\nFunction Sf5Real(i:byte):Real48;\r\n Type\r\n  PG = Array[1..6] of byte;\r\n var\r\n//  x     :byte;\r\n  AGGG:Real48;\r\n  PPtrGGG :^PG;\r\n   begin\r\n     PPtrGGG:=@AGGG;\r\n     if Block[i] = 0 then PPtrGGG^[1]:=0 else\r\n      begin\r\n// Формировка порядка \r\n        if Block[i]>=128 then PPtrGGG^[1]:= (Block[i] -128) div 2+129\r\n        else PPtrGGG^[1]:=(Block[i]-129) div 2+129;\r\n     // знак \r\n     if (Block[i] AND 1) = 0 then PPtrGGG^[6]:=Block[i+5] AND $7F     \r\n       else PPtrGGG^[6]:=Block[i+5];             // знак\r\n       PPtrGGG^[5]:=Block[i+4];\r\n       PPtrGGG^[4]:=Block[i+3];\r\n       PPtrGGG^[3]:=Block[i+2];\r\n       PPtrGGG^[2]:=Block[i+1];          \r\n      end;\r\n     Sf6Real:=AGGG;\r\n   end;\r\n   \r\n   //The Real48 type\r\n   //A 6-byte (48-bit) Real48 number is divided into three fields:\r\n   //If 0 < e <= 255, the value v of the number is given by\r\n   //v = (–1)^s * 2^(e–129) * (1.f )\r\n   //If e = 0, then v = 0.\r\n   //The Real48 type can’t store denormals, NaNs, and infinities. Denormals      //become zero when stored in a Real48, while NaNs and infinities produce an    //overflow error if an attempt is made to store them in a Real48.[/PASCAL]','4cada227b144b03bd54d320a0724c384ecc5baf7',1,'2014-08-06 03:51:26','2014-08-20 08:46:31',1,NULL,''),(45,'Unnamed #45','[PHP]<?php\r\nfunction sf5Real($i)\r\n{\r\n    global $AGGG;\r\n    global $Block;\r\n    $PPtrGGG = $AGGG;\r\n    if($Block[$i] === 0)\r\n        $PPtrGGG[1] = 0;\r\n    else\r\n    {\r\n        $PPtrGGG[1] = (int) (($Block[$i] - 128 - ($Block[$i] < 128)) / 2) + 129;\r\n        if (($Block[$i] AND 1) == 0)\r\n            $PPtrGGG[6] = $Block[$i+5] AND 0x7F;     \r\n        else\r\n            $PPtrGGG[6] = $Block[$i+5];\r\n       $PPtrGGG[5] = $Block[$i+4];\r\n       $PPtrGGG[4] = $Block[$i+3];\r\n       $PPtrGGG[3] = $Block[$i+2];\r\n       $PPtrGGG[2] = $Block[$i+1];          \r\n    }\r\n    return $PPtrGGG;\r\n}[/PHP]','e2e0d5d1284665b9d4585f71288eebdcb11cfd50',1,'2014-08-06 04:21:41','2014-08-06 04:24:10',1,1,''),(46,'Форма_Памирыч','[CSHARP]\r\nusing System;\r\nusing System.Collections.Generic;\r\nusing System.ComponentModel;\r\nusing System.Data;\r\nusing System.Drawing;\r\nusing System.Linq;\r\nusing System.Text;\r\nusing System.Windows.Forms;\r\n\r\nusing System.Threading;\r\nusing System.Threading.Tasks;\r\n\r\n\r\nnamespace Памирыч_Example\r\n{\r\n    public partial class Form1 : Form\r\n    {\r\n        public Form1()\r\n        {\r\n            InitializeComponent();\r\n            button1.Click += (sender, e) =>\r\n                {\r\n                    dataGridView1.DataSource = null;\r\n\r\n                    DataTable_Class myTable = new DataTable_Class();\r\n                    myTable.getTableEvent += (sender_1, e_1) =>\r\n                        {\r\n                            this.Invoke((Action)delegate\r\n                            {\r\n                                dataGridView1.DataSource = e_1.table;\r\n                            });\r\n                        };\r\n                    myTable.GetDataTable();\r\n                };\r\n            button2.Click += (sender, e) =>\r\n                {\r\n                    dataGridView1.DataSource = null;\r\n\r\n                    Thread t = new Thread(new ThreadStart(()=>\r\n                    {\r\n                        dataGridView1.Invoke((Action)delegate\r\n                        {\r\n                            dataGridView1.ColumnCount = 3;\r\n                            dataGridView1.Columns[0].Name = \"Column_1\";\r\n                            dataGridView1.Columns[1].Name = \"Column_2\";\r\n                            dataGridView1.Columns[2].Name = \"Column_3\";\r\n\r\n                            for (int i = 0; i < 20; i++)\r\n                            {\r\n                                DataGridViewRow row = new DataGridViewRow();\r\n                                dataGridView1.Rows.Add(row);\r\n                            }\r\n                        });\r\n                    }));\r\n                    t.IsBackground = true;\r\n                    t.Start();\r\n                };\r\n        }\r\n    }\r\n}\r\n\r\n[/CSHARP]','7808dafcfd28d697e0c7071768f0ca746a681f3d',1,'2014-08-11 13:33:33','2014-08-11 14:04:12',1,NULL,NULL),(48,'Unnamed #48','[C_CPP]\r\n//событие при изменении ячейки таблицы\r\nvoid MainWindow::on_tableWidget_cellChanged(int row, int column)\r\n{\r\n    //если данные не загружены или ячейка, куда кликали - не \"Наименование\", то выходим\r\n    if(!loaded || ui->tableWidget->horizontalHeaderItem(column)->text() != \"Наименование\")\r\n        return;\r\n\r\n    if(hasTransactions)\r\n        db.transaction();\r\n\r\n    //Изменяем наименование в БД на новое значение\r\n    query.prepare(\"UPDATE products SET `full_name` = ? WHERE `product_id` = ?\");\r\n    query.bindValue(0, ui->tableWidget->item(row, column)->text());\r\n    query.bindValue(1, ui->tableWidget->item(row, 0)->text().toInt());\r\n    query.exec();\r\n\r\n    if(hasTransactions)\r\n        db.commit();\r\n}\r\n\r\nvoid MainWindow::on_tableWidget_cellDoubleClicked(int row, int column)\r\n{\r\n    //если ячейка, куда кликали - не \"Поставщик\", то выходим\r\n    if(ui->tableWidget->horizontalHeaderItem(column)->text() != \"Поставщик\")\r\n        return;\r\n\r\n    //показываем список поставщиков\r\n    QComboBox *box = new QComboBox();\r\n    //загружаем список поставщиков в ComboBox\r\n    loadSuppliersToComboBox(box);\r\n    //Выделяем текущий элемент в списке\r\n    box->setCurrentText(ui->tableWidget->item(row, column)->text());\r\n\r\n    //обработчики изменения текущего элемента из списка\r\n    connect(box, SIGNAL(currentIndexChanged(int)), signalMapper, SLOT(map()));\r\n    signalMapper->setMapping(box, box);\r\n    connect(signalMapper, SIGNAL(mapped(QWidget *)), this, SLOT(onTableComboBoxChanged(QWidget *)));\r\n\r\n    //добавляем в эту ячейку ComboBox\r\n    ui->tableWidget->setCellWidget(row, column, box);\r\n}\r\n\r\n//выборка поставщиков из БД\r\nvoid MainWindow::loadSuppliers()\r\n{\r\n    if(hasTransactions)\r\n        db.transaction();\r\n\r\n    query.exec(\"SELECT * FROM `suppliers`\");\r\n    while(query.next())\r\n        suppliers << query.value(1).toString();\r\n\r\n    if(hasTransactions)\r\n        db.commit();\r\n}\r\n\r\n//Загрузка поставщиков в ComboBox\r\nvoid MainWindow::loadSuppliersToComboBox(QComboBox * box)\r\n{\r\n    box->addItem(\"Не указано\");\r\n    for(size_t i = 0, cnt = suppliers.size(); i < cnt; ++i)\r\n        box->addItem(suppliers[i]);\r\n}\r\n\r\n//Слот на изменение списка в ячейке таблицы\r\nvoid MainWindow::onTableComboBoxChanged(QWidget * obj)\r\n{\r\n    int value = obj->property(\"currentIndex\").value<int>();\r\n    int row = ui->tableWidget->currentItem()->row();\r\n\r\n    if(hasTransactions)\r\n        db.transaction();\r\n\r\n    //изменяем поставщика у выбранной записи\r\n    query.prepare(\"UPDATE products SET supplier_id = ? WHERE product_id = ?\");\r\n    query.bindValue(0, value);\r\n    query.bindValue(1, row + 1);\r\n\r\n    //если запрос успешен - устанавливаем текст для колонки\r\n    if(query.exec())\r\n        ui->tableWidget->currentItem()->setText(obj->property(\"currentText\").value<QString>());\r\n\r\n    if(hasTransactions)\r\n        db.commit();\r\n}[/C_CPP]','aa5cfa3271d2a1356ab7e21f89d8c5fcf9901053',1,'2014-08-15 09:35:34','2015-09-10 12:33:17',1,1,'cyberforum.ru'),(49,'Unnamed #49','[ASSEMBLY_X86]        Function: sqlite3_enable_load_extension\r\n0xb7f296eb  <+0x000b>         xchg   %eax,%edi\r\n0xb7f296ec  <+0x000c>         (bad)\