      focusOnClick: true,\r\n      preventVoidMoves: true,\r\n      preventRecursiveMoves: true,\r\n      dragStart: (node, data) ->\r\n        return true; #....\r\n      dragEnter: (node, data) ->\r\n        return true; #....\r\n      dragDrop: (node, data) ->\r\n        data.otherNode.moveTo(node, data.hitMode)[/COFFEESCRIPT]\r\nget_tree.js.erb\r\n[ERB][<%= raw nested_directory_tree(@directories, @showed).gsub(/(?:, )+$/, \'\') %>][/ERB]\r\ndirectories_controller\r\n[RUBY]def get_tree\r\n  @showed = []\r\n  @directories = Directory.where project_id: session[:project_id]\r\n  render \'get_tree.js.erb\'\r\nend[/RUBY]\r\ndirectories_helper\r\n[RUBY]def nested_directory_tree(directories, showed = [])\r\n  directories.map do |directory, sub_directory|\r\n    return if directory.id == directory.parent_id\r\n    next if showed.include? directory.id\r\n    render directory\r\n  end.join(\', \').html_safe\r\nend[/RUBY]\r\ndirectories/_directory.html.erb\r\n[ERB]{\"title\": \"<%= directory.name %>\", \"key\": <%= directory.id %>, \"folder\": true, \"id\": <%= directory.id %>, \"cuted\": <%= session[:cut_id] == directory.id %>, \"children\": [<%= nested_directory_tree directory.child, @showed %>\r\n<%= raw \", #{render \'files/file\', files: directory.files}\" if directory.files.any? %>]}\r\n<% @showed << directory.id %>[/ERB]\r\nfiles/_file.html.erb\r\n[ERB]<% ret = [] %>\r\n<% files.each do |f| %>\r\n    <% ret << \"{\\\"title\\\": \\\"#{f.name}\\\", \\\"key\\\": #{f.id}, \\\"id\\\": #{f.id}, \\\"cuted\\\": #{session[:cut_id] == f.id}}\" %>\r\n<% end %>\r\n<%= raw ret.join \', \' %>[/ERB]','b574ae04880735d530a7b24ade893d153b129d5e',1,'2014-08-18 15:50:10','2014-08-18 15:50:33',0,1,''),(51,'Script By UI ','[JAVASCRIPT]// ==UserScript==\r\n// @name        CF_ChangeURLsAppearance\r\n// @author      UI\r\n// @description Changing URL Appearance on CyberForum\r\n// @include     http://www.cyberforum.ru/*\r\n// @require     http://ajax.googleapis.com/ajax/libs/jquery/1.4.2/jquery.min.js\r\n// @version     0.1\r\n// @grant       none\r\n// ==/UserScript==\r\n \r\nwindow.addEventListener(\"load\",\r\n    function(event) {\r\n       \r\n       $(\"span[id^=\'extlink_\']\").each(function(index, element)\r\n       {\r\n           var inner = $(element)[0].outerHTML;\r\n           var matches = inner.match(/open_external\\(\'([^\\\']+)/);\r\n           if(matches != null)\r\n           {\r\n               var url = \'<a href = \"\' + matches[1] + \'\">\' + $(element).html() + \'</a>\';\r\n               $(element).replaceWith(url);\r\n           }\r\n       });\r\n       \r\n    },\r\n    true);[/JAVASCRIPT]','60901435f2fabde2acd2d1facb1349c41fb4f52a',1,'2014-08-19 12:41:34','2014-08-19 12:41:34',1,2,NULL),(52,'KeyDown','[VBSCRIPT]Private Sub TextBox1_KeyDown(ByVal sender As Object, ByVal e As System.Windows.Forms.KeyEventArgs) Handles TextBox1.KeyDown\r\n        If e.KeyCode = Keys.Enter Then\r\n            e.SuppressKeyPress = True\r\n            TextBox2.Focus()\r\n        End If\r\n    End Sub[/VBSCRIPT]','18cbe8c497e6108f21122360d1b1362915c9455c',1,'2014-08-20 12:51:51','2014-08-20 12:51:51',1,2,NULL),(53,'Unnamed #53','[VBSCRIPT]Imports System\r\n\r\nPublic Class Test\r\n	Public Shared Sub Main()\r\n		Dim str As String\r\n		str = \"C:\\install\\net_framework\\dotnetfx3.exe\"\r\n		Console.WriteLine(GetFileName(str))\r\n	End Sub\r\n	\r\n	Function GetFileName(path As String) As String\r\n        Return Mid(path, path.LastIndexOf(\"\\\") + 2)\r\n	End Function\r\nEnd Class[/VBSCRIPT]','70dd924d5358e92bec3c4b8f43d950f604899a94',1,'2014-08-24 11:17:00','2014-08-24 11:17:00',1,1,''),(54,'Unnamed #54','[CSHARP]using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication1\r\n{\r\n    class Program\r\n    {\r\n        static void Main(string[] args)\r\n        {\r\n            String[] arr = new String[] { \"Foo|1343|fsd\", \"Bar|1347|fsd\", \"Lol|1343|fsd\" };\r\n\r\n            String[] arr2 = new String[] { \"Foof|1349|fsd\", \"Foofd|1343|fsd\", \"Bar|1343|fsd\", \"Lol|1343|fsd\" };\r\n\r\n            Array arr3 = arr.Concat(\r\n                from s2 in arr2\r\n                where !(from s in arr select s.Split(\'|\')[1])\r\n                    .Contains(s2.Split(\'|\')[1])\r\n                select s2\r\n            ).ToArray();\r\n\r\n            foreach (String s in arr3)\r\n                Console.WriteLine(s);\r\n\r\n            Console.ReadKey();\r\n        }\r\n    } \r\n}\r\n\r\n[/CSHARP]','0243165a2db1e3be59cd6aadca75298b061c96cd',1,'2014-08-26 07:51:45','2014-08-26 09:13:16',1,1,''),(55,'UniqueQueQue','[VBSCRIPT]    Function Unique(ByVal Arr1 As String(), ByVal Arr2 As String()) As String()\r\n        Dim Tmp As New List(Of String)\r\n        Dim arr3 = Arr1.Concat(From s2 In Arr2 _\r\n                Where (From s In Arr1 Select s.Split(\"|\")(0)) _\r\n                .Contains(s2.Split(\"|\")(0)) = False _\r\n                Select s2)\r\n        Return arr3.ToArray\r\n    End Function[/VBSCRIPT]\r\n    \r\n    [VB.NET]Public Structure T_T\r\n        Public first, second, third As String\r\n    End Structure\r\n\r\n    Sub Main()\r\n        Dim arr() As T_T\r\n\r\n        Dim tmp() As String\r\n        Dim tmpArr() As String = {\"Foo|1343|fsd\", \"Bar|1343|fsd\", \"Lol|1343|fsd\", \"Lold|12343|ffsd\"}\r\n\r\n        Dim arr2() As String = \"abc+defg+hijkl+mnop+qrst+uvw+xyz\".Split(\"+\")\r\n        Dim arr3() As String\r\n\r\n        For i As Integer = 0 To tmpArr.Length - 1\r\n            tmp = tmpArr(i).Split(\"|\")\r\n            ReDim Preserve arr(i)\r\n            arr(i).first = tmp(0).ToString\r\n            arr(i).second = tmp(1).ToString\r\n            arr(i).third = tmp(2).ToString\r\n        Next\r\n\r\n\r\n        arr3 = arr.Concat(From s2 In arr2 _\r\n                Where (From s In arr Select s.first.ToString) _\r\n                .Contains(s2) = False _\r\n                Select s2).ToArray()\r\n        For Each s In arr3\r\n            Console.WriteLine(s)\r\n        Next\r\n\r\n        Console.ReadKey()\r\n    End Sub[/VB.NET]','34f7fc593d2591a2e5ce543bb442c5199c3fa83a',1,'2014-08-26 11:54:35','2014-08-26 13:03:29',1,2,''),(57,'Unnamed #57','[URL=\"http://dcravey.wordpress.com/2011/03/21/using-sqlite-in-a-visual-c-application/\"]Sqlite3 VS[/URL]\r\n[URL=\"https://www.dropbox.com/s/gjfrsu03mzx8xkj/Release.zip?dl=0\"]Release?[/URL]\r\n\r\n[C_CPP]#include \"stdafx.h\"\r\n#include <iostream>\r\n#include <fstream>\r\n#include <sstream>\r\n#include <vector>\r\n#include \"sqlite3.h\"\r\n\r\nstd::vector<std::string> &split(const std::string &s, char delim, std::vector<std::string> &elems) {\r\n	std::stringstream ss(s);\r\n	std::string item;\r\n	while (std::getline(ss, item, delim))\r\n		elems.push_back(item);\r\n	return elems;\r\n}\r\n\r\nstd::vector<std::string> split(const std::string &s, char delim) {\r\n	std::vector<std::string> elems;\r\n	split(s, delim, elems);\r\n	return elems;\r\n}\r\n\r\nint main(int argc, char *argv[])\r\n{\r\n	std::ifstream ifs(\"VisitedNew.base\");\r\n\r\n	std::string line;\r\n	std::string query = \"BEGIN TRANSACTION;\";\r\n\r\n	std::vector<std::string> parts;\r\n\r\n	sqlite3 *db;\r\n	sqlite3_open(\"places2.sqlite\", &db);\r\n\r\n	int i;\r\n\r\n	const char *select_sql = \"SELECT COUNT(1) FROM moz_places WHERE url = ?\";\r\n\r\n	sqlite3_stmt *stmt;\r\n\r\n	sqlite3_exec(db, \"PRAGMA journal_mode = MEMORY;\", NULL, NULL, NULL);\r\n\r\n	sqlite3_prepare(db, \"SELECT COUNT(1) FROM moz_places\", -1, &stmt, NULL);\r\n	sqlite3_step(stmt);\r\n	std::cout << std::endl << \"Before: \" << sqlite3_column_int(stmt, 0) << std::endl;\r\n\r\n	sqlite3_prepare(db, select_sql, -1, &stmt, NULL);\r\n\r\n	while (std::getline(ifs, line))\r\n	{\r\n		line.erase(line.find_last_not_of(\" \\n\\r\\t\") + 1);\r\n		parts = split(line, \'|\');\r\n		sqlite3_bind_text(stmt, 1, parts[0].c_str(), -1, NULL);\r\n		sqlite3_step(stmt);\r\n\r\n		if (sqlite3_column_int(stmt, 0))\r\n			continue;\r\n		line = \"INSERT INTO moz_places VALUES(NULL, \'\";\r\n		for (i = 0; i < 9; ++i)\r\n			line += parts[i] + \"\', \'\";\r\n		query += line + parts[9] + \"\');\";\r\n	}\r\n	query += \"COMMIT TRANSACTION;\";\r\n	sqlite3_exec(db, query.c_str(), NULL, NULL, NULL);\r\n\r\n	sqlite3_prepare(db, \"SELECT COUNT(1) FROM moz_places\", -1, &stmt, NULL);\r\n	sqlite3_step(stmt);\r\n	std::cout << std::endl << \"After: \" << sqlite3_column_int(stmt, 0) << std::endl;\r\n	sqlite3_finalize(stmt);\r\n	sqlite3_close(db);\r\n	ifs.close();\r\n\r\n	std::cin.ignore();\r\n	std::cin.get();\r\n\r\n	return 0;\r\n}[/C_CPP]','788d91c1d2086ed629aa4c19c4f6aa9b8b1a69de',1,'2014-08-27 09:57:49','2014-08-27 15:40:55',1,1,''),(59,'Unnamed #59','index.php\r\n[PHP]<?php\r\nheader(\'Content-type: text/html; charset=utf-8\');\r\n\r\necho \'<br><br><h1 align=\"center\">Script By <span style=\"color:#006000\">KOPOJI</span></h1>\';\r\n\r\n$db = new PDO(\'mysql:host=localhost;dbname=test\', \'root\', \'za9bali\');\r\n$db->exec(\'SET NAMES \"utf8\"\');\r\n\r\n$res = $db->query(\'SELECT `country_id`, `name` FROM `country`\');\r\n\r\necho \'<select id=\"country\">\r\n		<option value=\"\">Выберите страну из списка</option>\';\r\nwhile($row = $res->fetch(PDO::FETCH_NUM))\r\n	echo \'<option value=\"\', $row[0], \'\">\', $row[1], \'</option>\';\r\necho \'</select>\';\r\n\r\n?>\r\n<select id=\"region\" style=\"display:none\"></select>\r\n<select id=\"city\" style=\"display:none\"></select>\r\n\r\n<script src=\"http://code.jquery.com/jquery-1.11.1.min.js\"></script>\r\n<script>\r\n	$(function() {\r\n		$(\'#country\').change(function() {\r\n			$.post(\'./ajax.php\', {country_id: this.value}, function(ans) {\r\n				$(\'#region\').html(ans)\r\n				$(\'#region\').show()\r\n				$(\'#city\').hide()\r\n			});\r\n		})\r\n		\r\n		$(\'#region\').change(function() {\r\n			$.post(\'./ajax.php\', {region_id: this.value}, function(ans) {\r\n				$(\'#city\').html(ans)\r\n				$(\'#city\').show()\r\n			});\r\n		})\r\n	})\r\n</script>[/PHP]\r\n\r\najax.php\r\n[PHP]<?php\r\n\r\n$db = new PDO(\'mysql:host=HOST;dbname=DB\', \'USER\', \'PASS\');\r\n$db->exec(\'SET NAMES \"utf8\"\');\r\n\r\nif(isset($_POST[\'country_id\']))\r\n{\r\n	$res = $db->prepare(\'SELECT `region_id`, `name` FROM `region` WHERE `country_id` = ?\');\r\n	$res->execute(array((int) $_POST[\'country_id\']));\r\n	$return = \'<option value=\"\">Выберите регион из списка</option>\';\r\n	while($row = $res->fetch(PDO::FETCH_NUM))\r\n		$return .= \'<option value=\"\' . $row[0] . \'\">\' . $row[1] . \'</option>\';\r\n	echo $return;\r\n}\r\n\r\nif(isset($_POST[\'region_id\']))\r\n{\r\n	$res = $db->prepare(\'SELECT `city_id`, `name` FROM `city` WHERE `region_id` = ?\');\r\n	$res->execute(array((int) $_POST[\'region_id\']));\r\n	$return = \'<option value=\"\">Выберите город из списка</option>\';\r\n	while($row = $res->fetch(PDO::FETCH_NUM))\r\n		$return .= \'<option value=\"\' . $row[0] . \'\">\' . $row[1] . \'</option>\';\r\n	echo $return;\r\n}[/PHP]','109b46bbca550e8d8065bbf5f8fdc0b6f33335f5',1,'2014-09-01 13:52:19','2014-09-01 13:52:19',0,1,'cyberforum.ru'),(60,'Emacs config','[LISP];; Set up the Common Lisp environment\r\n;; Настройка Common Lisp окружения\r\n\r\n(add-to-list \'load-path \"/usr/share/common-lisp/source/slime/\")\r\n(setq inferior-lisp-program \"/usr/bin/sbcl\")\r\n(require \'slime)\r\n(slime-setup)\r\n;; Text and the such\r\n;; Use colors to highlight commands, etc.\r\n(global-font-lock-mode t) \r\n;; Disable the welcome message\r\n(setq inhibit-startup-message t)\r\n;; Format the title-bar to always include the buffer name\r\n(setq frame-title-format \"emacs - %b\")\r\n;; Display time\r\n(display-time)\r\n;; Make the mouse wheel scroll Emacs\r\n(mouse-wheel-mode t)\r\n;; Always end a file with a newline\r\n(setq require-final-newline t)\r\n;; Stop emacs from arbitrarily adding lines to the end of a file when the\r\n;; cursor is moved past the end of it:\r\n(setq next-line-add-newlines nil)\r\n;; Flash instead of th