tive)\r\n		(save-buffer)\r\n		(compile (concat \"g++ -Wall -pedantic -c -std=c++11 \" (file-name-nondirectory buffer-file-name)))))\r\n  (define-key c-mode-base-map [(f9)] \r\n	      (lambda ()\r\n		(interactive)\r\n		(save-buffer)\r\n		(let ((name (file-name-nondirectory buffer-file-name)))\r\n		  (compile (concat \"g++ -Wall -pedantic -o \" (file-name-sans-extension name) \" \" name \" -std=c++11\")))))\r\n  (define-key c-mode-base-map [(f10)] \r\n	      (lambda ()\r\n		(interactive)\r\n		(let ((name (file-name-sans-extension (file-name-nondirectory buffer-file-name))))\r\n		  (other-window 1)\r\n		  (display-buffer \"*compilation*\")\r\n		  (if (= 2 (length (window-list nil \'dont-include-minibuffer-even-if-active))) (split-window-vertically))\r\n		  (shell \"C++ run\")\r\n		  (other-window 2)\r\n		  (shrink-window-if-larger-than-buffer)\r\n		  (other-window 4)\r\n		  (insert (concat \"./\" name)))))\r\n  (define-key c-mode-base-map [(tab )] \'my-indent-or-complete)  \r\n  (global-set-key (kbd \"C-SPC\") \'semantic-ia-complete-symbol-menu)  \r\n  (setq c-macro-shrink-window-flag t)  \r\n  (setq c-macro-preprocessor \"cpp\")  \r\n  (setq c-macro-cppflags \" \")  \r\n  (setq c-macro-prompt-flag t)  \r\n  (setq hs-minor-mode t)  \r\n  (setq abbrev-mode t)  \r\n  (set (make-local-variable \'compile-command) (concat \"g++ -Wall -g \" buffer-file-name))\r\n  )  \r\n(add-hook \'c-mode-common-hook \'my-c-mode-common-hook)[/LISP]\r\n\r\n[LISP];; Set up the Common Lisp environment\r\n;; Настройка Common Lisp окружения\r\n\r\n(add-to-list \'load-path \"/usr/share/common-lisp/source/slime/\")\r\n(setq inferior-lisp-program \"/usr/bin/sbcl\")\r\n(require \'slime)\r\n(slime-setup)\r\n;; Text and the such\r\n;; Use colors to highlight commands, etc.\r\n(global-font-lock-mode t) \r\n;; Disable the welcome message\r\n(setq inhibit-startup-message t)\r\n;; Format the title-bar to always include the buffer name\r\n(setq frame-title-format \"emacs - %b\")\r\n;; Display time\r\n(disp