reground \"white\" :background \"black\"))))\r\n   \'(font-lock-comment-face ((t (:foreground \"magenta\"))))\r\n   \'(font-lock-function-name-face ((t (:foreground \"red\"))))\r\n   \'(font-lock-keyword-face ((t (:foreground \"green\"))))\r\n   \'(font-lock-type-face ((t (:foreground \"blue\"))))\r\n   \'(font-lock-string-face ((t (:foreground \"cyan\"))))\r\n   \'(font-lock-variable-name-face ((t (:foreground \"blue\"))))\r\n   \'(menu ((((type x-toolkit)) (:background \"white\" :foreground \"black\" :box (:line-width 2 :color \"grey75\" :style released-button)))))\r\n   \'(modeline ((t (:foreground \"blue\" :background \"white\")))))\r\n  (set-cursor-color \"blue\")\r\n  (set-foreground-color \"white\")\r\n  (set-background-color \"black\")\r\n  (set-face-foreground \'default \"white\")\r\n  (set-face-background \'default \"black\"))\r\n(if window-system\r\n    (faces_x)\r\n  (faces_nox))\r\n(ido-mode t) \r\n(show-paren-mode t)[/LISP]','eac555fc3765f5d993baf32d270a81d0c9d371a4',1,'2014-09-03 10:39:24','2014-09-04 14:45:12',1,1,''),(61,'Unnamed #61','[JAVASCRIPT]// ==UserScript==\r\n// @name        ScrollPage\r\n// @version     0.1\r\n// @author      KOPOJI\r\n// @include     http://www.cyberforum.ru/*\r\n// @grant       none\r\n// ==/UserScript==\r\n\r\nwindow.onload = function()\r\n{\r\n    var ins = document.createElement(\'div\')\r\n    ins.style.backgroundColor = \'rgba(250,250,250, 0.6)\'\r\n    ins.style.position = \'absolute\'\r\n    ins.style.right = 0\r\n    ins.style.top = 0\r\n    ins.style.height = document.body.clientHeight + \'px\'\r\n    ins.style.width = \'30px\'\r\n    ins.onmouseover = function() {\r\n        this.style.backgroundColor = \'rgba(250,250,250, 0.99)\'\r\n    }\r\n    ins.onmouseout = function() {\r\n        this.style.backgroundColor = \'rgba(250,250,250, 0.6)\'\r\n    }\r\n    ins.onclick = function () {\r\n        window.scrollTo(0, 0 > window.pageYOffset - document.body.clientHeight / 2 ? document.body.clientHeight : 0)\r\n    }\r\n    document.body.appendChild(ins)\r\n}[/JAVASCRIPT]','0934d930f8eb39b7df289aaa983ff2e5bc2d340b',1,'2014-09-05 14:21:49','2014-09-05 14:25:32',1,1,'cyberforum.ru'),(62,'Unnamed #62','[C_CPP]#include <QDebug>\r\n...\r\nQDialog *dlg = new QDialog();\r\nconnect(dlg, SIGNAL(finished(int)), this, SLOT(del()));\r\ndlg->exec();\r\ndelete dlg;\r\n    \r\n.....\r\nvoid MainClass::del()\r\n{\r\n    qDebug() << \"Deleted!\";\r\n}[/C_CPP]\r\n[C_CPP]QDialog dlg;\r\nconnect(&dlg, SIGNAL(finished(int)), this, SLOT(del()));\r\ndlg.exec();[/C_CPP]\r\n\r\n[C_CPP]dlg = new QDialog();\r\nconnect(dlg, SIGNAL(finished(int)), this, SLOT(del()));\r\ndlg->exec();\r\n    \r\n.....\r\nvoid MainClass::del()\r\n{\r\n    qDebug() << \"Deleted!\";\r\n    delete dlg;\r\n}[/C_CPP]','3b1d7e28297caa7b729115462a1b7c6648c664d4',1,'2014-09-07 14:50:50','2015-09-10 12:32:32',1,1,'cyberforum.ru'),(63,'Unnamed #63','[C_CPP]#include <iostream>\r\n#include <map>\r\nenum Token_value\r\n{\r\n	NAME, NUMBER, END, PLUS = \'+\', MINUS = \'-\', MUL = \'*\', DIV = \'/\', PRINT = \';\', ASSIGN = \'=\', LP = \'(\', RP = \')\'\r\n};\r\n\r\nToken_value curr_token = PRINT;\r\n\r\ndouble number_value;\r\nstd::string string_value;\r\n\r\nstd::map<std::string, double> table;\r\n\r\nToken_value get_token();\r\ndouble prim(bool);\r\ndouble term(bool);\r\ndouble expr(bool);\r\ndouble error(const char *);\r\n\r\nint main(int argc, char *argv[])\r\n{\r\n	std::cout << get_token();\r\n}\r\n\r\ndouble error(const char *msg)\r\n{\r\n	std::cout << msg << std::endl;\r\n	return 0;\r\n}\r\n\r\ndouble expr(bool get)\r\n{\r\n	double left = term(get);\r\n	\r\n	for( ; ; )\r\n	{\r\n		switch(curr_token)\r\n		{\r\n			case PLUS:\r\n				left += term(true);\r\n			break;\r\n			case MINUS:\r\n				left -= term(true);\r\n			break;\r\n			default:\r\n				return left;\r\n		}\r\n	}\r\n}\r\ndouble term(bool get)\r\n{\r\n	double left = prim(get);\r\n	\r\n	for( ; ; )\r\n	{\r\n		switch(curr_token)\r\n		{\r\n			case MUL:\r\n				left *= prim(true);\r\n			break;\r\n			case DIV:\r\n				if (double d = prim(true) )\r\n				{\r\n					left /= d;\r\n					break;\r\n				}\r\n				return error(\"divide by 0\");\r\n			break;\r\n			default:\r\n				return left;\r\n		}\r\n	}\r\n}\r\n\r\ndouble prim(bool get)\r\n{\r\n	if(get)\r\n		get_token();\r\n	switch(curr_token)\r\n	{\r\n		case NUMBER:\r\n			{\r\n				double v = number_value;\r\n				get_token();\r\n				return v;\r\n			}\r\n		case NAME:\r\n			{\r\n				double &v = table[string_value];\r\n				if(get_token() == ASSIGN)\r\n					v = expr(true);\r\n				return v;\r\n			}\r\n		case MINUS:\r\n			return - prim(true);\r\n		case LP:\r\n			{\r\n				double e = expr(true);\r\n				if(curr_token != RP)\r\n					return error(\"\')\' expected\");\r\n				get_token();\r\n				return e;				\r\n			}\r\n		default:\r\n			return error(\"primary expected\");\r\n	}\r\n}\r\n\r\nToken_value get_token()\r\n{\r\n	char ch = 0;\r\n	do\r\n		if(!std::cin.get(ch))\r\n			return curr_token = END;\r\n	while(ch != \'\\n\' && isspace(ch));\r\n	\r\n	switch(ch)\r\n	{\r\n		case 0: return curr_token = END;\r\n		case \';\': case \'\\n\': case \'*\': case \'/\': case \'+\': case \'-\': case \'(\': case \')\': case \'=\': \r\n			return curr_token = Token_value(ch);\r\n		case \'0\': case \'1\': case \'2\': case \'3\': case \'4\': case \'5\': case \'6\': case \'7\': case \'8\': case \'9\': case \'.\':\r\n			std::cin.putback(ch);\r\n			std::cin >> number_value;\r\n			return curr_token = NUMBER;\r\n		default: //NAME, NAME =, или ошибка\r\n			if(isalpha(ch))\r\n			{\r\n				std::cin.putback(ch);\r\n				std::cin >> string_value;\r\n				return curr_token = NAME;\r\n			}\r\n			error(\"bad token\");\r\n			return curr_token = PRINT;\r\n	}\r\n}[/C_CPP]','33f04c5c65ff324eaea7edbdeca1f96e6f64070d',1,'2014-09-08 10:26:18','2014-09-08 10:26:18',1,1,'localhost'),(64,'Unnamed #64','[LISP](ql:quickload :site)\r\n\r\n(in-package :cl-user)\r\n(defpackage helper\r\n  (:use :cl)\r\n  (:export :create-url\r\n	   :link-to\r\n	   :stylesheet-link-tag\r\n	   :javascript-include-tag\r\n	   :image-tag\r\n	   :image-path\r\n	   :page-title\r\n	   :authorize))\r\n(in-package :helper)\r\n\r\n(defun link-to (title href)\r\n  (format nil \"<a href=~S title=~S>~A</a>\" href title title))\r\n\r\n(defvar *app-name* \"Фото для друзей\")\r\n(defvar *home-url* \"/\")\r\n(defvar *url-suffix* \".html\")\r\n\r\n(defun create-url (url &optional &rest args)\r\n  (cond \r\n    ((= (length url) 0)\r\n     (return-from create-url url))\r\n    ((string/= *home-url* url :end2 1)\r\n     (setf url (concatenate \'string (string *home-url*) url)))\r\n    ((not (> (length args) 0)\r\n	  (return-from create-url (add-suffix-if-not-exists url)))))\r\n  (loop for part in args do\r\n       (setf url (concatenate \'string url \"/\" part)))\r\n  (add-suffix-if-not-exists url))\r\n\r\n(defun add-suffix-if-not-exists (url)\r\n  (if (or \r\n       (< (length url) (length *url-suffix*))\r\n       (string-not-equal url *url-suffix* :start1 (- (length *url-suffix*) 2)))\r\n      (concatenate \'string url *url-suffix*)\r\n      url))\r\n\r\n(defun stylesheet-link-tag (&rest urls)\r\n  (let ((ret \"\"))\r\n    (loop for url in urls do\r\n	 (setf ret\r\n	       (concatenate \'string ret (format nil \"<link href=\\\"/css/~A.css\\\" media=\\\"all\\\" rel=\\\"stylesheet\\\" type=\\\"text/css\\\" />~%\" url))))\r\n    ret))\r\n\r\n(defun javascript-include-tag (&rest urls)\r\n  (let ((ret \"\"))\r\n    (loop for url in urls do\r\n	 (setf ret\r\n	       (concatenate \'string ret (format nil \"<script src=\\\"/js/~A.js\\\"></script>~%\" url))))\r\n    ret))\r\n\r\n(defun image-tag (url &key (width \"\") (height \"\") (alt url))\r\n  (format nil \"<img src=\\\"/images/~A\\\" width=~S height=~S alt=~S\" url width height alt))\r\n(defun image-path (image)\r\n  (concatenate \'string \"/images/\" image))\r\n\r\n(defun page-title (&optional (title nil) &rest parts)\r\n  (cond \r\n    ((or (null title) (string= \"\" title))\r\n     (return-from page-title *app-name*))\r\n  