\r\n        ushort temp;\r\n        for (ushort i = 0; i < table.Length; ++i)\r\n        {\r\n            value = 0;\r\n            temp = i;\r\n            for (byte j = 0; j < 8; ++j)\r\n            {\r\n                if (((value ^ temp) & 0x0001) != 0)\r\n                {\r\n                    value = (ushort)((value >> 1) ^ polynomial);\r\n                }\r\n                else\r\n                {\r\n                    value >>= 1;\r\n                }\r\n                temp >>= 1;\r\n            }\r\n            table[i] = value;\r\n        }\r\n    }\r\n}[/CSHARP]','9edf36cb576517e9135939fe62a2f07dc02187de',1,'2014-10-22 12:04:30','2014-10-22 12:04:30',1,NULL,NULL),(78,'Unnamed #78','[CSHARP]using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nusing System.Threading;\r\nusing System.Threading.Tasks;\r\n\r\nnamespace ArcadiaCRC_Finder_v1._0._0._0 {\r\n    class CrcFinder {\r\n        //Поля\r\n        EventWaitHandle thread1_wh = new AutoResetEvent(false);\r\n        EventWaitHandle thread2_wh = new AutoResetEvent(false);\r\n        List<uint> resultThread1 = new List<uint>();\r\n        List<uint> resultThread2 = new List<uint>();\r\n        List<uint> filteredResult = new List<uint>();\r\n        Crc16 crc_1;\r\n        Crc16 crc_2;\r\n\r\n        //Свойства\r\n        uint Start { get; set; }\r\n        uint dataCrc_1 { get; set; }\r\n        uint dataCrc_2 { get; set; }\r\n        public List<uint> FilteredResult {\r\n            get {\r\n                return filteredResult;\r\n            }\r\n        }\r\n\r\n        //События\r\n        public event EventHandler<CrcEventArgs> doneEvent;\r\n\r\n        //Конструктор\r\n        public CrcFinder(byte[] data_1, byte[] data_2,uint start, uint crcRes_1, uint crcRes_2) {\r\n            crc_1 = new Crc16(data_1);\r\n            crc_2 = new Crc16(data_2);\r\n            dataCrc_1 = crcRes_1;\r\n            dataCrc_2 = crcRes_2;\r\n            Start = start;\r\n        }\r\n\r\n        //Основной метод поиска\r\n        public void StartSearchCrc() {\r\n            Thread tSearch_1 = new Thread(new ThreadStart(Search_1));\r\n            Thread tSearch_2 = new Thread(new ThreadStart(Search_2));\r\n            Thread fResults = new Thread(new ThreadStart(FilterResults));\r\n\r\n            tSearch_1.IsBackground = true;\r\n            tSearch_2.IsBackground = true;\r\n            fResults.IsBackground = true;\r\n\r\n            tSearch_1.Start();\r\n            tSearch_2.Start();\r\n            fResults.Start();\r\n        }\r\n        //Метод поиска для первого массива\r\n        void Search_1() {\r\n            for (uint i = 0; i <= 0xffff; i++) {\r\n                uint result_1 = crc_1.GetCRC16(i, Start);\r\n                if (result_1 == dataCrc_1) {\r\n                    resultThread1.Add(i);\r\n                }\r\n            }\r\n            thread2_wh.Set();\r\n        }\r\n        //Метод поиска для второго массива\r\n        void Search_2() {\r\n            for (uint i = 0; i <= 0xffff; i++) {\r\n                uint result_2 = crc_2.GetCRC16(i, Start);\r\n                if (result_2 == dataCrc_2) {\r\n                    resultThread2.Add(i);\r\n                }\r\n            }\r\n            thread1_wh.Set();\r\n        }\r\n        //Метод фильтрации результатов\r\n        void FilterResults() {\r\n            thread1_wh.WaitOne();\r\n            thread2_wh.WaitOne();\r\n\r\n            if ((resultThread1.Count != 0) && (resultThread2.Count != 0)) {\r\n                foreach (uint r1 in resultThread1) {\r\n                    foreach (uint r2 in resultThread2) {\r\n                        filteredResult.Add(r1);\r\n                    }\r\n                }\r\n                    \r\n                if (doneEvent != null) {\r\n                    string info = string.Format(\"Найдено {0} совпадений!\", filteredResult.Count);\r\n                    doneEvent(this, new CrcEventArgs(info));\r\n     