        //Счетчик найденных вариантов\r\n            uint count = 0;\r\n            //Цикл перебора полиномов\r\n            for (uint i = 0; i <= 0xffff; i++) {\r\n                //Цикл перебора начальных КС\r\n                for (uint j = 0; j < 0xffff; j++) {\r\n                    //Найденная КС, где i - полином\r\n                    //j - начальная КС\r\n                    uint result_2 = crc_2.GetCRC16(i, j);\r\n                    //Проверяем найденную КС\r\n                    //на совпадение с реальной\r\n                    //и при совпадении добавляем в словарь\r\n                    if (result_2 == dataCrc_2) {\r\n                        resultThread2.Add(i, j);\r\n                        //Увеличиваем счетчик и вызываем событие процесса поиска\r\n                        count++;\r\n                        if (processEvent != null) {\r\n                            string info = string.Format(\"{0} совпадений надено в потоке {1}\",\r\n                                count, Thread.CurrentThread.Name);\r\n                            processEvent(this, new CrcEventArgs(info));\r\n                        }\r\n                    }\r\n                }\r\n            }\r\n            thread1_wh.Set();\r\n        }\r\n        //Метод фильтрации результатов\r\n        void FilterResults() {\r\n            //Ожидание завершения обоих потоков поиска\r\n            thread1_wh.WaitOne();\r\n            thread2_wh.WaitOne();\r\n\r\n            //Проверяем наличие данных в обоих словарях\r\n            if ((resultThread1.Count != 0) && (resultThread2.Count != 0)) {\r\n                //Находим одинаковые значения в обоих словарях\r\n                //И добавляем их в выходной словарь\r\n                foreach (KeyValuePair<uint, uint> keyV_1 in resultThread1) {\r\n                    foreach (KeyValuePair<uint, uint> keyV_2 in resultThread2) {\r\n                        if ((keyV_1.Key == keyV_2.Key) && (keyV_1.Value == keyV_2.Value)) {\r\n                       