 /l %%d in (1,1,5) do ( type nul > testt\\%%a\\%%b\\%%c\\%%d\\1.txt && type nul > testt\\%%a\\%%b\\%%c\\1.txt && type nul > testt\\%%a\\%%b\\1.txt && type nul > testt\\%%a\\1.txt) ) && echo Готово && goto menu\r\nif %action% == 3 (del /s /q testt\\*)\r\nif %action% == 4 (for /l %%i in (1,1,5) do rd /s /q testt\\%%i)\r\nif %action% == 5 (for /l %%d in (1,1,5) do md dir_%%d)\r\nif %action% == 6 (for %%i in (images/*) do (\r\n::@TODO: ...\r\n)\r\nif %action% == 7 exit /b\r\n\r\necho Готово\r\ngoto menu\r\n\r\n\r\nexit /b[/SHELL]','a211e9621c00eb155953a1ae8440485c18c1c824',1,'2015-01-26 13:17:45','2015-02-19 05:35:35',1,1,''),(122,'Unnamed #122','[C_CPP]Страница  12 => 1 вхождений\r\nСтраница  7 => 20 вхождений\r\nСтраница  11 => 0 вхождений\r\nСтраница  8 => 20 вхождений\r\nСтраница  9 => 20 вхождений\r\nСтраница  10 => 20 вхождений\r\nСтраница  6 => 0 вхождений\r\nСтраница  4 => 20 вхождений\r\nСтраница  2 => 20 вхождений\r\nСтраница  3 => 20 вхождений\r\nСтраница  5 => 20 вхождений\r\nСтраница  1 => 0 вхождений[/C_CPP]','ea2b1cf931b869ba26c541db54baddfda89806b9',1,'2015-01-26 13:39:45','2015-01-26 13:41:24',1,1,''),(123,'Unnamed #123','[LISP](reset)\r\n(clear)\r\n(unwatch all)\r\n(watch facts)\r\n(watch rules)\r\n(watch activations)\r\n\r\n(deftemplate development (slot status (default choose)))\r\n(deftemplate os-development (slot status))\r\n(deftemplate engineer-computing (slot status))\r\n(deftemplate oop-language (slot status))\r\n(deftemplate II-development (slot status))\r\n(deftemplate Science (slot status))\r\n(deftemplate study-language (slot status))\r\n(deftemplate cross-platform-development (slot status))\r\n(deftemplate compilation (slot status))\r\n(deftemplate jit-compilation (slot status))\r\n(deftemplate jit-compilation-for-cross (slot status))\r\n(deftemplate interpretator (slot status))\r\n(deftemplate programming-home-appliances (slot status))\r\n(deftemplate web-pages (slot status))\r\n(deftemplate easy-web (slot status))\r\n(deftemplate high-speed-development (slot status))\r\n(deftemplate form-language (slot status))\r\n(deftemplate pascal-style-language (slot status))\r\n(deftemplate c-style-language (slot status))\r\n\r\n(deffunction print-lang (?spec ?lang)\r\n  \"Вывод найденного на экран пользователя\"\r\n  (printout t \"For \'\" ?spec \"\' shoold choose \" ?lang crlf crlf))\r\n\r\n(deffunction ask-question (?question $?allowed-values)\r\n   (printout t ?question)\r\n   (bind ?answer (read))\r\n   (if (lexemep ?answer) \r\n       then (bind ?answer (lowcase ?answer)))\r\n   (while (not (member ?answer ?allowed-values)) do\r\n      (printout t ?question)\r\n      (bind ?answer (read))\r\n      (if (lexemep ?answer) \r\n          then (bind ?answer (lowcase ?answer))))\r\n   ?answer)\r\n\r\n(deffunction yes-or-no-p (?question)\r\n   (bind ?response (ask-question ?question yes no y n))\r\n   (or (eq ?response yes) (eq ?response y)))\r\n\r\n(defrule development\r\n  (development (status choose)) => (if (yes-or-no-p \"Driver development (yes/no) ? \")\r\n                          then (print-lang \"Driver development\" \"ASM\")\r\n                          else (assert (os-development (status choose)))))\r\n\r\n(defrule os-development\r\n  (os-development (status choose)) => (if (yes-or-no-p \"OS Development (yes/no) ? \")\r\n                      then (print-lang \"OS development\" \"ASM\")\r\n                      else (assert (engineer-computing (status choose)))))\r\n           \r\n(defrule engineer-computing\r\n  (engineer-computing (status choose)) => (if (yes-or-no-p \"Engineer computing (yes/no) ? \")\r\n                          then (print-lang \"Engineer computing\" \"Forthran\")\r\n                          else (assert (Science (status choose)))))\r\n\r\n(defrule Science\r\n  (Science (status choose)) => (if (yes-or-no-p \"Science computing (yes/no) ? \")\r\n                   then (print-lang \"Science computing\" \"Forthran\")\r\n                   else (assert (II-development (status choose)))))\r\n                     \r\n(defrule II-development\r\n  (II-development (status choose)) => (if (yes-or-no-p \"II development (yes/no) ? \")\r\n                      then (print-lang \"II development\" \"LISP\")\r\n                      else (assert (study-language (status choose)))))\r\n                     \r\n(defrule study-language\r\n  (study-language (status choose)) => (if (yes-or-no-p \"Study language (yes/no) ? \")\r\n                      then (print-lang \"study language\" \"Pascal\")\r\n                      else (assert (cross-platform-development (status choose)))))\r\n                 \r\n(defrule cross-platform-development\r\n  (cross-platform-development (status choose)) => (if (yes-or-no-p \"Cross-platform development (yes/no) ? \")\r\n                              then (assert (jit-compilation-for-cross (status choose)))\r\n                              else (assert (compilation (status choose)))))\r\n\r\n(defrule compilation\r\n  (compilation (status choose)) => (if (yes-or-no-p \"Compilation (yes/no) ? \")\r\n				       then (assert (jit-compilation (status choose)))\r\n				       else (assert (interpretator (status choose)))))\r\n\r\n(defrule jit-compilation\r\n  (jit-compilation (status choose)) => (if (yes-or-no-p \"JIT compilation (yes/no) ? \")\r\n					   then (assert (programming-home-appliances (status choose)))\r\n					   else (print-lang \"Non-JIT compilation\" \"C++\")))\r\n\r\n(defrule jit-compilation-for-cross\r\n  (jit-compilation-for-cross (status choose)) => (if (yes-or-no-p \"JIT compilation (yes/no) ? \")\r\n						     then (print-lang \"Cross-platform\" \"Java\")\r\n						     else (print-lang \"Cross-platform\" \"C++\")))\r\n         \r\n(defrule interpretator\r\n  (interpretator (status choose)) => (if (yes-or-no-p \"Interpretator (yes/no) ? \")\r\n                     then (assert (web-pages (status choose)))\r\n                     else (printout t \"Unknown language type\" crlf)))\r\n                     \r\n(defrule programming-home-appliances\r\n  (programming-home-appliances (status choose)) => (if (yes-or-no-p \"Programming of home appliances (yes/no) ? \")\r\n						       then (print-lang \"Programming of home appliances\" \"Java\")\r\n						       else (assert (web-pages (status choose)))))\r\n                     \r\n(defrule web-pages\r\n  (web-pages (status choose)) => (if (yes-or-no-p \"Programming for web (yes/no) ? \")\r\n				     then (assert (easy-web (status choose)))\r\n				     else (assert (form-language (status choose)))))\r\n                     \r\n(defrule easy-web\r\n  (easy-web (status choose)) => (if (yes-or-no-p \"Easy web language (yes/no)? \")\r\n				    then (print-lang \"Easy programming for web\" \"PHP\")\r\n				    else (assert (high-speed-development (status choose)))))\r\n                     \r\n(defrule high-speed-development\r\n  (high-speed-development (status choose)) => (if (yes-or-no-p \"High Speed Development (yes/no) ? \")\r\n						  then (print-lang \"High Speed Development\" \"Ruby\")\r\n						  else (print-lang \"Programming for web\" \"Python\")))\r\n\r\n(defrule form-language\r\n  (form-language (status choose)) => (if (yes-or-no-p \"Language with forms (yes/no) ? \")\r\n					 then (assert (c-style-language (status choose)))\r\n					 else (assert (pascal-style-language (status choose)))))\r\n\r\n(defrule pascal-style-language\r\n  (pascal-style-language (status choose)) => (if (yes-or-no-p \"Pascal-style language (yes/no) ? \")\r\n						 then (print-lang \"Language with forms\" \"Pascal/Delphi\")\r\n						 else (assert (pascal-style-language (status choose)))))\r\n\r\n(defrule c-style-language\r\n  (c-style-language (status choose)) => (if (yes-or-no-p \"C-style language (yes/no) ? \")\r\n					    then (print-lang \"Language with forms\" \"C#\")\r\n					    else (printout t \"Unknown language type\" crlf)))[/LISP]','4c2c35a22312bce957aea749e8ff4d034b7975c4',0,'2015-01-31 02:41:53','2015-01-31 02:41:53',1,1,''),(124,'switch()','[CSHARP]//Обработчик прогресса при записи\r\n        void writer_ProgressChanged(object sender, ProgressChangedEventArgs e) {\r\n            string arg = (string)e.UserState;\r\n            switch (arg) {\r\n                case \"START_WRITE\": {\r\n                    prgBar.Value = 0;\r\n                    prgBar.Visible = true;\r\n                    prgBar.Maximum = e.ProgressPercentage;\r\n                    prgBar.Step = 0x40;\r\n\r\n                    lblStatus.Visible = true;\r\n                    lblStatus.ForeColor = Color.Red;\r\n                    lblStatus.Text = \"ЗАПИСЬ\";\r\n                    }\r\n                    break;\r\n                case \"RESET_BAR\": {\r\n                    prgBar.Value = 0;\r\n                    prgBar.Step = 0x100;\r\n\r\n                    lblStatus.ForeColor = Color.Green;\r\n                    lblStatus.Text = \"ЧТЕНИЕ\";\r\n                    }\r\n                    break;\r\n                case \"STEP_WRITE\": {\r\n                    prgBar.PerformStep();\r\n                    }\r\n                    break;\r\n                case \"STEP_READ\": {\r\n                    prgBar.PerformStep();\r\n                    }\r\n                    break;\r\n                case \"BAR_OFF\": {\r\n                    prgBar.Visible = false;\r\n                    lblStatus.Visible = false;\r\n                    }\r\n                    break;\r\n            }\r\n        }[/CSHARP]','960e68cf442bc1b2331731a3c64afc50fd40bd8d',1,'2015-01-31 08:42:43','2015-01-31 08:42:43',1,NULL,NULL),(125,'Unnamed #125','[PASCAL]program black;\r\n  var num,num2,num3:integer;\r\n  var S1,t1,V1,m1,V2,p1,m2,g1,F1,k1,x1,m3,g2,P2,Fm1,Fa1,P3,p4,F2,S2,p5,g3,h1,p7,h2,g4,p8,p6,pa2,h3,p9,F3:real;\r\nbegin\r\n  writeln(\'Что нужно найти?\');\r\n  writeln(\'1. Скорость\');\r\n  writeln(\'2. Плотность\');\r\n  writeln(\'3. Силу тяжести\');\r\n  writeln(\'4. Силу упругости\');\r\n  writeln(\'5. Вес тела/Вес тела в жидкости\');\r\n  writeln