      writeln(\'Введите g\');\r\n        readln(g1);\r\n        F1:=m2*g1;\r\n        writeln(\'F = \',F1);\r\n      end;\r\n    4:begin\r\n        writeln(\'F(упр) = kx\');\r\n        writeln(\'---------\');\r\n        writeln(\'F(упр) - Сила упругости\');\r\n        writeln(\'k - Жесткость тела\');\r\n        writeln(\'x - Удлинение тела\');\r\n        writeln(\'---------\');\r\n        writeln(\'Введите k\');\r\n        readln(k1);\r\n        writeln(\'Введите x\');\r\n        readln(x1);\r\n        F2:=k1*x1;\r\n        writeln(\'F(упр) = \',F2);\r\n      end;\r\n    5:begin\r\n        writeln(\'1. P = m*g\');\r\n        writeln(\'2. P = Fm - Fa\');\r\n        writeln(\'----------\');\r\n        writeln(\'P - Вес\');\r\n        writeln(\'m - Масса\');\r\n        writeln(\'g - Ускорение свободного падения\');\r\n        writeln(\'----------\');\r\n        writeln(\'Введите номер формулы:\');\r\n        readln(num2);\r\n        case num2 of\r\n          1:begin\r\n              writeln(\'Введите m\');\r\n              readln(m3);\r\n              writeln(\'Введите g\');\r\n              readln(g2);\r\n              P2:=m3*g1;\r\n              writeln(\'P = \',P2);\r\n            end;\r\n          2:begin\r\n              writeln(\'Введите Fm\');\r\n              readln(Fm1);\r\n              writeln(\'Введите Fa\');\r\n              readln(Fa1);\r\n              P3:=Fm1*Fa1;\r\n              writeln(\'P = \',P3);\r\n            end;\r\n        end; \r\n      end;\r\n    6:begin\r\n        writeln(\'P = F/S\');\r\n        writeln(\'--------\');\r\n        writeln(\'p - Давление\');\r\n        writeln(\'F - Сила\');\r\n        writeln(\'S - Площадь\');\r\n        writeln(\'--------\');\r\n        writeln(\'Введите F\');\r\n        readln(F3);\r\n        writeln(\'Введите S\');\r\n        readln(S2);\r\n        p4:=F3/S2;\r\n        writeln(\'p = \',p4);\r\n      end;\r\n    7:begin\r\n        writeln(\'1. p = pgh\');\r\n        writeln(\'2. p = Pa+pgh\');\r\n        writeln(\'3. pa = 10^5 Па\');\r\n        writeln(\'----------\');\r\n        writeln(\'p - Плотность\');\r\n        writeln(\'g - Ускорение\');\r\n        writeln(\'h - Высота столба жидкости\');\r\n        writeln(\'pa - Нормальное атмосфрное давление\');\r\n        writeln(\'----------\');\r\n        writeln(\'Введите номер формулы\');\r\n        readln(num3);\r\n        case num3 of\r\n          1:begin\r\n              writeln(\'Введите p\');\r\n              readln(p5);\r\n              writeln(\'Введите g\');\r\n              readln(g3);\r\n              writeln(\'Введите h\');\r\n              readln(h1);\r\n              p6:=p5*g2*h1;\r\n              writeln(\'p = \',p6);\r\n            end;\r\n          2:begin\r\n              writeln(\'Введите p\');\r\n              readln(p7);\r\n              writeln(\'Введите g\');\r\n              readln(g4);\r\n              writeln(\'Введите h\');\r\n              readln(h2);\r\n              p8:=pa2+(p7*g1*h2);\r\n              writeln(\'p = \',p8);\r\n            end;\r\n          3:begin\r\n              writeln(\'pa = \',pa2);\r\n            end;\r\n        end;\r\n      end;\r\n    8:begin\r\n        writeln(\'p = pa-(h/12)\');\r\n        writeln(\'--------\');\r\n        writeln(\'p - Давление воздуха\');\r\n        writeln(\'h - Высота\');\r\n        writeln(\'pa - Нормальное атмосферное давление\');\r\n        writeln(\'--------\');\r\n        writeln(\'Введите h\');\r\n        readln(h3);\r\n        p9:=pa2-(h3/12);\r\n        writeln(\'p = \',p9);\r\n      end;\r\n  end;readln;\r\nend.[/PASCAL]','fcca43f11ed88c87cec18ddfff0c9855e7624b05',1,'2015-02-02 13:12:27','2015-02-02 13:12:27',1,7,NULL),(128,'Lol)','[RUBY]#!/usr/bin/env ruby\r\n# -*- coding: UTF-8 -*-\r\n\r\nrequire \'green_shoes\'\r\n\r\nFILE_NAME = \'db.txt\'\r\n\r\nFile.new FILE_NAME, \'w\' unless File.exists? FILE_NAME\r\n \r\nShoes.app title: \'RubyPasswordSaver\', width: 1200 do\r\n \r\n  @records = []\r\n  \r\n  stack do\r\n	  background \'#FCFCFC\'\r\n	  caption \'Сохраненные пароли:\'\r\n\r\n	  flow do \r\n		para strong(\'Адрес URL\'), width: 260, margin: 5\r\n		para strong(\'Email\'), width: 250, margin: 5\r\n		para strong(\'Пароль\'), width: 210, margin: 5\r\n		para strong(\'Дополнительно\'), width: 250, margin: 5\r\n	  end\r\n	  \r\n	  File.open(FILE_NAME).each do |line|\r\n		next if line.gsub(\'~\', \'\').chomp.empty?\r\n		line = line.chomp.split \'~~~~~\'\r\n	    flow do\r\n			@record = Hash.new\r\n			@record[:url] 		= edit_line line[0], width: 250, margin: 5\r\n			@record[:email] 	= edit_line line[1],  width: 240, margin: 5\r\n			@record[:password] 	= edit_line line[2].unpack(\'u\').first,  width: 200, margin: 5\r\n			@record[:comment] 	= edit_line line[3],  width: 240, margin: 5\r\n			@records.push(@record)\r\n		  end\r\n	  end\r\n	  \r\n	  flow do\r\n		@record = Hash.new\r\n		@record[:url] 		= edit_line width: 250, margin: 5\r\n		@record[:email] 	= edit_line width: 240, margin: 5\r\n		@record[:password] 	= edit_line width: 200, margin: 5\r\n		@record[:comment] 	= edit_line width: 240, margin: 5\r\n		@records.push(@record)\r\n	  end\r\n		  \r\n	  stack do\r\n		button \'Сохранить\' do\r\n			@lines = []\r\n			@records.each do |r|\r\n			  line = \"#{r[:url].text}~~~~~#{r[:email].text}~~~~~#{([r[:password].text].pack \'u\').chomp}~~~~~#{r[:comment].text}\"\r\n			  next if line.gsub(\'~\', \'\').chomp.empty?\r\n			  @lines.push line\r\n			end\r\n			File.open(FILE_NAME, \'w\'){|f| f.puts  @lines.join(\"\\n\")}\r\n		end\r\n	  end\r\n  end\r\nend[/RUBY]\r\n\r\n','4bb85e9f68901cb560b0930a70ea6efaf28aca0b',1,'2015-02-09 12:07:29','2015-02-09 12:10:46',1,1,'cyberforum.ru'),(129,'Unnamed #129','[CSHARP]using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nnamespace ConsoleApplication2 {\r\n    class Program {\r\n        static void Main(string[] args) {\r\n\r\n            string s = \"hfyvby2dgt\";\r\n            bool hasDigits = s.Count(i => char.IsDigit(i)) == 0 ? false : true;\r\n            Console.WriteLine(hasDigits);\r\n        }\r\n    }\r\n}[/CSHARP]\r\n\r\n[CSHARP]bool hasDigits = s.Count(i => char.IsDigit(i)) != 0; // ^_^[/CSHARP]','d7eb7fbd1f8e98b957edc2c10f5f56fba797c345',1,'2015-02-09 14:39:04','2015-02-09 14:53:33',1,NULL,''),(130,'Unnamed #130','[JAVA]package com.javarush.test.level07.lesson09.task02;\r\n\r\nimport java.io.BufferedReader;\r\nimport java.io.InputStreamReader;\r\nimport java.util.ArrayList;\r\nimport java.util.Collections;\r\n\r\n/* 5 слов в обратном порядке\r\nВведи с клавиатуры 5 слов в список строк. Выведи их в обратном порядке.\r\n*/\r\n\r\npublic class Solution\r\n{\r\n    public static void main(String[] args) throws Exception\r\n    {\r\n        //Напишите тут ваш код\r\n        ArrayList<String> list = new ArrayList<String>();\r\n        BufferedReader r = new BufferedReader(new InputStreamReader(System.in));\r\n        for (int i = 0; i < 5; i++) {\r\n            list.add(r.readLine());\r\n        }\r\n        for (int i = 0; i < list.size(); i++) {\r\n            System.out.println(list.get(list.size() - i - 1));\r\n        }\r\n    }\r\n}[/JAVA]\r\n\r\n[JAVA]//Made by Who?))\r\nimport java.util.ArrayList;\r\nimport java.util.Scanner;\r\n\r\n/* Удалить людей, имеющих одинаковые имена \r\nСоздать словарь (Map<String, String>) занести в него десять записей по принципу «фамилия» - «имя». \r\nУдалить людей, имеющих одинаковые имена. \r\n*/\r\n\r\npublic class Solution\r\n{\r\n    private static final int SIZE = 5;\r\n\r\n    public static void main(String[] args) throws java.io.IOException\r\n    {\r\n        ArrayList<String> list = new ArrayList<String>(SIZE);\r\n        Scanner in = new Scanner(System.in);\r\n\r\n        repeat(SIZE, () -> list.add(in.nextLine()));\r\n\r\n        for(int i = SIZE - 1; i >= 0; --i)\r\n            System.out.println(list.get(i));\r\n\r\n        System.in.read();\r\n    }\r\n\r\n    public static void repeat(final int N, Runnable r)\r\n    {\r\n        for (int i = 0; i < N; ++i)\r\n            r.run();\r\n    }\r\n}[/JAVA]','d58a23cb7abc72a77d2a53c17b067b1e3065e0ff',1,'2015-02-15 14:08:41','2015-02-17 09:42:40',1,4,''),(131,'Unnamed #131','[JAVA]package com.javarush.test.level08.lesson08.task05;\r\n\r\nimport java.util.HashMap;\r\nimport java.util.HashSet;\r\nimport java.util.Iterator;\r\nimport java.util.Map;\r\n\r\n/* Удалить людей, имеющих одинаковые имена\r\nСоздать словарь (Map<String, String>) занести в него десять записей по принципу «фамилия» - «имя».\r\nУдалить людей, имеющих одинаковые имена.\r\n*/\r\n\r\npublic class Solution\r\n{\r\n    public static HashMap<String, String> createMap()\r\n    {\r\n        //Напишите тут ваш код\r\n        HashMap<String, String> temp = new HashMap<String, String>();\r\n        temp.put(\"Иванов\", \"Игорь\");\r\n        temp.put(\"Петров\", \"Иван\");\r\n        temp.put(\"Сидоров\", \"Сергей\");\r\n        temp.put(\"Евсюков\", \"Владимир\");\r\n        temp.put(\"Смирнов\", \"Андрей\");\r\n        temp.put(\"Земкова\", \"Татьяна\");\r\n        temp.put(\"Путин\", \"Владимир\");\r\n        temp.put(\"Белова\", \"Яна\");\r\n        temp.put(\"Вовняков\", \"Денис\");\r\n        temp.put(\"Чешагоров\", \"Денис\");\r\n        return temp;\r\n\r\n    }\r\n\r\n    public static void removeTheFirstNameDuplicates(HashMap<String, String> map)\r\n    {\r\n        //Напишите тут ваш код\r\n        HashSet<String> spisok = new HashSet<String>();\r\n        Iterator<Map.Entry<String, String>> iterator = map.entrySet().iterator();\r\n\r\n        for (Map.Entry<String, String> s1 : map.entrySet()) {\r\n            int count = 0;\r\n            for (Map.Entry<String,String> s2 : map.entrySet()) {\r\n                if (s1.getValue().equals(s2.getValue())) count++;\r\n            }\r\n            if (count > 1) spisok.add(iterator.next().getKey());\r\n        }\r\n        for (String s : spisok) {\r\n            //System.out.print(s + \" \");\r\n            removeItemFromMapByValue(map, s);\r\n\r\n        }\r\n    }\r\n\r\n    public static void removeItemFromMapByValue(HashMap<String, String> map, String value)\r\n    {\r\n        HashMap<String, String> copy = new HashMap<String, String>(map);\r\n        for (Map.Entry<String, String> pair: copy.entrySet())\r\n        {\r\n            if (pair.getKey().equals(value))\r\n                map.remove(pair.getKey());\r\n        }\r\n    }\r\n\r\n    public static void main(String[] args)\r\n    {\r\n        HashMap<String,String> mmm = createMap();\r\n        for (HashMap.Entry<String,String> pair : mmm.entrySet()) {\r\n            System.out.println(pair.getKey() + \" \" + pair.getValue());\r\n        }\r\n        removeTheFirstNameDuplicates(mmm);\r\n        System.out.println(\".............................\");\r\n        for (HashMap.Entry<String,String> pair : mmm.entrySet()) {\r\n            System.out.println(pair.getKey() + \" \" + pair.getValue());\r\n        }\r\n    }\r\n}[/JAVA]\r\n\r\n[JAVA]//Made by Who?))\r\nimport java.util.HashMap;\r\nimport java.util.ArrayList;\r\nimport java.util.Collections;\r\nimport java.util.Iterator;\r\n\r\n/* Удалить людей, имеющих одинаковые имена \r\nСоздать словарь (Map<String, String>) занести в него десять записей по принципу «фамилия» - «имя». \r\nУдалить людей, имеющих одинаковые имена. \r\n*/\r\n\r\npublic class Solution\r\n{\r\n    private static final int SIZE = 10;\r\n\r\n    public static HashMap<String, String> createMap()\r\n    {\r\n        HashMap<String, String> temp = new HashMap<String, String>(SIZE);\r\n        temp.put(\"Иванов\", \"Игорь\");\r\n        temp.put(\"Петров\", \"Иван\");\r\n        temp.put(\"Сидоров\", \"Сергей\");\r\n        temp.put(\"Евсюков\", \"Владимир\");\r\n        temp.put(\"Смирнов\", \"Андрей\");\r\n        temp.put(\"Земкова\", \"Татьяна\");\r\n        temp.put(\"Путин\", \"Владимир\");\r\n        temp.put(\"Белова\", \"Яна\");\r\n        temp.put(\"Вовняков\", \"Денис\");\r\n        temp.put(\"Чешагоров\", \"Денис\");\r\n        return temp;\r\n\r\n    }\r\n\r\n    public static void removeTheFirstNameDuplicates(HashMap<String, String> map)\r\n    {\r\n        Iterator<String> it = map.values().iterator();\r\n        ArrayList<String> values = new ArrayList<String>();\r\n\r\n        while(it.hasNext())\r\n        {\r\n            String value = it.next();\r\n            if (Collections.frequency(map.values(), value) > 1 && !values.contains(value))\r\n                values.add(value);\r\n        }\r\n\r\n        map.values().removeAll(values);\r\n    }\r\n\r\n    public static void main(String[] args)\r\n    {\r\n        HashMap<String,String> mmm = createMap();\r\n\r\n        for (HashMap.Entry pair : mmm.entrySet())\r\n            System.out.println(pair.getKey() + \" \" + pair.getValue());\r\n\r\n        removeTheFirstNameDuplicates(mmm);\r\n\r\n        System.out.println(\".............................\");\r\n\r\n        for (HashMap.Entry pair : mmm.entrySet())\r\n            System.out.println(pair.getKey() + \" \" + pair.getValue());\r\n    }\r\n}[/JAVA]','87b348b3ea5b4a6befba5c87b43476c0b2713cae',1,'2015-02-16 06:31:55','2015-02-17 09:18:00',1,NULL,''),(132,'Задачка...','[JAVA]package com.javarush.test.level08.lesson11.bonus01;\r\n\r\nimport java.io.BufferedReader;\r\nimport java.io.IOException;\r\nimport java.io.InputStreamReader;\r\nimport java.util.*;\r\n\r\n/* Номер месяца\r\nПрограмма вводит с клавиатуры имя месяца и выводит его номер на экран в виде: «May is 5 month».\r\n*/\r\n\r\npublic class Solution\r\n{\r\n    public static void main(String[] args) throws IOException\r\n    {\r\n        //add your code here - напиши код тут\r\n        String[] m = {\"January\", \"February\", \"March\", \"April\", \"May\", \"June\", \"July\", \"August\",\r\n            \"September\", \"October\", \"November\", \"December\"};\r\n        BufferedReader bufferedReader = new BufferedReader(new InputStreamReader(System.in));\r\n        String m1 = bufferedReader.readLine();\r\n        for (int i = 0; i < 12; i++) {\r\n            if (m[i].equals(m1)) System.out.println(m[i] + \" is \" +  (i+1) + \" month\");\r\n        }\r\n    }\r\n\r\n}[/JAVA]\r\n\r\n[JAVA]//Made by Who?))\r\nimport java.util.Scanner;\r\nimport java.util.Arrays;\r\n\r\npublic class Solution\r\n{\r\n    public static void main(String[] args) throws java.io.IOException\r\n    {\r\n        String[] months = {\"January\", \"February\", \"March\", \"April\", \"May\", \"June\", \"July\", \"August\",\r\n                \"September\", \"October\", \"November\", \"December\"};\r\n        \r\n        Scanner in = new Scanner(System.in);\r\n        String month = in.nextLine();\r\n        \r\n        int index = Arrays.asList(months).indexOf(month);\r\n        \r\n        System.out.println(index == -1 ? \"Unknown month\" : index + 1);\r\n        \r\n        System.in.read();\r\n    }\r\n}[/JAVA]','e2cab6fb0941336ad61663c93b2169c22c0e819d',1,'2015-02-16 11:07:42','2015-02-17 07:15:44',1,4,''),(133,'JavaRush статики...','[JAVA]package com.javarush.test.level09.lesson11.home07;\r\n\r\n/* Расставь модификаторы static\r\nРасставь модификаторы static так, чтобы пример скомпилировался.\r\n\r\nнадо поставить минимальное количество статиков!!!\r\n*/\r\n\r\npublic class Solution\r\n{\r\n    public  int A = 5;\r\n    public  int B = 2 * A;\r\n    public  int C = A * B;\r\n    public  int D = A * B;\r\n\r\n    public  void main(String[] args)\r\n    {\r\n        Solution room = new Solution();\r\n        room.A = 5;\r\n\r\n        Solution.D = 5;\r\n    }\r\n\r\n    public int getA()\r\n    {\r\n        return A;\r\n    }\r\n}[/JAVA]','8d4ffa2f5d57de294a6da254bca099e22064ddd8',1,'2015-02-18 14:11:05','2015-02-19 00:23:49',1,4,''),(134,'SimpleDataFormat','Это я добавил, чтобы не забыть прокурить этот класс...\r\n\r\n[JAVA]package com.javarush.test.level09.lesson11.home04;\r\n\r\nimport java.io.BufferedReader;\r\nimport java.io.InputStreamReader;\r\nimport java.text.SimpleDateFormat;\r\nimport java.util.Date;\r\nimport java.util.Locale;\r\n\r\n/* Конвертер дат\r\nВвести с клавиатуры дату в формате «08/18/2013»\r\nВывести на экран эту дату в виде «AUG 18, 2013».\r\nВоспользоваться объектом Date и SimpleDateFormat.\r\n*/\r\n\r\npublic class Solution {\r\n\r\n    public static void main(String[] args) throws Exception {\r\n        BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));\r\n        String s = reader.readLine();\r\n        SimpleDateFormat formatter = new SimpleDateFormat(\"MM/dd/yyyy\");\r\n        Date givenDate = formatter.parse(s);\r\n        SimpleDateFormat formatterprint = new SimpleDateFormat(\"MMM dd, yyyy\", Locale.US);\r\n        System.out.println(formatterprint.format(givenDate).toUpperCase());\r\n    }\r\n}[/JAVA]','81cf8df32577a064225a1b23b8547ef4b52a7ee4',1,'2015-02-19 00:23:17','2015-02-19 11:35:38',1,4,''),(135,'javarush: 2 отдельных сортировки в списке','Нужно написать только метод сортировки, остальное трогать нельзя...\r\nИспользовать можно всё... (Но код писать только в рамках метода \r\npublic static void sort(String[] array) {}\r\n[JAVA]package com.javarush.test.level10.lesson11.bonus02;\r\n\r\n/**\r\n * Created by Андрей on 19.02.2015.\r\n */\r\npublic class l\r\n{\r\n}\r\n\r\npackage com.javarush.test.level09.lesson11.bonus03;\r\n\r\n        import java.io.BufferedReader;\r\n        import java.io.InputStreamReader;\r\n        import java.util.ArrayList;\r\n\r\n/* Задача по алгоритмам\r\nЗадача: Пользователь вводит с клавиатуры список слов (и чисел). Слова вывести в возрастающем порядке, числа - в убывающем.\r\nПример ввода:\r\nВишня\r\n1\r\nБоб\r\n3\r\nЯблоко\r\n2\r\n0\r\nАрбуз\r\nПример вывода:\r\nАрбуз\r\n3\r\nБоб\r\n2\r\nВишня\r\n1\r\n0\r\nЯблоко\r\n*/\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws Exception {\r\n        BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));\r\n        ArrayList<String> list = new ArrayList<String>();\r\n        while (true) {\r\n            String s = reader.readLine();\r\n            if (s.isEmpty()) break;\r\n            list.add(s);\r\n        }\r\n\r\n        String[] array = list.toArray(new String[list.size()]);\r\n        sort(array);\r\n\r\n    }\r\n\r\n    public static void sort(String[] array) {\r\n        //Напишите тут ваш код\r\n\r\n        \r\n    }\r\n\r\n    //Метод для сравнения строк: \'а\' больше чем \'b\'\r\n    public static boolean isGreaterThen(String a, String b) {\r\n        return a.compareTo(b) > 0;\r\n    }\r\n\r\n\r\n    //строка - это на самом деле число?\r\n    public static boolean isNumber(String s) {\r\n        if (s.length() == 0) return false;\r\n\r\n        for (char c : s.toCharArray()) {\r\n            if (!Character.isDigit(с) && c != \'-\') return false;\r\n        }\r\n        return true;\r\n    }\r\n}[/JAVA]\r\n\r\n\r\nМой говнокод:\r\n[JAVA]public static void sort(String[] array)\r\n    {\r\n        //Напишите тут ваш код\r\n        String[] copy = array;\r\n        boolean[] flags = new boolean[copy.length]; //массив расстановки чисел\r\n        //заполним массив расстановок и\r\n        //разделим массив на 2 списка\r\n        ArrayList<String> nums = new ArrayList<String>();\r\n        ArrayList<String> strs = new ArrayList<String>();\r\n        for (int i = 0; i < copy.length; i++) {\r\n            if (isNumber(copy[i])) {\r\n                flags[i] = true;\r\n                nums.add(copy[i]);\r\n            } else {\r\n                flags[i] = false;\r\n                strs.add(copy[i]);\r\n            }\r\n        }\r\n\r\n        //сортируем списки\r\n        for (int i = 0; i < nums.size(); i++) {\r\n            for (int j = nums.size() - 1; j > i; j--) {\r\n                if (Integer.parseInt(nums.get(j)) > Integer.parseInt(nums.get(i))) {\r\n                    String tmp = nums.get(i);\r\n                    nums.set(i, nums.get(j));\r\n                    nums.set(j, tmp);\r\n                }\r\n            }\r\n        }\r\n        for (int i = 0; i < strs.size(); i++) {\r\n            for (int j = strs.size() - 1; j > i; j--) {\r\n                if (isGreaterThen(strs.get(i),strs.get(j))) {\r\n                    String tmp = strs.get(i);\r\n                    strs.set(i, strs.get(j));\r\n                    strs.set(j, tmp);\r\n                }\r\n            }\r\n        }\r\n\r\n        //соединяем списки\r\n        ArrayList<String> sum = new ArrayList<String>();\r\n        int a = 0, b = 0;\r\n        for (int i =0; i < flags.length; i++) {\r\n            if (flags[i]) {\r\n                sum.add(nums.get(a));\r\n                a++;\r\n            }\r\n            else {\r\n                sum.add(strs.get(b));\r\n                b++;\r\n            }\r\n        }\r\n\r\n        //конвертируем в массив\r\n        String[] ddd = sum.toArray(new String[sum.size()]);\r\n        for (int i = 0; i < array.length; i++) {\r\n            array[i] = ddd[i];\r\n        }\r\n    }[/JAVA]','70bc77037a989e82262f32ad4cde49996804e274',1,'2015-02-19 11:51:49','2015-02-22 10:59:12',1,4,''),(136,'Unnamed #136','[JAVA]import java.util.Scanner;\r\n\r\npublic class Test\r\n{\r\n	public static void main(String[] args) throws java.util.InputMismatchException\r\n	{\r\n		Scanner in = new Scanner(System.in);\r\n		in.nextInt();\r\n	}\r\n}[/JAVA]','31103e26f9c3ab0c928213d0b1363a42d0fe9baa',1,'2015-02-19 12:15:23','2015-02-19 12:15:23',1,1,''),(137,'иерархия1','[JAVA]public class Chess\r\n{\r\n    \r\n}\r\n\r\npublic interface Movable {\r\n    void move();\r\n}\r\n\r\npublic abstract class ChessItem {\r\n    private int x; // горизонталь\r\n    private int y; // диагональ\r\n    private int value; // стоимость фигуры в пешках\r\n\r\n    @Override\r\n    public String toString()\r\n    {\r\n        return \"класс .Фигура.\";\r\n    }\r\n    \r\n    public abstract boolean getStatus(); //статус фигуры определяется реализацией (под боем/нет)\r\n}\r\n\r\n//потомки\r\n//ф