 9. Найди одну! ошибку и исправь.\r\nИспользуй дебаг. Для этого поставь breakpoint-ы(Ctrl+F8), потом зайди в меню Run -> Debug.\r\nF9 - выполнение кода до следующего breakpoint-а\r\nF8 - переход к следующей строке кода\r\n*/\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) {\r\n        new B(6);\r\n    }\r\n\r\n    public static class A {\r\n        private int f1 = 7;\r\n\r\n        public A(int f1) {\r\n            this.f1 = f1;\r\n            initialize();\r\n        }\r\n\r\n        protected void initialize() {\r\n            System.out.println(f1);\r\n        }\r\n    }\r\n\r\n    public static class B extends A {\r\n        protected int f1 = 3;\r\n\r\n        public B(int f1) {\r\n            super(f1);\r\n            this.f1 += f1;\r\n            initialize();\r\n        }\r\n\r\n        protected void initialize() {\r\n            System.out.println(f1);\r\n        }\r\n    }\r\n}[/JAVA]\r\n[JAVA]//A::protected void initialize() -> A::private void initialize()\r\n//безо всяких брекпоинтов :D[/JAVA]','571f3411d467729cf31971f7678d1fe22bc3a225',1,'2015-02-25 03:59:15','2015-02-25 12:03:28',1,4,''),(143,'insite2012.CandyExtractor problems 1','[CSHARP]using (Stream fs = File.OpenRead(filePath)) {\r\n    IReader reader = ReaderFactory.Open(fs);\r\n    //Распаковка в текущую директорию\r\n    while (reader.MoveToNextEntry()) {\r\n        reader.WriteEntryToDirectory(\".\");\r\n        //Имя распакованного файла\r\n        FileName = Path.GetFileName(reader.Entry.FilePath);\r\n        break;\r\n    }\r\n}[/CSHARP]','68e839f41547aef7b251f406aa87f59f73a9bad3',1,'2015-02-25 06:50:21','2015-02-25 06:51:21',1,6,''),(144,'Bad MergeSort','[CSHARP]/// <summary>\r\n/// Сортировка слиянием.\r\n/// Этот метод даёт неверные результаты по неизвестным мне причинам.\r\n/// </summary>\r\nprivate static void BadMerge<T>(T[] array, int start, int mid, int end)\r\nwhere T : IComparable<T> {\r\n    // разделение массива на два\r\n    T[] left = new T[mid - start];\r\n    Array.Copy(array, start, left, 0, left.Length);\r\n    T[] right = new T[end - mid];\r\n    Array.Copy(array, mid, right, 0, right.Length);\r\n\r\n    for (int index = start, i = 0, j = 0; index < end; index++) {\r\n        // перенос оставшихся элементов\r\n        if (i == left.Length) {\r\n            array[index] = right[j++];\r\n            continue;\r\n        }\r\n        if (j == right.Length) {\r\n            array[index] = left[i++];\r\n            continue;\r\n        }\r\n        // выбираем меньший из элементов \"массивов-частей\"\r\n        array[index] = (left[i].CompareTo(right[j]) != 1)\r\n            ? left[i++] : right[j++];\r\n    }\r\n}\r\n[/CSHARP]','289b53bf04df858e75849dde3c6b7c6feddca074',1,'2015-02-25 12:50:06','2015-02-25 12:50:06',1,6,NULL),(145,'Рабочий MergeSort','[CSHARP]/// <summary>\r\n/// Производит слияние двух отсортированных частей\r\n/// массива в цельный отсортированный массив.\r\n/// </summary>\r\nprivate static void Merge<T>(T[] array, int start, int mid, int end)\r\nwhere T : IComparable<T> {          \r\n    T[] temp = new T[end - start + 1];\r\n    int left = start, right = mid + 1, index = 0;\r\n    // выбирая элементы из левой и правой половины массива,\r\n    // определяем меньший из них; он будет очередным элементом\r\n    // временного отсортированного массива\r\n    while (left <= mid && right <= end) {\r\n        temp[index++] = (array[left].CompareTo(array[right]) != 1)\r\n            ? array[left++] : array[right++];\r\n    }\r\n    // Добавляем оставшиеся в половинках элементы\r\n    while (left <= mid)\r\n        temp[index++] = array[left++];\r\n    while (right <= end)\r\n        temp[index++] = array[right++];\r\n    // заменяем исходный участок в массиве на отсортированный\r\n    Array.Copy(temp, 0, array, start, temp.Length);\r\n}\r\n\r\n/// <summary>\r\n/// Рекурсивное дробление массива с последующим слиянием\r\n/// всех частей в отсортированном порядке.\r\n/// </summary>\r\nprivate static void RecursiveMerge<T>(T[] array, int start, int end)\r\nwhere T : IComparable<T> {\r\n    if (start < end) {\r\n        int mid = (start + end) / 2;\r\n        RecursiveMerge(array, start, mid);\r\n        RecursiveMerge(array, mid + 1, end);\r\n        Merge(array, start, mid, end);\r\n    }\r\n}\r\n\r\n/// <summary>\r\n/// Реализация алгоритма сортировки слиянием.\r\n/// </summary>\r\npublic static void MergeSort<T>(T[] array)\r\nwhere T : IComparable<T> {\r\n    RecursiveMerge(array, 0, array.Length - 1);\r\n}\r\n[/CSHARP]','fe11665d68e0b9897fa65fd7ab7c26254973ba4a',1,'2015-02-25 13:49:31','2015-02-25 13:49:31',1,6,NULL),(146,'BadMergeSort, full','[CSHARP]using System;\r\nusing System.Collections.Generic;\r\n\r\nnamespace Algorithms\r\n{\r\n    partial class Program\r\n    {\r\n        /// <summary>\r\n        /// Рекурсивное дробление массива с последующим слиянием\r\n        /// всех частей в отсортированном порядке.\r\n        /// </summary>\r\n        private static void RecursiveMerge<T>(T[] array, int start, int end)\r\n        where T : IComparable<T> {\r\n            if (start < end) {\r\n                int mid = (start + end) / 2;\r\n                RecursiveMerge(array, start, mid);\r\n                RecursiveMerge(array, mid + 1, end);\r\n                Merge(array, start, mid, end);\r\n            }\r\n        }\r\n\r\n        /// <summary>\r\n        /// Реализация алгоритма сортировки слиянием.\r\n        /// </summary>\r\n        public static void MergeSort<T>(T[] array)\r\n        where T : IComparable<T> {\r\n            RecursiveMerge(array, 0, array.Length - 1);\r\n        }\r\n\r\n        /// <summary>\r\n        /// Этот метод даёт неверные результаты по неизвестным мне причинам.\r\n        /// </summary>\r\n        private static void Merge<T>(T[] array, int start, int mid, int end)\r\n        where T : IComparable<T> {\r\n            // разделение массива на два\r\n            T[] left = new T[mid - start];\r\n            Array.Copy(array, start, left, 0, left.Length);\r\n            T[] right = new T[end - mid];\r\n            Array.Copy(array, mid, right, 0, right.Length);\r\n\r\n            for (int index = start, i = 0, j = 0; index < end; index++) {\r\n                // перенос оставшихся элементов\r\n                if (i == left.Length) {\r\n                    array[index] = right[j++];\r\n                    continue;\r\n                }\r\n                if (j == right.Length) {\r\n                    array[index] = left[i++];\r\n                    continue;\r\n                }\r\n                // выбираем меньший из элементов \"массивов-частей\"\r\n                array[index] = (left[i].CompareTo(right[j]) != 1)\r\n                    ? left[i++] : right[j++];\r\n            }\r\n        }\r\n    }\r\n}\r\n\r\n// Test client\r\npublic static void Dump<T>(IEnumerable<T> coll) {\r\n    foreach (T element in coll)\r\n        Console.Write(element.ToString() + \" \");\r\n    Console.WriteLine();\r\n}\r\n\r\n// ...\r\nint[] array = { 80, 26, 13, 24, 11, 10, 54, 41, 91, 41, 40 };\r\nMergeSort(array);\r\nDump(array);[/CSHARP]','9880f77952404aacf9f3e915b758140dc218dad8',1,'2015-02-25 14:17:05','2015-02-25 14:18:18',1,6,''),(147,'Коддд','[CSHARP]//Метод дешифрования-файла ключа\r\n        static bool Decrypt(string path) {\r\n            //Формирование ключа дешифровки с подгонкой под размер\r\n            List<byte> providerKey = new List<byte>(Encoding.Default.GetBytes(FullMachineInfo));\r\n            if (providerKey.Count < 0x20) {\r\n                providerKey.AddRange(new byte[0x20 - providerKey.Count]);\r\n            }\r\n            else {\r\n                providerKey.RemoveRange(0x20, providerKey.Count - 0x20);\r\n            }\r\n            //Формирование вектора инициализации дешифровки\r\n            byte[] providerIV = Enumerable.Range(0, 0x10).Select(i => (byte)i).ToArray();\r\n\r\n            //Текущая исполняемая сборка\r\n            Assembly asm = Assembly.GetExecutingAssembly();\r\n\r\n            //Тело точки входа\r\n            MethodBody mainMethodBody = asm.EntryPoint.GetMethodBody();\r\n\r\n            //CIL код оригинальной точки входа как массива байт\r\n            byte[] entryPointOriginal = mainMethodBody.GetILAsByteArray();\r\n\r\n            //Массив байт файла-ключа(зашифрованная точка входа)\r\n            byte[] entryPointEncrypted = File.ReadAllBytes(path);\r\n\r\n            //Объект-шифровальщик\r\n            using (Aes provider = Aes.Create()) {\r\n                //Ключ и вектор инициализации шифровальщика\r\n                provider.IV = providerIV;\r\n                provider.Key = providerKey.ToArray();\r\n\r\n                //Дешифратор\r\n                using (ICryptoTransform decryptor = provider.CreateDecryptor()) {\r\n                    //Блок обработки ошибок\r\n                    try {\r\n                        //Массив расшифрованной точки входа из файла ключа\r\n                        byte[] entryPointDecrypted =\r\n                            decryptor.TransformFinalBlock(entryPointEncrypted, 0, entryPointEncrypted.Length);\r\n                        //Сравнение по размеру\r\n                        if (entryPointOriginal.Length != entryPointDecrypted.Length) {\r\n                            return false;\r\n                        }\r\n\r\n                        //Сравнение по значениям\r\n                        for (int i = 0; i < entryPointDecrypted.Length; i++) {\r\n                            if (entryPointDecrypted[i] != entryPointOriginal[i]) {\r\n                                return false;\r\n                            }\r\n                        }\r\n                    }\r\n                    catch {\r\n                        //Возврат false при ошибке расшифровки\r\n                        return false;\r\n                    } \r\n                }\r\n            }\r\n            return true;\r\n        }[/CSHARP]','cab0faa513e6d937e0d52646c9487be11d40827a',1,'2015-02-26 08:11:55','2015-02-26 08:11:55',1,NULL,NULL),(148,'Парсер реквестов','[JAVA]package com.javarush.test.level15.lesson12.home09;\r\n\r\n/* Парсер реквестов\r\nСчитать с консоли URl ссылку.\r\nВывести на экран через пробел список всех параметров (Параметры идут после ? и разделяются &, например, lvl=15).\r\nURL содержит минимум 1 параметр.\r\nЕсли присутствует параметр obj, то передать его значение в нужный метод alert.\r\nalert(double value) - для чисел (дробные числа разделяются точкой)\r\nalert(String value) - для строк\r\n\r\nПример 1\r\nВвод:\r\nhttp://javarush.ru/alpha/index.html?lvl=15&view&name=Amigo\r\nВывод:\r\nlvl view name\r\n\r\nПример 2\r\nВвод:\r\nhttp://javarush.ru/alpha/index.html?obj=3.14&name=Amigo\r\nВывод:\r\nobj name\r\ndouble 3.14\r\n*/\r\n\r\nimport java.io.BufferedReader;\r\nimport java.io.IOException;\r\nimport java.io.InputStreamReader;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException\r\n    {\r\n        //Напишите код здесь\r\n        //BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));\r\n        //String url = reader.readLine();\r\n        //String[] s1  = url.split(\"\\\\?\");\r\n        \r\n    }\r\n\r\n    public static void alert(double value) {\r\n        System.out.println(\"double \" + value);\r\n    }\r\n\r\n    public static void alert(String value) {\r\n        System.out.println(\"String \" + value);\r\n    }\r\n}[/JAVA]','c3dd5ce4a8248895832ef05ff3a521f42e0ff31b',1,'2015-02-26 10:02:57','2015-02-26 10:02:57',1,4,NULL),(149,'Url parse','[JAVA]import java.util.Scanner;\r\nimport java.util.HashMap;\r\n\r\npublic class Test\r\n{\r\n    public static void main(String[] args)\r\n    {\r\n        HashMap<String, String> values = new HashMap<String, String>();\r\n        Scanner in = new Scanner(System.in);\r\n\r\n        String url = in.nextLine();\r\n\r\n        System.out.println();\r\n\r\n        for(int i = url.indexOf(\'?\') + 1, cnt = url.length(); i < cnt; ++i)\r\n        {\r\n            int name_start = url.indexOf(\'=\', i); //search \'=\'\r\n            if(-1 == name_start) //break if not found \'=\'\r\n                break;\r\n\r\n            int currentIndex = i;\r\n\r\n            i = url.indexOf(\'&\', i); //search next pair\r\n            if(i != -1 && name_start > i)\r\n                values.put(url.substring(currentIndex, i), \"\");\r\n            else\r\n            {\r\n                //if not found next, take all for the end of string\r\n                int name_end = -1 == i ? cnt : i;\r\n\r\n                values.put(url.substring(currentIndex, name_start), url.substring(name_start + 1, name_end));\r\n            }\r\n\r\n            if(-1 == i) //end of string\r\n                break;\r\n        }\r\n\r\n        printValues(values);\r\n    }\r\n\r\n    public static void printValues(HashMap<String, String> values)\r\n    {\r\n        for (HashMap.Entry pair: values.entrySet())\r\n        {\r\n            String key = pair.getKey().toString(); \r\n\r\n            alert(key); //output key\r\n\r\n            if(key.equals(\"obj\"))\r\n            {\r\n                String value = pair.getValue().toString();\r\n                \r\n                //output value (double or string)\r\n                if(isDouble(value))\r\n                  alert(Double.valueOf(value));\r\n                else\r\n                    alert(value);\r\n            }\r\n\r\n            System.out.println();\r\n        }\r\n    }\r\n\r\n    public static void alert(double value)\r\n    {\r\n        System.out.print(value + \" \");\r\n    }\r\n\r\n    public static void alert(String value)\r\n    {\r\n        System.out.print(value + \" \");\r\n    }\r\n\r\n    public static boolean isDouble(String str)\r\n    {\r\n        try {\r\n            Double.parseDouble(str);\r\n            return true;\r\n        } catch (NumberFormatException e) {\r\n            return false;\r\n        }\r\n    }\r\n}[/JAVA]','8cb5e68d3ae981b27fab682e1df8ebe3d93f12a0',1,'2015-02-26 11:12:46','2015-02-26 11:32:55',1,1,''),(150,'parseRequest (java.tezaurismosis)','[JAVA]package javaconsoleapplication;\r\n\r\nimport java.util.HashMap;\r\n\r\npublic class JavaConsoleApplication {\r\n    public static HashMap<String, String> parseRequest(String request) {\r\n        HashMap<String, String> result = new HashMap<>();\r\n        // отделяем часть после знака \"?\"\r\n        String params = request.substring(\r\n           request.indexOf(\"?\") + 1, request.length());\r\n        // разделяем параметры\r\n        String[] elems = params.split(\"&\");\r\n        for (String elem : elems) {\r\n            String[] parsed = elem.split(\"=\");\r\n            // параметры без значений\r\n            if (parsed.length == 1)\r\n                result.put(elem, null);\r\n            else\r\n                result.put(parsed[0], parsed[1]);\r\n        }\r\n        \r\n        return result;\r\n    }\r\n    \r\n    public static void main(String[] args) {\r\n        HashMap<String, String> r = parseRequest(\r\n                \"http://javarush.ru/alpha/index.html?obj=3.14&view&name=Amigo\");\r\n        for (String key : r.keySet()) {\r\n            System.out.printf(\"%s : %s\\n\", key, r.get(key));\r\n        }\r\n    }\r\n}\r\n[/JAVA]','186d86c6cdb945fefb2f2ae8b2590e7b279b450b',1,'2015-02-26 11:31:50','2015-02-26 11:31:50',1,6,NULL),(151,'parseRequest (Regex)','[JAVA]import java.util.regex.Pattern;\r\nimport java.util.regex.Matcher;\r\n\r\npublic class Test\r\n{\r\n    public static void main(String[] args)\r\n    {\r\n        Pattern p = Pattern.compile(\"(?<=[?&])(?<name>.*?(?=[=&]|$))(?:=(?<value>.*?(?=&|$)))?\");\r\n        String str = \"http://javarush.ru/alpha/index.html?obj=3.14&view&name=Amigo\";\r\n        Matcher m = p.matcher(str);\r\n\r\n        while(m.find())\r\n            System.out.println(m.group(\"name\") + \": \" + m.group(\"value\"));\r\n    }\r\n}[/JAVA]\r\n\r\n[JAVA]import java.util.regex.Pattern;\r\nimport java.util.regex.Matcher;\r\nimport java.util.Scanner;\r\n\r\npublic class Test\r\n{\r\n    public static void main(String[] args)\r\n    {\r\n        Pattern p = Pattern.compile(\"(?<=[?&])(?<name>.*?(?=[=&]|$))(?:=(?<value>.*?(?=&|$)))?\");\r\n        Matcher m;\r\n        Scanner in = new Scanner(System.in);\r\n\r\n        String url = in.nextLine();\r\n\r\n        m = p.matcher(url);\r\n\r\n        System.out.println();\r\n\r\n        while(m.find())\r\n        {\r\n            String key = m.group(\"name\");\r\n\r\n            alert(key);\r\n\r\n            if(key.equals(\"obj\"))\r\n            {\r\n                String value = m.group(\"value\");\r\n\r\n                if(isDouble(value))\r\n                  alert(Double.valueOf(value));\r\n                else\r\n                    alert(value);\r\n            }\r\n            System.out.println();\r\n        }\r\n    }\r\n\r\n    public static void alert(double value)\r\n    {\r\n        System.out.print(value + \" \");\r\n    }\r\n\r\n    public static void alert(String value)\r\n    {\r\n        System.out.print(value + \" \");\r\n    }\r\n\r\n    public static boolean isDouble(String str)\r\n    {\r\n        try {\r\n            Double.parseDouble(str);\r\n            return true;\r\n        } catch (NumberFormatException e) {\r\n            return false;\r\n        }\r\n    }\r\n}[/JAVA]','0cc1498f02c8fa11e2aba287f54a3296061cb969',1,'2015-02-26 11:51:01','2015-02-26 11:59:33',1,1,''),(152,'Игра (threads)','[JAVA]package com.javarush.test.level16.lesson13.home07;\r\n\r\nimport java.util.ArrayList;\r\nimport java.util.List;\r\n\r\n/* Поиграем?\r\nТри человека играют в игру. Каждый игрок(Gamer) характеризуется двумя параметрами: фамилией(name) и количеством действий в секунду (rating).\r\nНужно вывести в консоль ход игры и определить победителя и проигравших.\r\nИтак...\r\n1. Разберись, что делает программа.\r\n1.1. List<String> steps хранит последовательность действий, которое каждый игрок выполняет от 0 до последнего.\r\n1.2. isWinnerFound показывает, найден победитель или нет.\r\n1.3. метод sleep выбрасывает InterruptedException и принимает параметр типа long.\r\n1.4. Игорки играют независимо друг от друга.\r\n\r\n2. Реализуйте логику метода run так, чтобы для каждого игрока:\r\n2.1. за 1 секунду через равные интервалы времени выводилось в консоль rating описанных в steps действий.\r\n2.2. Любой текст должен начинаться с фамилии игрока (метод getName()), потом следовать двоеточие, а затем сам текст. Пример: [Ivanov:Начало игры].\r\n2.3. Когда игрок выполнит все действия из steps, то он считается победителем. Выведите [getName() + \":победитель!\"].\r\n2.4. Когда найден победитель, то игра останавливается, и остальные игроки считаются побежденными. Выведите для них [getName() + \":проиграл\"].\r\n*/\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws InterruptedException {\r\n        OnlineGame onlineGame = new OnlineGame();\r\n        onlineGame.start();\r\n    }\r\n\r\n    public static class OnlineGame extends Thread {\r\n        public static volatile boolean isWinnerFound = false;\r\n\r\n        public static List<String> steps = new ArrayList<String>();\r\n\r\n        static {\r\n            steps.add(\"Начало игры\");\r\n            steps.add(\"Сбор ресурсов\");\r\n            steps.add(\"Рост экономики\");\r\n            steps.add(\"Убийство врагов\");\r\n        }\r\n\r\n        protected Gamer gamer1 = new Gamer(\"Ivanov\", 3);\r\n        protected Gamer gamer2 = new Gamer(\"Petrov\", 7);\r\n        protected Gamer gamer3 = new Gamer(\"Sidorov\", 5);\r\n        \r\n        public void run() {\r\n            gamer1.start();\r\n            gamer2.start();\r\n            gamer3.start();\r\n\r\n            while (!isWinnerFound) {\r\n            }\r\n            gamer1.interrupt();\r\n            gamer2.interrupt();\r\n            gamer3.interrupt();\r\n        }\r\n    }\r\n\r\n    public static class Gamer extends Thread {\r\n        private int rating;\r\n\r\n        public Gamer(String name, int rating) {\r\n            super(name);\r\n            this.rating = rating;\r\n        }\r\n\r\n        @Override\r\n        public void run() {\r\n            //Add your code here - добавь код тут\r\n            for (String string : OnlineGame.steps) {\r\n                try\r\n                {\r\n                    System.out.println(getName() + \":\" + string);\r\n                    sleep(1000/rating);\r\n                }\r\n                catch (InterruptedException e)\r\n                {\r\n                    System.out.println(getName() + \":проиграл\");\r\n                    return;\r\n                }\r\n            }\r\n            OnlineGame.isWinnerFound = true;\r\n            System.out.println(getName() + \":победитель!\");\r\n        }\r\n    }\r\n}[/JAVA]','8a8fdb48bac2419d72036bf60f5e364024f69c0e',1,'2015-03-04 06:30:07','2015-03-04 07:22:32',1,4,''),(153,'Чтение 2 файлов в 2 потока','[JAVA]package com.javarush.test.level16.lesson13.home10;\r\n\r\nimport java.io.*;\r\n\r\n/* Последовательный вывод файлов\r\n1. Разберись, что делает программа.\r\n2. В статическом блоке считай 2 имени файла firstFileName и secondFileName.\r\n3. Внутри класса Solution создай нить public static ReadFileThread, которая реализует\r\nинтерфейс ReadFileInterface (Подумай, что больше подходит - Thread или Runnable).\r\n3.1. Метод setFileName должен устанавливать имя файла, из которого будет читаться содержимое.\r\n3.2. Метод getFileContent должен возвращать содержимое файла.\r\n3.3. В методе run считай содержимое файла, закрой поток. Раздели пробелом строки файла.\r\n4. Подумай, в каком месте нужно подождать окончания работы нити, чтобы обеспечить последовательный вывод файлов.\r\n4.1. Для этого добавь вызов соответствующего метода.\r\nОжидаемый вывод:\r\n[все тело первого файла]\r\n[все тело второго файла]\r\n*/\r\n\r\npublic class Solution {\r\n    public static String firstFileName;\r\n    public static String secondFileName;\r\n\r\n    static {\r\n        try\r\n        {\r\n            BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));\r\n            firstFileName = reader.readLine();\r\n            secondFileName = reader.readLine();\r\n        }\r\n        catch (IOException e) {\r\n            System.out.println(\"Ошибка ввода!\");\r\n        }\r\n    }\r\n\r\n    public static void main(String[] args) throws InterruptedException {\r\n        systemOutPrintln(firstFileName);\r\n        systemOutPrintln(secondFileName);\r\n    }\r\n\r\n    public static void systemOutPrintln(String fileName) throws InterruptedException {\r\n        ReadFileInterface f = new ReadFileThread();\r\n        f.setFileName(fileName);\r\n        f.start();\r\n        System.out.println(f.getFileContent());\r\n    }\r\n\r\n    public static class ReadFileThread extends Thread implements ReadFileInterface {\r\n\r\n        private String fn;\r\n        private String s;\r\n        private String res = \"\";\r\n\r\n        @Override\r\n        public void setFileName(String fullFileName)\r\n        {\r\n            fn = fullFileName;\r\n        }\r\n\r\n        @Override\r\n        public String getFileContent()\r\n        {\r\n            try\r\n            {\r\n                this.join();\r\n            }\r\n            catch (InterruptedException e)\r\n            {\r\n                e.printStackTrace();\r\n            }\r\n            return res;\r\n        }\r\n\r\n        @Override\r\n        public void run()\r\n        {\r\n            try\r\n            {\r\n                BufferedReader fr = new BufferedReader(new FileReader(fn));\r\n                while (!(s = fr.readLine()).equals(\"\")) {\r\n                    res = res + s + \" \";\r\n                }\r\n                fr.close();\r\n\r\n            }\r\n            catch (FileNotFoundException e)\r\n            {\r\n                System.out.println(\"Файл не найден!\");\r\n            }\r\n            catch (IOException e) {\r\n                System.out.println(\"Ошибка чтения!\");\r\n            }\r\n            catch (NullPointerException e) {\r\n\r\n            }\r\n        }\r\n    }\r\n\r\n    public static interface ReadFileInterface {\r\n\r\n        void setFileName(String fullFileName);\r\n\r\n        String getFileContent();\r\n\r\n        void join() throws InterruptedException;\r\n\r\n        void start();\r\n    }\r\n}[/JAVA]','7519916d62a57640afae92963ca85b4fbd638ea1',1,'2015-03-04 07:19:41','2015-03-04 13:09:45',1,4,''),(154,'Все работало, тест не проходило 2 дня','[JAVA]package com.javarush.test.level16.lesson13.bonus02;\r\n\r\nimport java.io.BufferedReader;\r\nimport java.io.IOException;\r\nimport java.io.InputStreamReader;\r\nimport java.util.ArrayList;\r\nimport java.util.List;\r\n\r\n/* Клубок\r\n1. Создай 5 различных своих нитей c отличным от Thread типом:\r\n1.1. нить 1 должна бесконечно выполняться;\r\n1.2. нить 2 должна выводить \"InterruptedException\" при возникновении исключения InterruptedException;\r\n1.3. нить 3 должна каждые полсекунды выводить \"Ура\";\r\n1.4. нить 4 должна реализовать интерфейс Message, при вызове метода showWarning нить должна останавливаться;\r\n1.5. нить 5 должна читать с консоли цифры пока не введено слово \"N\", а потом вывести в консоль сумму введенных цифр.\r\n2. В статическом блоке добавь свои нити в List<Thread> threads в перечисленном порядке.\r\n3. Нити не должны стартовать автоматически.\r\n*/\r\n\r\npublic class Solution {\r\n    public static List<Thread> threads = new ArrayList<Thread>(5);\r\n\r\n    static {\r\n        threads.add(new T1());\r\n        threads.add(new T2());\r\n        threads.add(new T3());\r\n        threads.add(new T4());\r\n        threads.add(new T5());\r\n    }\r\n\r\n    //нить 1 должна бесконечно выполняться\r\n    public static class T1 extends Thread {\r\n        int a = 6;\r\n        @Override\r\n        public void run()\r\n        {\r\n            while (true) {\r\n                if (a % 2 == 0) a++; else a--;\r\n                System.out.println(a);\r\n            }\r\n        }\r\n    }\r\n\r\n    //нить 2 должна выводить \"InterruptedException\" при возникновении исключения InterruptedException\r\n    public static class T2 extends Thread {\r\n        @Override\r\n        public void run()\r\n        {\r\n            try {\r\n                while (!isInterrupted()){}\r\n                throw new InterruptedException(\"InterruptedException\");\r\n            } catch (InterruptedException e){\r\n                System.out.println(\"InterruptedException\");\r\n            }\r\n        }\r\n    }\r\n\r\n    //нить 3 должна каждые полсекунды выводить \"Ура\"\r\n    public static class T3 extends Thread {\r\n        @Override\r\n        public void run()\r\n        {\r\n            while (!isInterrupted()) {\r\n                try\r\n                {\r\n                    System.out.println(\"Ура\");\r\n                    sleep(500);\r\n                }\r\n                catch (InterruptedException e) {}\r\n            }\r\n        }\r\n    }\r\n\r\n    //нить 4 должна реализовать интерфейс Message, при вызове метода showWarning нить должна останавливаться\r\n    public static class T4 extends Thread implements Message{\r\n        public static boolean isFinished = false;\r\n\r\n        @Override\r\n        public void run()\r\n        {\r\n            while (!isInterrupted()) {\r\n\r\n            }\r\n            //System.out.println(\"выход\");\r\n        }\r\n\r\n        @Override\r\n        public void showWarning()\r\n        {\r\n            // System.out.println(\"Запуск ворнинга\");\r\n            try\r\n            {\r\n                interrupt();\r\n                join();\r\n                //System.out.println(\"После джойна\");\r\n            }\r\n            catch (Exception e) {}\r\n        }\r\n    }\r\n\r\n    //нить 5 должна читать с консоли цифры пока не введено слово \"N\", а потом вывести в консоль сумму введенных цифр\r\n    public static class T5 extends Thread {\r\n        @Override\r\n        /*public void run() {\r\n            BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));\r\n            ArrayList<Integer> list = new ArrayList<Integer>();\r\n\r\n            try {\r\n                String s;\r\n                while (true) {\r\n                    try {\r\n                        s = reader.readLine();\r\n                        if (\"N\".equals(s)) {\r\n                            break;\r\n                        }\r\n                        list.add(Integer.parseInt(s));\r\n                    } catch (NumberFormatException e) {\r\n                    }\r\n                }\r\n\r\n                Integer sum = 0;\r\n                for (Integer val: list) {\r\n                    sum += val;\r\n                }\r\n                System.out.println(sum);\r\n            } catch (IOException e) {\r\n            }\r\n        }*/\r\n        public void run()\r\n        {\r\n            BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));\r\n            String string;\r\n            int s = 0;\r\n            try\r\n            {\r\n                while (!(string = reader.readLine()).equals(\"N\"))\r\n                {\r\n                    try\r\n                    {\r\n                        s += Integer.parseInt(string);\r\n                    }\r\n                    catch (NumberFormatException e)\r\n                    {\r\n                        continue;\r\n                    }\r\n                }\r\n                System.out.println(s);\r\n                reader.close();\r\n            }\r\n            catch (IOException e) {\r\n\r\n            }\r\n        }\r\n\r\n    }\r\n\r\n    public static interface Message {\r\n        void showWarning();\r\n    }\r\n}[/JAVA]','d088c79e801b02cf3edf4eca32fcf11155c43df8',1,'2015-03-04 13:14:03','2015-03-04 13:15:05',1,4,''),(155,'Подсчет FFh в прошивке','[JAVA]public class Hex\r\n\r\n{\r\n    public static void main(String[] args) throws IOException\r\n    {\r\n        long count = 0;\r\n        FileInputStream fileInputStream = new FileInputStream(\"i:\\\\bios\\\\new\\\\ddd.rom\");\r\n        while (fileInputStream.available() > 0) {\r\n            int data = fileInputStream.read();\r\n            if (data == 0xFF)\r\n            ++count;\r\n        }\r\n        fileInputStream.close();\r\n        System.out.println(2097152 - count);\r\n    }\r\n}[/JAVA]','da0ca092310e22a5daa9b23fcef4e1c9d8a2cc11',1,'2015-03-06 05:28:34','2015-03-06 05:28:34',1,4,NULL),(156,'Интерфейс Comparable','[JAVA]package com.javarush.test.level17.lesson10.home02;\r\n\r\n/* Comparable\r\nРеализуйте интерфейс Comparable<Beach> в классе Beach, который будет использоваться нитями.\r\n*/\r\n\r\nimport java.io.FileInputStream;\r\n\r\npublic class Beach implements Comparable<Beach>{\r\n\r\n    private String name;      //название\r\n    private float distance;   //расстояние\r\n    private int quality;    //качество\r\n\r\n    public Beach(String name, float distance, int quality) {\r\n        this.name = name;\r\n        this.distance = distance;\r\n        this.quality = quality;\r\n    }\r\n\r\n    public String getName() {\r\n        return name;\r\n    }\r\n\r\n    public synchronized void setName(String name) {\r\n        this.name = name;\r\n    }\r\n\r\n    public float getDistance() {\r\n        return distance;\r\n    }\r\n\r\n    public synchronized void setDistance(float distance) {\r\n        this.distance = distance;\r\n    }\r\n\r\n    public int getQuality() {\r\n        return quality;\r\n    }\r\n\r\n    public synchronized void setQuality(int quality) {\r\n        this.quality = quality;\r\n    }\r\n\r\n    @Override\r\n    public int compareTo(Beach beach)\r\n    {\r\n        Float A =  (getQuality() / getDistance());\r\n        Float B =  (beach.getQuality() / beach.getDistance());\r\n        return A.compareTo(B);\r\n    }\r\n}[/JAVA]','cb95776406d303b2641a38d0b87b5f7ece1831fa',1,'2015-03-07 10:26:15','2015-03-07 10:48:05',1,4,''),(157,'Smart Pointers','[C_CPP]class Temp\r\n{\r\n	int TEMP;    \r\npublic:\r\n	Temp(){TEMP=25;}\r\n	void TempFunction(){cout<<\"TEMP = \"<<TEMP<<\"\\n\";} \r\n	void TempSet(int T){TEMP=T;}\r\n};\r\n\r\n\r\nclass SmartPointer\r\n{\r\n	Temp *ptr;\r\n	int copy;\r\npublic:\r\n	SmartPointer(Temp *p)\r\n	{\r\n		ptr=p;\r\n		copy=0;\r\n	}\r\n\r\n	SmartPointer(const SmartPointer &obj)\r\n	{\r\n		ptr=obj.ptr;\r\n		copy=1;\r\n	}\r\n\r\n	SmartPointer operator=(const SmartPointer &obj)\r\n	{\r\n		ptr=obj.ptr;\r\n		copy=1;\r\n	}\r\n\r\n	~SmartPointer()\r\n	{\r\n		if (copy==0 && ptr!=NULL) \r\n		{\r\n			delete ptr;\r\n		}\r\n	}\r\n\r\n	Temp* operator ->()\r\n	{\r\n		return ptr;\r\n	}\r\n\r\n	Temp& operator*()\r\n	{\r\n		return *ptr;\r\n	}\r\n\r\n    \r\n};[/C_CPP]','a309b421fd36e7b0ca97baa22c51e0eee2653fc9',1,'2015-03-07 10:49:55','2015-09-10 12:27:37',1,NULL,''),(158,'Synchronized где надо!','[JAVA]package com.javarush.test.level17.lesson10.home04;\r\n\r\n/* Синхронизированные методы\r\nУстановить модификатор synchronized только тем методам, которым необходимо\r\n*/\r\n\r\npublic class Solution {\r\n    private double param = Math.random();\r\n\r\n    private void method0() {\r\n        double i = method3();\r\n    }\r\n\r\n    protected synchronized void method1(String param1) {\r\n        Solution solution = new Solution();\r\n        solution.method0();\r\n    }\r\n\r\n    public void method2(int param1) {\r\n        param1++;\r\n    }\r\n\r\n    synchronized double method3() {\r\n        double random = Math.random();\r\n        return random + param;\r\n    }\r\n\r\n    private synchronized void method4() {\r\n        new StringBuilder().append(1).append(1).append(1).append(1);\r\n    }\r\n\r\n    protected void method5(String param2) {\r\n        new StringBuffer().append(param2).append(param2).append(param2);\r\n    }\r\n\r\n    public synchronized String method6(int param2) {\r\n        System.out.println(\"Thinking....\");\r\n        method7(5e-2);\r\n        return \"Got it!\";\r\n    }\r\n\r\n    String method7(double param2) {\r\n        return \"\" + param2;\r\n    }\r\n\r\n}[/JAVA]','6df85c7bd4f3c9c528800b962295871637c14dff',1,'2015-03-07 11:58:52','2015-03-07 11:58:52',1,4,NULL),(159,'CRuD','[JAVA]package com.javarush.test.level17.lesson10.bonus01;\r\n\r\nimport java.util.ArrayList;\r\nimport java.util.Date;\r\nimport java.util.List;\r\n\r\n/* CRUD\r\nCrUD - Create, Update, Delete\r\nCRUD! - Create, Read, Update, Delete!\r\nПрограмма запускается с одним из следующих наборов параметров:\r\n-c name sex bd\r\n-u id name sex bd\r\n-d id\r\n-i id\r\nЗначения параметров:\r\nname - имя, String\r\nsex - пол, \"м\" или \"ж\", одна буква\r\nbd - дата рождения в следующем формате 15/04/1990\r\n-с  - добавляет человека с заданными параметрами в конец allPeople, выводит id (index) на экран\r\n-u  - обновляет данные человека с данным id\r\n-d  - производит логическое удаление человека с id\r\n-i  - выводит на экран информацию о человеке с id: name sex (м/ж) bd (формат 15-Apr-1990)\r\n\r\nid соответствует индексу в списке\r\nВсе люди должны храниться в allPeople\r\nИспользуйте Locale.ENGLISH в качестве второго параметра для SimpleDateFormat\r\n\r\nПример параметров: -c Миронов м 15/04/1990\r\n*/\r\n\r\npublic class Solution {\r\n    public static List<Person> allPeople = new ArrayList<Person>();\r\n    static {\r\n        allPeople.add(Person.createMale(\"Иванов Иван\", new Date()));  //сегодня родился    id=0\r\n        allPeople.add(Person.createMale(\"Петров Петр\", new Date()));  //сегодня родился    id=1\r\n    }\r\n\r\n    public static void main(String[] args) {\r\n        //start here - начни тут\r\n    }\r\n}[/JAVA]','23e49712c85adcc2876997efe97dd5c32d131c51',1,'2015-03-11 13:57:52','2015-03-12 08:28:44',1,NULL,''),(160,'Verilog HDL','[PASCAL]// Copyright: (c) ildwine, 2005\r\n\r\n// Модель цифрового устройства, выполняющего следующие действия:\r\n// 1. Поиск в потоке входных данных \"запятой\", то есть признака\r\n//    начала информативного сигнала;\r\n// 2. Вывод информации, следующей за \"запятой\" побитно в 8-и разрядах.\r\n// Устройство выполняет указанные действия при поступлении импульса\r\n// тактовой частоты на вход Clock.\r\n\r\nmodule asla(out, clk, in);\r\n	\r\n	//Входные порты\r\n	input in;	                        // Входной порт последовательных дпнных \r\n	input clk;							// Входной порт импульсов тактовой частоты\r\n	\r\n	//Выходные порты\r\n	output [7:0] out;					// Выходной 8-разрядный порт параллельных данных\r\n	\r\n	//Внутренние пременные\r\n	wire in;							// Входной порт является проводом\r\n	reg [7:0] out;				  		// Выходной порт является 8-разрядным регистром\r\n	reg [3:0] buffer;					// 4-разрядный сдвиговый регистр для\r\n										// сохранения в нем 4 битов с целью проверки\r\n										// их на совпадение с \"запятой\"\r\n	reg [3:0] comma;					// 4-разрядный регистр, в котором сохранена \"запятая\"\r\n	reg [3:0] work;						// Рабочий регистр\r\n	reg flag1;							// Регистр флага завершения поиска \"запятой\"	\r\n	reg [2:0] count;					// Счетчик\r\n	reg [7:0] prep_out;                 // Подготовительный выходной сдвиговый регистр\r\n	reg [7:0] work_out;	     			// Подготовительный рабочий регистр\r\n	\r\n	//Задание начального состояния устройства\r\n	initial	begin\r\n		out = 2\'b00000000;              // В начальном состоянии на выходе устройства - нули\r\n		comma = 4\'b1111; 				// Интерпретация \"запятой\"\r\n		buffer = 4\'b0000;               // В начальном состоянии в буфере - нули\r\n		work = 4\'b0000; 				// В начальном состоянии в рабочем регистре - нули     \r\n		flag1 = \'b0;                    // Флаг сброшен: запятая не найдена \r\n		count = 3\'b000;					// Счетчик обнулен\r\n		prep_out = 8\'b00000000;			// В начальном состоянии в регистре prep_out - нули\r\n		work_out = 8\'b00000000;			// В начальном состоянии в регистре work_out - нули\r\n	end\r\n	\r\n	//Начало кода\r\n	\r\n	always @ (posedge clk)				// Работать по положительному фронту Clock\r\n	begin\r\n		 // Поиск запятой\r\n		 if (flag1 != \'b1)	            // Если \"запятая\" не найдена\r\n	     begin\r\n			  work[0] = in;				// В нулевой бит рабочего регистра помещаем 1 бит \r\n			 							// входных данных\r\n		      buffer = buffer << 1;		// Сдвигаем buffer влево на 1 бит\r\n		      buffer = buffer | work;	// buffer = buffer ИЛИ work\r\n		      if (buffer == comma)		// Если содержимое buffer равно \"запятой\"\r\n			  flag1 = \'b1;				// Устанавливаем флаг\r\n		 end\r\n		 \r\n		 // Вывод параллельно\r\n		 if (flag1 == \'b1)				// Если флаг уже установлен\r\n		 begin\r\n			  work_out[0] = in;			// Бит входных данных помещаем в work_out\r\n			  prep_out = prep_out << 1;	// Сдвигаем prep_out влево на 1 бит \r\n			  prep_out = prep_out | work_out; \r\n			  count = count + 1;		// Наращиваем счетчик\r\n			  if (count == 3\'b111)		// Если счетчик равен 8, то есть \r\n				                        // 8 бит помещено в регистр prep_out\r\n			  begin\r\n				  out = prep_out;		// выводим содержимое prep_out в выходной порт\r\n				  count = 3\'b000;		// сбрасываем счетчик\r\n			  end\r\n		 end\r\n	end\r\n		\r\nendmodule[/PASCAL]','b831dcee6d019c313060bd771348424ffa665409',1,'2015-03-12 13:26:10','2015-03-12 13:26:10',1,4,NULL),(161,'Java воспроизведение WAV-файла','[JAVA]import java.io.File; \r\nimport java.io.IOException; \r\nimport javax.sound.sampled.AudioFormat; \r\nimport javax.sound.sampled.AudioInputStream; \r\nimport javax.sound.sampled.AudioSystem; \r\nimport javax.sound.sampled.DataLine; \r\nimport javax.sound.sampled.FloatControl; \r\nimport javax.sound.sampled.LineUnavailableException; \r\nimport javax.sound.sampled.SourceDataLine; \r\nimport javax.sound.sampled.UnsupportedAudioFileException; \r\n \r\npublic class AePlayWave extends Thread { \r\n \r\n    private String filename;\r\n \r\n    private Position curPosition;\r\n \r\n    private final int EXTERNAL_BUFFER_SIZE = 524288; // 128Kb \r\n \r\n    enum Position { \r\n        LEFT, RIGHT, NORMAL\r\n    };\r\n \r\n    public AePlayWave(String wavfile) { \r\n        filename = wavfile;\r\n        curPosition = Position.NORMAL;\r\n    } \r\n \r\n    public AePlayWave(String wavfile, Position p) { \r\n        filename = wavfile;\r\n        curPosition = p;\r\n    } \r\n \r\n    public void run() { \r\n \r\n        File soundFile = new File(filename);\r\n        if (!soundFile.exists()) { \r\n            System.err.println(\"Wave file not found: \" + filename);\r\n            return;\r\n        } \r\n \r\n        AudioInputStream audioInputStream = null;\r\n        try { \r\n            audioInputStream = AudioSystem.getAudioInputStream(soundFile);\r\n        } catch (UnsupportedAudioFileException e1) { \r\n            e1.printStackTrace();\r\n            return;\r\n        } catch (IOException e1) { \r\n            e1.printStackTrace();\r\n            return;\r\n        } \r\n \r\n        AudioFormat format = audioInputStream.getFormat();\r\n        SourceDataLine auline = null;\r\n        DataLine.Info info = new DataLine.Info(SourceDataLine.class, format);\r\n \r\n        try { \r\n            auline = (SourceDataLine) AudioSystem.getLine(info);\r\n            auline.open(format);\r\n        } catch (LineUnavailableException e) { \r\n            e.printStackTrace();\r\n            return;\r\n        } catch (Exception e) { \r\n            e.printStackTrace();\r\n            return;\r\n        } \r\n \r\n        if (auline.isControlSupported(FloatControl.Type.PAN)) { \r\n            FloatControl pan = (FloatControl) auline\r\n                    .getControl(FloatControl.Type.PAN);\r\n            if (curPosition == Position.RIGHT) \r\n                pan.setValue(1.0f);\r\n            else if (curPosition == Position.LEFT) \r\n                pan.setValue(-1.0f);\r\n        } \r\n \r\n        auline.start();\r\n        int nBytesRead = 0;\r\n        byte[] abData = new byte[EXTERNAL_BUFFER_SIZE];\r\n \r\n        try { \r\n            while (nBytesRead != -1) { \r\n                nBytesRead = audioInputStream.read(abData, 0, abData.length);\r\n                if (nBytesRead >= 0) \r\n                    auline.write(abData, 0, nBytesRead);\r\n            } \r\n        } catch (IOException e) { \r\n            e.printStackTrace();\r\n            return;\r\n        } finally { \r\n            auline.drain();\r\n            auline.close();\r\n        } \r\n \r\n    } \r\n} [/JAVA]','a57fa1e428a1a416a23245c6653c530e644854fe',1,'2015-03-13 12:58:53','2015-03-13 12:58:53',1,4,NULL),(162,'Разделить файл пополам','[JAVA]package com.javarush.test.level18.lesson05.task03;\r\n\r\n/* Разделение файла\r\nСчитать с консоли три имени файла: файл1, файл2, файл3.\r\nРазделить файл1 по следующему критерию:\r\nПервую половину байт записать в файл2, вторую половину байт записать в файл3.\r\nЕсли в файл1 количество байт нечетное, то файл2 должен содержать бОльшую часть.\r\nЗакрыть потоки ввода-вывода\r\n*/\r\n\r\nimport java.io.FileInputStream;\r\nimport java.io.FileOutputStream;\r\nimport java.io.IOException;\r\nimport java.util.Scanner;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException{\r\n        Scanner scanner = new Scanner(System.in);\r\n        FileInputStream fileInputStream = new FileInputStream(scanner.nextLine());\r\n        FileOutputStream fileOutputStream1 = new FileOutputStream(scanner.nextLine());\r\n        FileOutputStream fileOutputStream2 = new FileOutputStream(scanner.nextLine());\r\n        int fileSize = fileInputStream.available();\r\n        byte[] buffer = new byte[fileSize];\r\n        int count = fileInputStream.read(buffer, 0, fileSize);\r\n        int half2 = count / 2;\r\n        int half1 = fileSize - half2;\r\n        fileOutputStream1.write(buffer,0, half1);\r\n        fileOutputStream2.write(buffer,half1, half2);\r\n        fileOutputStream1.close();\r\n        fileOutputStream2.close();\r\n        fileInputStream.close();\r\n    }\r\n}[/JAVA]','e92b3383ba1baff41a3a4fbe1476d7013df477f8',1,'2015-03-13 14:09:33','2015-03-14 12:19:23',1,4,''),(163,'For Ромаха','[C_CPP]#include <iostream>\r\n#include <vector>\r\n#include <conio.h>\r\n\r\nusing namespace std;\r\n\r\nint main()\r\n{\r\n	const int n=3;\r\n	bool a[n][n]={true,true,true,true,true,true,true,true,true};\r\n	for (int i=0;i<n;i++)\r\n		for (int j=0;j<n;j++)\r\n		{\r\n			int t;\r\n			cin>>t;\r\n			for (int k=1;k<t;i++)\r\n			{\r\n				a[i][j]=!a[i][j];\r\n				if (i>0) a[i-1][j]=!a[i-1][j];\r\n				if (i<n-1) a[i+1][j]=!a[i+1][j];\r\n				if (j>0) a[i][j-1]=!a[i][j-1];\r\n				if (j<n-1) a[i][j+1]=!a[i][j+1];\r\n			}\r\n		}\r\n\r\n		for (int i=0;i<n;i++)\r\n		{\r\n			for (int j=0;j<n;j++) cout<<a[i][j]<<\" \";\r\n			cout<<endl;\r\n		}\r\n	getch();\r\n	return 0;\r\n}[/C_CPP]','220c2a24f1f66ad86fa27966fcabaf62cf6012af',1,'2015-03-17 09:35:22','2015-09-10 12:27:09',1,NULL,''),(164,'Декораторы... Работа только с txt','[JAVA]package com.javarush.test.level18.lesson08.task04;\r\n\r\nimport java.io.FileInputStream;\r\nimport java.io.FileNotFoundException;\r\nimport java.io.IOException;\r\n\r\n/* UnsupportedFileName\r\nИзмените класс TxtInputStream так, чтобы он работал только с txt-файлами (*.txt)\r\nНапример, first.txt или name.1.part3.txt\r\nЕсли передан не txt-файл, например, file.txt.exe, то конструктор должен выбрасывать исключение UnsupportedFileNameException\r\n*/\r\n\r\npublic class TxtInputStream extends FileInputStream {     \r\n\r\n    public TxtInputStream(String fileName) throws FileNotFoundException, UnsupportedFileNameException\r\n    {\r\n        super(fileName);\r\n        String f = fileName.substring(fileName.length()-4);\r\n        if (!f.equals(\".txt\")) {\r\n            throw new UnsupportedFileNameException();\r\n        }\r\n    }\r\n\r\n}\r\n\r\npackage com.javarush.test.level18.lesson08.task04;\r\n\r\npublic class UnsupportedFileNameException extends Exception {\r\n}\r\n\r\n\r\n[/JAVA]','2accc641c57ec6e28a274668935c23c29195ca6d',1,'2015-03-18 12:06:47','2015-03-18 12:07:17',1,4,''),(165,'Английские буквы','[JAVA]package com.javarush.test.level18.lesson10.home01;\r\n\r\n/* Английские буквы\r\nВ метод main первым параметром приходит имя файла.\r\nПосчитать количество букв английского алфавита, которое есть в этом файле.\r\nВывести на экран число (количество букв)\r\nЗакрыть потоки\r\n*/\r\n\r\nimport java.io.FileInputStream;\r\nimport java.io.IOException;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException   {        \r\n        FileInputStream fileInputStream = new FileInputStream(args[0]);\r\n        int count = 0;\r\n        while (fileInputStream.available() > 0) {\r\n            int data = fileInputStream.read();\r\n            byte sym = (byte) data;\r\n            if (sym >= \'a\' && sym <= \'z\' || sym >= \'A\' && sym <= \'Z\') count++;\r\n        }\r\n        fileInputStream.close();\r\n        System.out.println(count);\r\n    }\r\n}[/JAVA]','55aabf1f3d1c37bb790fbd60a0f6bf58646a9db4',1,'2015-03-20 06:37:58','2015-03-20 06:39:12',1,4,''),(166,'Объединение файлов','[JAVA]package com.javarush.test.level18.lesson10.home04;\r\n\r\n/* Объединение файлов\r\nСчитать с консоли 2 имени файла\r\nВ начало первого файла записать содержимое второго файла так, чтобы получилось объединение файлов\r\nЗакрыть потоки\r\nТемповые файлы создавать нельзя, т.к. на сервере заблокирована возможность создания каких любо файлов\r\n*/\r\n\r\nimport java.io.*;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException\r\n    {\r\n        //Ввод имен файлов\r\n        BufferedReader bufferedReader = new BufferedReader(new InputStreamReader(System.in));\r\n        String fileName1 = bufferedReader.readLine();\r\n        String fileName2 = bufferedReader.readLine();\r\n        //Считаем в буферы содержимое файлов\r\n        FileInputStream fileInputStream1 = new FileInputStream(fileName1);\r\n        FileInputStream fileInputStream2 = new FileInputStream(fileName2);\r\n        byte[] buffer1 = new byte[fileInputStream1.available()];\r\n        byte[] buffer2 = new byte[fileInputStream2.available()];          \r\n        fileInputStream1.read(buffer1);\r\n        fileInputStream2.read(buffer2);\r\n        fileInputStream1.close();\r\n        fileInputStream2.close();\r\n        //Отрываем файл 1 для рандомного доступа и пишем туда содержимое буферов\r\n        RandomAccessFile randomAccessFile = new RandomAccessFile(fileName1, \"rw\");\r\n        randomAccessFile.seek(0);\r\n        randomAccessFile.write(buffer2);\r\n        randomAccessFile.write(buffer1);\r\n        randomAccessFile.close();\r\n    }\r\n}[/JAVA]','9bd47c250de53a34ed3ece7d48a5ea8bcb4c5096',1,'2015-03-21 11:30:11','2015-03-21 11:30:11',1,4,NULL),(167,'Вычисление интеграла методом Симпсона (PureBasic)','[LISP];Вычисление интеграла методом Симпсона \r\n;8 байтовый буфер памяти для обменных процессов между процедурами\r\nDataSection\r\n  inv_data_bufer:\r\n  Data.d $0000000000000000\r\nEndDataSection\r\n;процедура вызова пользовательской процедуры по её адресу\r\nProcedure.d inv_func_call(x.d,*func)\r\n  PokeD(?inv_data_bufer,x.d)\r\n  !CALL dword[p.p_func]\r\n  ProcedureReturn PeekD(?inv_data_bufer)\r\nEndProcedure\r\n \r\n;Данные для свободного использования\r\n;макрос получения значения аргумента X для пользовательской процедуры\r\nMacro ReturnFromInv()\r\n  PeekD(?inv_data_bufer)\r\nEndMacro\r\n;макрос отправки результата пользовательской процедуры для Inv процедуры\r\nMacro ReturnToInv(value)\r\n  PokeD(?inv_data_bufer,value)\r\nEndMacro\r\n;главная процедура - вычисление интеграла методом Симпсона с заданной точностью\r\nProcedure.d Inv(*func, a.d, b.d, E.d = 0.0001)\r\n  Protected h.d, x.d, s.d, s1.d, s2.d, s3.d, sign.d, Result.d,f.d\r\n  If     a = b\r\n    Goto Inv_EndProcedure\r\n  ElseIf a > b\r