) {\r\n    var tmp = []\r\n    for(var i = 0, j = 0; i < this.length; ++i)\r\n        if(this[i] < _v)\r\n            tmp[j++] = this[i]\r\n    return tmp\r\n}\r\nArray.prototype.minmax = function() {\r\n    return [Math.min.apply(null, this), Math.max.apply(null, this)]\r\n}\r\n\r\n//.....\r\n\r\nvar arr = [10, 20, 500, 40, 70, -3]\r\n\r\nconsole.log(\r\n    arr,\r\n    arr.select_below(40).minmax()\r\n)[/JAVASCRIPT]','83d39be777ba83183117d440f638157422650092',1,'2015-03-22 17:12:37','2015-03-22 17:12:37',1,1,''),(525,'min_max','[C_CPP]#include <algorithm>\r\n#include <iostream>\r\n#include <iterator>\r\n#include <vector>\r\n\r\ntemplate <class _Iterator>\r\nstd::pair <_Iterator, _Iterator> min_max_element(_Iterator _first, _Iterator _last)\r\n{\r\n	if (_first != _last) {\r\n		std::pair <_Iterator, _Iterator> _temp_min_max(_first, _first);\r\n		while (_first != _last) {\r\n			_temp_min_max.first = *_first < *_temp_min_max.first ? _first : _temp_min_max.first;\r\n			_temp_min_max.second = *_first > *_temp_min_max.second ? _first : _temp_min_max.second;\r\n			++_first;\r\n		}\r\n		return _temp_min_max;\r\n	}\r\n	return std::make_pair(_first, _first);\r\n}\r\n\r\nint main()\r\n{\r\n	std::vector <int> vector;\r\n	std::copy(std::istream_iterator <int> (std::cin), std::istream_iterator <int>(), std::back_inserter(vector));\r\n\r\n	auto min_max = min_max_element(vector.begin(), vector.end());\r\n	std::cout << \"Min: \" << *min_max.first << \"; Max: \" << *min_max.second << \";\" << std::endl;\r\n\r\n	std::system(\"pause\");\r\n	return 0;\r\n}[/C_CPP]','e7f3050bc1504275fc19920dd8781afacef21d13',1,'2015-03-22 17:13:31','2015-09-10 12:23:32',1,NULL,''),(1371,'Округление чисел','[JAVA]package com.javarush.test.level18.lesson10.home05;\r\n\r\n/* Округление чисел\r\nСчитать с консоли 2 имени файла\r\nПервый файл содержит вещественные(дробные) числа, разделенные пробелом. Например, 3.1415\r\nОкруглить числа до целых и записать во второй файл\r\nЗакрыть потоки\r\nПринцип округления:\r\n3.49 - 3\r\n3.50 - 4\r\n3.51 - 4\r\n*/\r\n\r\nimport java.io.*;\r\nimport java.util.ArrayList;\r\nimport java.util.Scanner;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException{\r\n        BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));\r\n        String file1 = reader.readLine();\r\n        String file2 = reader.readLine();\r\n        ArrayList<Double> arrayList = new ArrayList<Double>();\r\n        Scanner scanner = new Scanner(new FileReader(file1));\r\n        while (scanner.hasNext()) {\r\n            String s = scanner.nextLine();\r\n            String[] m = s.split(\" \");\r\n            for (int i = 0; i < m.length; i++) {\r\n                arrayList.add(Double.parseDouble(m[i]));\r\n            }\r\n        }\r\n        scanner.close();\r\n        FileWriter fileWriter = new FileWriter(file2);\r\n        for (Double d : arrayList) {\r\n            int a = (int) Math.round(d);\r\n            fileWriter.write(a + \" \");\r\n        }\r\n        fileWriter.close();\r\n        //for (Double d : arrayList) System.out.print(d + \" \");\r\n    }\r\n}[/JAVA]','b6f120a09a0122a2bfd425d3ef5ffe6ee1f0e81a',1,'2015-03-24 01:11:52','2015-03-24 01:11:52',1,4,NULL),(1377,'Встречаемость символов','[JAVA]package com.javarush.test.level18.lesson10.home06;\r\n\r\n/* Встречаемость символов\r\nПрограмма запускается с одним параметром - именем файла, который содержит английский текст.\r\nПосчитать частоту встречания каждого символа.\r\nОтсортировать результат по возрастанию кода ASCII (почитать в инете). Пример: \',\'=44, \'s\'=115, \'t\'=116\r\nВывести на консоль отсортированный результат:\r\n[символ1]  частота1\r\n[символ2]  частота2\r\nЗакрыть потоки\r\n\r\nПример вывода:\r\n, 19\r\n- 7\r\nf 361\r\n*/\r\n\r\nimport java.io.FileInputStream;\r\nimport java.io.IOException;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException{\r\n        FileInputStream fileInputStream = new FileInputStream(args[0]);\r\n        int[] frq = new int[128];  //массив частот\r\n\r\n        while (fileInputStream.available() > 0) {\r\n            int a = fileInputStream.read();\r\n            frq[a]++;\r\n        }\r\n        fileInputStream.close();\r\n        char j = 0;\r\n        for (int i = 0; i < 128; i++) {\r\n\r\n            if (frq[i] != 0) System.out.println(j + \" \" + frq[i]);\r\n            j++;\r\n        }\r\n    }\r\n}[/JAVA]','fbd726e648288d054aea9c37641911092d06111c',1,'2015-03-24 01:50:39','2015-03-24 01:50:39',1,4,NULL),(1648,'Слияние файлов','[JAVA]package com.javarush.test.level18.lesson10.home10;\r\n\r\n/* Собираем файл\r\nСобираем файл из кусочков\r\nСчитывать с консоли имена файлов\r\nКаждый файл имеет имя: [someName].partN. Например, Lion.avi.part1, Lion.avi.part2, ..., Lion.avi.part37.\r\nИмена файлов подаются в произвольном порядке. Ввод заканчивается словом \"end\"\r\nВ папке, где находятся все прочтенные файлы, создать файл без приставки [.partN]. Например, Lion.avi\r\nВ него переписать все байты из файлов-частей используя буфер.\r\nФайлы переписывать в строгой последовательности, сначала первую часть, потом вторую, ..., в конце - последнюю.\r\nЗакрыть все потоки ввода-вывода\r\nТемповые файлы создавать нельзя, т.к. на сервере заблокирована возможность создания каких любо файлов\r\n*/\r\n\r\nimport java.io.FileInputStream;\r\nimport java.io.FileOutputStream;\r\nimport java.io.IOException;\r\nimport java.util.ArrayList;\r\nimport java.util.Collections;\r\nimport java.util.Comparator;\r\nimport java.util.Scanner;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException\r\n    {\r\n        Scanner scanner = new Scanner(System.in);\r\n        ArrayList<String> parts = new ArrayList<String>();         \r\n        FileInputStream fileInputStream = null;         \r\n        String nextFileName = null;\r\n        //Читаем файлы пока не \"end\"\r\n        while (true) {\r\n            if (\"end\".equals(nextFileName = scanner.nextLine())) break;\r\n            else parts.add(nextFileName);\r\n        }\r\n        scanner.close();\r\n        //Сортируем коллекцию\r\n        Collections.sort(parts, new Comparator<String>()\r\n        {\r\n            @Override\r\n            public int compare(String o1, String o2)\r\n            {\r\n                return o1.toString().compareTo(o2.toString());    \r\n            }\r\n        });\r\n        //Выходной файловый поток\r\n        String outputFileName = parts.get(0).split(\".part\")[0];\r\n        FileOutputStream fileOutputStream = new FileOutputStream(outputFileName);\r\n        //Сливаем файлы\r\n        for (String partsFileNames : parts) {\r\n            fileInputStream = new FileInputStream(partsFileNames);\r\n            byte[] buffer = new byte[fileInputStream.available()];\r\n            fileInputStream.read(buffer);\r\n            fileOutputStream.write(buffer);\r\n            fileInputStream.close();\r\n        }\r\n        fileOutputStream.close();\r\n        System.out.println(\"Объединение файлов выполнено!\");\r\n    }\r\n}[/JAVA]','928f8aeb77e5c1717c038b24adb183a904f6e891',1,'2015-03-24 11:26:49','2015-03-24 11:26:49',0,4,NULL),(1690,'Шифровка','[JAVA]package com.javarush.test.level18.lesson10.bonus01;\r\n\r\n/* Шифровка\r\nПридумать механизм шифровки/дешифровки\r\n\r\nПрограмма запускается с одним из следующих наборов параметров:\r\n-e fileName fileOutputName\r\n-d fileName fileOutputName\r\nгде\r\nfileName - имя файла, который необходимо зашифровать/расшифровать\r\nfileOutputName - имя файла, куда необходимо записать результат шифрования/дешифрования\r\n-e - ключ указывает, что необходимо зашифровать данные\r\n-d - ключ указывает, что необходимо расшифровать данные\r\n*/\r\n\r\nimport java.io.FileInputStream;\r\nimport java.io.FileOutputStream;\r\nimport java.io.IOException;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException{\r\n        String key = args[0];\r\n        String fileInputName = args[1];\r\n        String fileOutputName = args[2];\r\n        FileInputStream fileInputStream = new FileInputStream(fileInputName);\r\n        FileOutputStream fileOutputStream = new FileOutputStream(fileOutputName);\r\n        if (\"-e\".equals(key)) {\r\n            while (fileInputStream.available() > 0) {\r\n                int data = fileInputStream.read();\r\n                if (data == 0xFF) data = 0x00;\r\n                else data++;\r\n                fileOutputStream.write(data);\r\n            }\r\n        }\r\n        else if (\"-d\".equals(key)) {\r\n            while (fileInputStream.available() > 0) {\r\n                int data = fileInputStream.read();\r\n                if (data == 0x00) data = 0xFF;\r\n                else data--;\r\n                fileOutputStream.write(data);\r\n            }\r\n        }\r\n        fileInputStream.close();\r\n        fileOutputStream.close();\r\n        System.out.println(\"Выполнено!\");\r\n    }\r\n}[/JAVA]','c0740bd308b4215abbcd822c2988608d1c58085f',1,'2015-03-26 04:39:52','2015-03-26 04:39:52',1,NULL,NULL),(1691,'Файлы и исключения','[JAVA]package com.javarush.test.level18.lesson10.home09;\r\n\r\n/* Файлы и исключения\r\nЧитайте с консоли имена файлов\r\nЕсли файла не существует (передано неправильное имя файла), то\r\nперехватить исключение, вывести в консоль переданное неправильное имя файла и завершить работу программы\r\nНе забудьте закрыть все потоки\r\n*/\r\n\r\nimport java.io.*;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) {\r\n        BufferedReader rdr = new BufferedReader(new InputStreamReader(System.in));\r\n        String f = \"\";\r\n        while(true){\r\n            try\r\n            {\r\n                try\r\n                {\r\n                    f = rdr.readLine();\r\n                    File file = new File(f);\r\n                    if (!file.exists()) throw new FileNotFoundException(f);\r\n                }\r\n                catch (FileNotFoundException e) {\r\n                    System.out.println(f);\r\n                    break;\r\n                }\r\n            }\r\n            catch (IOException e)\r\n            {\r\n                e.printStackTrace();\r\n            }\r\n        }\r\n    }\r\n}[/JAVA]','ff2d2098d130bd84648005e3de45ceef7fc4d22c',1,'2015-03-26 05:10:43','2015-03-26 05:10:43',1,NULL,NULL),(1692,'Адаптер к двум интерфейсам','[JAVA]package com.javarush.test.level19.lesson03.task03;\r\n\r\n/* Адаптация нескольких интерфейсов\r\nАдаптировать IncomeData к Customer и Contact.\r\nКлассом-адаптером является IncomeDataAdapter.\r\nИнициализируйте countries перед началом выполнения программы. Соответствие кода страны и названия:\r\nUA Ukraine\r\nRU Russia\r\nCA Canada\r\nДополнить телефонный номер нулями до 10 цифр при необходимости\r\n*/\r\n\r\nimport java.util.HashMap;\r\nimport java.util.Map;\r\n\r\npublic class Solution {\r\n    public static Map<String,String> countries = new HashMap<String,String>();\r\n\r\n    static {\r\n        countries.put(\"UA\", \"Ukraine\");\r\n        countries.put(\"RU\", \"Russia\");\r\n        countries.put(\"CA\", \"Canada\");\r\n        countries.put(\"US\", \"United States\");\r\n    }\r\n\r\n    public static class IncomeDataAdapter implements Customer, Contact{\r\n        private IncomeData incomeData;\r\n\r\n        public IncomeDataAdapter(IncomeData incomeData)\r\n        {\r\n            this.incomeData = incomeData;\r\n        }\r\n\r\n        @Override\r\n        public String getName()\r\n        {\r\n            return this.incomeData.getContactLastName() + \", \" + this.incomeData.getContactFirstName();\r\n        }\r\n\r\n        @Override\r\n        public String getPhoneNumber()\r\n        {\r\n            String clearPhoneNumber = Integer.valueOf(this.incomeData.getPhoneNumber()).toString();\r\n            if (clearPhoneNumber.length() < 10) {\r\n                while (clearPhoneNumber.length() < 10) clearPhoneNumber = \"0\" + clearPhoneNumber;\r\n            }\r\n            String newPhoneName = \"+\"\r\n                    + this.incomeData.getCountryPhoneCode() + \"(\" + clearPhoneNumber.substring(0, 3)\r\n                    + \")\" + clearPhoneNumber.substring(3, 6) + \"-\" + clearPhoneNumber.substring(6,8)\r\n                    + \"-\" + clearPhoneNumber.substring(8);\r\n            return newPhoneName;\r\n        }\r\n\r\n        @Override\r\n        public String getCompanyName()\r\n        {\r\n            return this.incomeData.getCompany();\r\n        }\r\n\r\n        @Override\r\n        public String getCountryName()\r\n        {\r\n            String countryName = \"\";\r\n            for (Map.Entry<String, String> pair : countries.entrySet()){\r\n                if (pair.getKey().equals(this.incomeData.getCountryCode())) countryName = pair.getValue();\r\n            }\r\n            return countryName;\r\n        }\r\n    }\r\n\r\n    public static interface IncomeData {\r\n        String getCountryCode();        //example UA\r\n        String getCompany();            //example JavaRush Ltd.\r\n        String getContactFirstName();   //example Ivan\r\n        String getContactLastName();    //example Ivanov\r\n        int getCountryPhoneCode();      //example 38\r\n        int getPhoneNumber();           //example 501234567\r\n    }\r\n\r\n    public static interface Customer {\r\n        String getCompanyName();        //example JavaRush Ltd.\r\n        String getCountryName();        //example Ukraine\r\n    }\r\n\r\n    public static interface Contact {\r\n        String getName();               //example Ivanov, Ivan\r\n        String getPhoneNumber();        //example +38(050)123-45-67\r\n    }\r\n\r\n    //Тестовый main\r\n    public static void main(String[] args)\r\n    {\r\n        class iData implements IncomeData {\r\n\r\n            @Override\r\n            public String getCountryCode()\r\n            {\r\n                return \"US\";\r\n            }\r\n\r\n            @Override\r\n            public String getCompany()\r\n            {\r\n                return \"Planet Express\";\r\n            }\r\n\r\n            @Override\r\n            public String getContactFirstName()\r\n            {\r\n                return \"Bender\";\r\n            }\r\n\r\n            @Override\r\n            public String getContactLastName()\r\n            {\r\n                return \"Rodriguez\";\r\n            }\r\n\r\n            @Override\r\n            public int getCountryPhoneCode()\r\n            {\r\n                return 1;\r\n            }\r\n\r\n            @Override\r\n            public int getPhoneNumber()\r\n            {\r\n                return 666666;\r\n            }\r\n        }\r\n        IncomeDataAdapter adapter = new IncomeDataAdapter(new iData());\r\n        System.out.println(adapter.getCompanyName());\r\n        System.out.println(adapter.getCountryName());\r\n        System.out.println(adapter.getPhoneNumber());\r\n        System.out.println(adapter.getName());\r\n    }\r\n}[/JAVA]','927cff2f7797afae827cd43401bb6e6bdfcdf330',1,'2015-03-26 07:38:13','2015-03-26 07:38:13',0,4,NULL),(1694,'Учусь рисовать','[JAVA]package ru.ildwine.java.JCal;\r\n\r\nimport javax.swing.*;\r\nimport java.awt.*;\r\n\r\n//Тестовый класс\r\npublic class SimpleGraphic2D extends JFrame{\r\n\r\n    //Альбом для рисования\r\n    private Album album;\r\n\r\n    //Конструктор\r\n    public SimpleGraphic2D() {\r\n        //Инициализируем форму\r\n        super(\"Примитивная графика (Swing)\");\r\n        setDefaultCloseOperation(EXIT_ON_CLOSE);\r\n        setSize(810, 610);\r\n        setLayout(new FlowLayout());\r\n        setLocation(100, 100);\r\n        setResizable(false);\r\n        //Создаем альбом и добавляем его на форму\r\n        album = new Album();\r\n        album.setSize(800, 600);\r\n        add(album);\r\n        setContentPane(album);\r\n        //Показ формы\r\n        setVisible(true);\r\n    }\r\n\r\n    //Создаем новое окно в потоке диспетчеризации\r\n    public static void main(String[] args) {\r\n        SwingUtilities.invokeLater(new Runnable() {\r\n            @Override\r\n            public void run() {\r\n                new SimpleGraphic2D();\r\n            }\r\n        });\r\n    }\r\n}\r\n\r\n//Рисовать тут!\r\nclass Album extends JPanel {\r\n    public Album() {\r\n        setOpaque(true);\r\n    }\r\n\r\n    @Override\r\n    protected void paintComponent(Graphics g) {\r\n        Graphics2D g2d = (Graphics2D) g;\r\n        g2d.setColor(Color.blue);\r\n        //закрашенный прямоугольник\r\n        g2d.fillRect(100, 100, 300, 200);\r\n        //линии\r\n        g2d.setColor(Color.red);\r\n        g2d.drawLine(500, 400, 500, 100);\r\n        g2d.drawLine(500, 100, 600, 300);\r\n        g2d.drawLine(600, 300, 500, 400);\r\n        \r\n        \r\n        //ПРОДОЛЖЕНИЕ СЛЕДУЕТ!!!\r\n    }\r\n}[/JAVA]','b8417816189759949dd83b060d23fb78715fc6a4',1,'2015-03-31 12:22:55','2015-03-31 12:24:54',1,4,''),(1695,'Адаптер сканера','[JAVA]package com.javarush.test.level19.lesson03.task04;\r\n\r\nimport java.io.IOException;\r\n\r\npublic interface PersonScanner {\r\n    Person read() throws IOException;\r\n\r\n    void close() throws IOException;\r\n}[/JAVA]\r\n\r\n[JAVA]package com.javarush.test.level19.lesson03.task04;\r\n\r\nimport java.util.Date;\r\n\r\npublic class Person {\r\n    private String firstName;\r\n    private String middleName;\r\n    private String lastName;\r\n    private Date birthDate;\r\n\r\n    public Person(String firstName, String middleName, String lastName, Date birthDate) {\r\n        this.firstName = firstName;\r\n        this.middleName = middleName;\r\n        this.lastName = lastName;\r\n        this.birthDate = birthDate;\r\n    }\r\n\r\n    @Override\r\n    public String toString() {\r\n        return String.format(\"%s %s %s %s\", lastName, firstName, middleName, birthDate.toString());\r\n    }\r\n}[/JAVA]\r\n\r\n[JAVA]package com.javarush.test.level19.lesson03.task04;\r\n\r\nimport java.io.IOException;\r\nimport java.util.Calendar;\r\nimport java.util.Date;\r\nimport java.util.GregorianCalendar;\r\nimport java.util.Scanner;\r\n\r\n/* И еще один адаптер\r\nАдаптировать Scanner к PersonScanner.\r\nКлассом-адаптером является PersonScannerAdapter.\r\nДанные в файле хранятся в следующем виде:\r\nИванов Иван Иванович 31 12 1978\r\n\r\nПодсказка: воспользуйтесь классом Calendar\r\n*/\r\n\r\npublic class Solution {\r\n    public static class PersonScannerAdapter implements PersonScanner{\r\n        private Scanner scanner;\r\n\r\n        public PersonScannerAdapter(Scanner scanner)\r\n        {\r\n            this.scanner = scanner;\r\n        }\r\n\r\n        @Override\r\n        public Person read() throws IOException  {\r\n            String[] lines = this.scanner.nextLine().split(\" \");\r\n            Calendar calendar = new GregorianCalendar(Integer.parseInt(lines[5]),\r\n                    Integer.parseInt(lines[4])-1, Integer.parseInt(lines[3]));\r\n            Date date = calendar.getTime();\r\n            return new Person(lines[1], lines[2], lines[0], date);\r\n        }\r\n\r\n        @Override\r\n        public void close() throws IOException\r\n        {\r\n             this.scanner.close();\r\n        }\r\n    }\r\n}[/JAVA]','17a87d25d990ed6fdcbc3419a3a6240243d2755b',1,'2015-04-01 11:02:01','2015-04-01 11:02:01',1,4,NULL),(1696,'Адаптер двух интерфейсов к одному','[JAVA]package com.javarush.test.level19.lesson03.task05;\r\n\r\nimport java.util.ArrayList;\r\nimport java.util.HashMap;\r\nimport java.util.Map;\r\n\r\n/* Закрепляем адаптер\r\nАдаптировать Customer и Contact к RowItem.\r\nКлассом-адаптером является DataAdapter.\r\nИнициализируйте countries перед началом выполнения программы. Соответствие кода страны и названия:\r\nUA Ukraine\r\nRU Russia\r\nCA Canada\r\n*/\r\n\r\npublic class Solution {\r\n    private static Map<String,String> countries = new HashMap<String,String>();\r\n\r\n    static {\r\n        countries.put(\"UA\", \"Ukraine\");\r\n        countries.put(\"RU\", \"Russia\");\r\n        countries.put(\"CA\", \"Canada\");\r\n    }\r\n\r\n\r\n    public static class DataAdapter implements RowItem{\r\n        private Customer customer;\r\n        private Contact contact;\r\n\r\n        public DataAdapter(Customer customer, Contact contact)\r\n        {\r\n            this.customer = customer;\r\n            this.contact = contact;\r\n        }\r\n\r\n        @Override\r\n        public String getCountryCode()\r\n        {\r\n            String a = \"\";\r\n            for (Map.Entry<String, String> pair : countries.entrySet()) {\r\n                if (pair.getValue().equals(this.customer.getCountryName())) {\r\n                   a = pair.getKey();\r\n                }\r\n            }\r\n            return a;\r\n        }\r\n\r\n        @Override\r\n        public String getCompany()\r\n        {\r\n            return this.customer.getCompanyName();\r\n        }\r\n\r\n        @Override\r\n        public String getContactFirstName()\r\n        {\r\n            return this.contact.getName().split(\" \")[1];\r\n        }\r\n\r\n        @Override\r\n        public String getContactLastName()\r\n        {\r\n            return this.contact.getName().split(\",\")[0];\r\n        }\r\n\r\n        @Override\r\n        public String getDialString()\r\n        {\r\n            String b = \"callto://\";\r\n            String c = this.contact.getPhoneNumber();\r\n            ArrayList<String> list = new ArrayList<String>();\r\n            for (int i = 0; i < c.length(); i++) {\r\n                Character z = c.charAt(i);\r\n                if ((z != \'(\') && (z != \')\') && (z != \'-\')) list.add(z.toString());\r\n            }\r\n            for (String s : list) b = b + s;\r\n            return b;\r\n        }\r\n    }\r\n\r\n    public static interface RowItem {\r\n        String getCountryCode();        //example UA\r\n        String getCompany();            //example JavaRush Ltd.\r\n        String getContactFirstName();   //example Ivan\r\n        String getContactLastName();    //example Ivanov\r\n        String getDialString();         //example callto://+380501234567\r\n    }\r\n\r\n    public static interface Customer {\r\n        String getCompanyName();        //example JavaRush Ltd.\r\n        String getCountryName();        //example Ukraine\r\n    }\r\n\r\n    public static interface Contact {\r\n        String getName();               //example Ivanov, Ivan\r\n        String getPhoneNumber();        //example +38(050)123-45-67\r\n    }\r\n}[/JAVA]','cb3705191fb9d3691c9204f74808322a843188ce',1,'2015-04-01 11:26:14','2015-04-01 11:26:14',1,4,NULL),(1698,'Code_1','[CSHARP]using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nusing System.IO.Ports;\r\nusing System.Threading;\r\nusing System.ComponentModel;\r\n\r\nnamespace ComponentTesterLib {\r\n    public class ComponentTester :BackgroundWorker {\r\n        //Поле порта\r\n        private SerialPort serialPort;\r\n        //Поле стартового адреса конфигурации\r\n        private int startAddress;\r\n        //Поле типа устройства\r\n        private AppType appType;\r\n        //Поле типа двигателя\r\n        private MotorType motorType;\r\n\r\n        //Открытое свойство типа устройства\r\n        public AppType AppType {\r\n            get { return appType; }\r\n        }\r\n        //Открытое свойство типа двигателя\r\n        public MotorType MotorType {\r\n            get { return motorType; }\r\n        }\r\n\r\n        //Конструктор\r\n        public ComponentTester(string portName) {\r\n            this.WorkerReportsProgress = true;\r\n            this.WorkerSupportsCancellation = true;\r\n            ConfigurePort(out serialPort, portName);\r\n        }\r\n\r\n        //Переопределенный метод OnDoWork()\r\n        protected override void OnDoWork(DoWorkEventArgs e) {\r\n            try {\r\n                serialPort.Open();\r\n                GetConnection();\r\n                GetMotorType();\r\n                Commands cmds = new Commands(appType, motorType);\r\n                \r\n            }\r\n            finally {\r\n                serialPort.Close();\r\n            }\r\n        }\r\n\r\n        //Метод конфигурирования порта\r\n        private void ConfigurePort(out SerialPort port, string name) {\r\n            port = new SerialPort(name, 38400);\r\n        }\r\n\r\n        //Определение типа устройства\r\n        private void GetConnection() {\r\n            //Запрос соединения\r\n            byte[] connectAsc = { 0xA5, 0xEE, 0x02, 0x95, 0x49, 0x02, 0x90, 0x20, 0x25 };\r\n            //Массив для данных\r\n            List<byte> tempData = new List<byte>();\r\n            //Чтение блока\r\n            ReadBlock(connectAsc, 40, tempData);\r\n            //Переменная типа устройства\r\n            int type = (tempData[8] << 8) + tempData[9];\r\n            //Проверка наличия константы в перечислении\r\n            if (!Enum.IsDefined(typeof(AppType), type)) {\r\n                throw new ArgumentException(\"Операция не реализована!\");\r\n            }\r\n            //Установка поля типа устройства\r\n            appType = (AppType)type;\r\n            //Установка поля стартового адреса\r\n            startAddress = tempData[15] << 8 + tempData[16];\r\n        }\r\n\r\n        //Определение типа двигателя\r\n        private void GetMotorType() {\r\n            //Запрос чтения\r\n            byte[] vectorAsc = { 0xA5, 0xEE, 0x02, 0x95, 0x3F, 0x05, 0x90, 0x00, 0x00, 0x00, 0x00, 0x00 };\r\n            //Массив для данных\r\n            List<byte> tempData = new List<byte>();\r\n            //Коррекция адресов запроса\r\n            vectorAsc[8] = vectorAsc[10] = (byte)(startAddress >> 8);\r\n            vectorAsc[9] = 0x1F;\r\n            vectorAsc[11] = (byte)vectorAsc.Sum(b => b);\r\n            //Чтение блока\r\n            ReadBlock(vectorAsc, 40, tempData);\r\n            //Переменная адреса чтения\r\n            int typeAddress = (((tempData[9] << 8) + tempData[10]) * 2) + (startAddress - 1);\r\n            //Коррекция запроса\r\n            vectorAsc[8] = (byte)(typeAddress >> 8);\r\n            vectorAsc[7] = (byte)((typeAddress & 0xFF) + 1);\r\n            vectorAsc[9] = (byte)(vectorAsc[7] + 0xF);\r\n            vectorAsc[10] = (vectorAsc[9] == 0x00) ? (byte)(vectorAsc[8] + 1) : (byte)(vectorAsc[8]);\r\n            vectorAsc[11] = 0x00;\r\n            vectorAsc[11] = (byte)vectorAsc.Sum(b => b);\r\n            //Чтение блока\r\n            ReadBlock(vectorAsc, 24, tempData);\r\n            //Переменная типа двигателя\r\n            int type = (tempData[9] << 8) + tempData[10];\r\n            //Проверка наличия константы в перечислении\r\n            if (!Enum.IsDefined(typeof(MotorType), type)) {\r\n                throw new ArgumentException(\"Операция не реализована!\");\r\n            }\r\n            //Установка поля типа двигателя\r\n            motorType = (MotorType)type;\r\n        }\r\n\r\n        //Метод записи-чтения блока данных\r\n        private void ReadBlock(byte[] dataToWrite, int readSize, List<byte> dataForRead=null) {\r\n            byte[] tempData = new byte[readSize];\r\n            for (int i = 0; i < 10; i++) {\r\n                serialPort.DiscardInBuffer();\r\n                serialPort.Write(dataToWrite, 0, dataToWrite.Length);\r\n                for (int j = 0; j < 10; j++) {\r\n                    if (serialPort.BytesToRead == readSize) {\r\n                        serialPort.Read(tempData, 0, tempData.Length);\r\n                        if (dataForRead != null) {\r\n                            dataForRead.Clear();\r\n                            dataForRead.AddRange(tempData);\r\n                        }\r\n                        return;\r\n                    }\r\n                    Thread.Sleep(100);\r\n                }\r\n            }\r\n            throw new TimeoutException(\"Нет связи с устройством!\");\r\n        }\r\n    }\r\n    //Тип устройства\r\n    [Flags]\r\n    public enum AppType : int {\r\n        ARCADIA_1 = 0x0228,\r\n        ARCADIA_2 = 0x0229\r\n    }\r\n    //Тип двигателя\r\n    [Flags]\r\n    public enum MotorType : int {\r\n        UNIVERSAL = 0x0101,\r\n        THREEPHASE_ARC_1 = 0x0161,\r\n        THREEPHASE_ARC_2 = 0x0178\r\n    }\r\n    //Тип команд управления\r\n    public enum CommandType {\r\n        DoorLock_ON,\r\n        DoorLock_OFF,\r\n        WashEV_ON,\r\n        WashEV_OFF, \r\n        PreWashEV_ON, \r\n        PreWashEV_OFF,\r\n        DrainPump_ON,\r\n        DrainPump_OFF,\r\n        Heater_ON,\r\n        Heater_OFF,\r\n        Motor_ON,\r\n        Motor_OFF\r\n    }\r\n    //Направление вращения\r\n    public enum MotorDirection {\r\n        LEFT,\r\n        WRIGHT\r\n    }\r\n}\r\n[/CSHARP]','f19abc56d8b57253d9cb824cd82fbf2d13af5f50',1,'2015-04-03 11:05:39','2015-04-03 11:05:39',1,NULL,NULL),(1710,'Кнопка','[HAML]<Window x:Class=\"WpfApplication1.MainWindow\"\r\n        xmlns=\"http://schemas.microsoft.com/winfx/2006/xaml/presentation\"\r\n        xmlns:x=\"http://schemas.microsoft.com/winfx/2006/xaml\"\r\n        Title=\"MainWindow\" Height=\"350\" Width=\"525\">\r\n    <Grid>\r\n        <Button Height=\"200\" Width=\"200\" Content=\"Funny Button\" Foreground=\"White\" FontSize=\"20\">\r\n            <Button.Background>\r\n                <LinearGradientBrush>\r\n                    <LinearGradientBrush.GradientStops>\r\n                        <GradientStop Offset=\"0.00\" Color=\"Red\"/>\r\n                        <GradientStop Offset=\"0.25\" Color=\"Blue\"/>\r\n                        <GradientStop Offset=\"0.50\" Color=\"Green\"/>\r\n                        <GradientStop Offset=\"0.75\" Color=\"Yellow\"/>\r\n                    </LinearGradientBrush.GradientStops>\r\n                </LinearGradientBrush>\r\n            </Button.Background>\r\n        </Button>\r\n    </Grid>\r\n</Window>[/HAML]','dc5eb72de2906efcb4bad18b3ee8d2a92438050b',1,'2015-04-07 13:29:19','2015-04-07 13:29:19',1,NULL,NULL),(1711,'Подсчет слова в тексте (моя первая регулярка)','[JAVA]ackage com.javarush.test.level19.lesson05.task02;\r\n\r\n/* Считаем слово\r\nСчитать с консоли имя файла.\r\nВывести в консоль количество слов \"world\", которые встречаются в файле.\r\nЗакрыть поток ввода.\r\n*/\r\n\r\nimport java.io.FileReader;\r\nimport java.io.IOException;\r\nimport java.util.Scanner;\r\nimport java.util.regex.Matcher;\r\nimport java.util.regex.Pattern;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException\r\n    {\r\n        Scanner scanner = new Scanner(System.in);\r\n        FileReader fileReader = new FileReader(scanner.nextLine());\r\n        scanner.close();\r\n        Pattern pattern = Pattern.compile(\"(\\\\s|^|\\\\r)[wW]orld(\\\\W|$)\");\r\n        int count = 0;\r\n        String s = \"\";\r\n        while (fileReader.ready()) {\r\n            s = s + (char) fileReader.read();\r\n        }\r\n        fileReader.close();\r\n        Matcher matcher = pattern.matcher(s);\r\n        while (matcher.find()) count++;\r\n        System.out.println(count);\r\n        scanner.close();\r\n        //System.out.println(s);\r\n    }\r\n}[/JAVA]','94401201ca958d44f1c04fba5499982eab0d6f69',1,'2015-04-08 05:36:13','2015-04-08 05:36:13',1,4,NULL),(1712,'Выбор целых чисел из строки в файле','[JAVA]package com.javarush.test.level19.lesson05.task03;\r\n\r\n/* Выделяем числа\r\nСчитать с консоли 2 имени файла.\r\nВывести во второй файл все числа, которые есть в первом файле.\r\nЧисла выводить через пробел.\r\nЗакрыть потоки ввода-вывода.\r\n\r\nПример тела файла:\r\n12 text var2 14 8v 1\r\n\r\nРезультат:\r\n12 14 1\r\n*/\r\n\r\nimport java.io.FileReader;\r\nimport java.io.FileWriter;\r\nimport java.io.IOException;\r\nimport java.util.Scanner;\r\nimport java.util.regex.Matcher;\r\nimport java.util.regex.Pattern;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException\r\n    {\r\n        Scanner scanner = new Scanner(System.in);\r\n        FileReader fileReader = new FileReader(scanner.nextLine());\r\n        FileWriter fileWriter = new FileWriter((scanner.nextLine()));\r\n        String string = \"\";\r\n        while (fileReader.ready()) {\r\n            string = string + (char) fileReader.read();\r\n        }\r\n        fileReader.close();\r\n        Pattern pattern = Pattern.compile(\"(\\\\b)\\\\d+(\\\\b)\");\r\n        Matcher matcher = pattern.matcher(string);\r\n        while (matcher.find()) {\r\n            fileWriter.write(matcher.group() + \" \");\r\n        }\r\n        fileWriter.close();\r\n    }\r\n}[/JAVA]','17d6ada841bcc3eff7f97286af9ba89c9b788fef',1,'2015-04-09 05:36:43','2015-04-09 05:36:43',1,4,NULL),(1713,'Обертка потока System.out','[JAVA]package com.javarush.test.level19.lesson08.task05;\r\n\r\n/* Дублируем текст\r\nСчитайте с консоли имя файла\r\nВ методе main подмените объект System.out написанной вами ридер-оберткой по аналогии с лекцией\r\nВаша ридер-обертка должна дублировать вывод всего текста в файл, имя которого вы считали\r\nВызовите готовый метод printSomething(), воспользуйтесь testString\r\nВерните переменной System.out первоначальный поток\r\nЗакройте поток файла\r\n\r\nПример вывода на экран:\r\nit\'s a text for testing\r\n\r\nПример тела файла:\r\nit\'s a text for testing\r\n*/\r\n\r\nimport java.io.ByteArrayOutputStream;\r\nimport java.io.FileWriter;\r\nimport java.io.IOException;\r\nimport java.io.PrintStream;\r\nimport java.util.Scanner;\r\n\r\npublic class Solution {\r\n    public static TestString testString = new TestString();\r\n\r\n    public static void main(String[] args) throws IOException\r\n    {\r\n        PrintStream temp = System.out;\r\n        Scanner scanner = new Scanner(System.in);\r\n        FileWriter fileWriter = new FileWriter(scanner.nextLine());\r\n        ByteArrayOutputStream byteArrayOutputStream = new ByteArrayOutputStream();\r\n        PrintStream stream = new PrintStream(byteArrayOutputStream);\r\n        System.setOut(stream);\r\n        testString.printSomething();\r\n        System.setOut(temp);\r\n        System.out.println(byteArrayOutputStream.toString());\r\n        fileWriter.write(byteArrayOutputStream.toString());\r\n        fileWriter.close();\r\n    }\r\n\r\n    public static class TestString {\r\n        public void printSomething() {\r\n            System.out.println(\"it\'s a text for testing\");\r\n        }\r\n    }\r\n}[/JAVA]','b394ca77f10225b894de9f9204853cd9ac66973e',1,'2015-04-09 08:14:16','2015-04-09 08:14:16',1,4,NULL),(1714,'Подсчет в файле','[JAVA]package com.javarush.test.level19.lesson10.home01;\r\n\r\n/* Считаем зарплаты\r\nВ метод main первым параметром приходит имя файла.\r\nВ этом файле каждая строка имеет следующий вид:\r\nимя значение\r\nгде [имя] - String, [значение] - double. [имя] и [значение] разделены пробелом\r\n\r\nДля каждого имени посчитать сумму всех его значений\r\nВсе данные вывести в консоль, предварительно отсортировав в возрастающем порядке по имени\r\nЗакрыть потоки\r\n\r\nПример входного файла:\r\nПетров 2\r\nСидоров 6\r\nИванов 1.35\r\nПетров 3.1\r\n\r\nПример вывода:\r\nИванов 1.35\r\nПетров 5.1\r\nСидоров 6.0\r\n*/\r\n\r\nimport java.io.FileReader;\r\nimport java.io.IOException;\r\nimport java.util.*;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException\r\n    {\r\n        //Создаем поток чтения из файла\r\n        Scanner scanner = new Scanner(System.in);\r\n        FileReader fileReader = new FileReader(scanner.nextLine());\r\n        scanner.close();\r\n\r\n        Map<String, Double> map = new HashMap<String, Double>(); //словарь для гранения пары \"Фамилия ЗП\"\r\n        ArrayList<String> list = new ArrayList<String>(); //список для сортировки словаря\r\n        String input = \"\"; //строка для считанных данных с файла\r\n        String key = \"\"; //сторока \"Фамилия\"\r\n        Double val = 0.0; //значение ЗП\r\n\r\n        //Считываем содержимое файла, закрываем поток\r\n        while (fileReader.ready())\r\n        {\r\n            input = input + (char) fileReader.read();\r\n        }\r\n        fileReader.close();\r\n\r\n        //Делим на строки, если в словаре нет такой фамилии,\r\n        // то добавляем нового человека, иначе пересчитываем ЗП существующего\r\n        String[] lines = input.split(\"\\n\");\r\n        for (int i = 0; i < lines.length; i++) {\r\n            key = lines[i].split(\" \")[0];\r\n            val = Double.parseDouble(lines[i].split(\" \")[1]);\r\n            if (!map.containsKey(key)) {\r\n                map.put(key, val);\r\n            }\r\n            else {\r\n                for (Map.Entry<String, Double> pair : map.entrySet()) {\r\n                    if (pair.getKey().equals(key)) pair.setValue(pair.getValue() + val);\r\n                }\r\n            }\r\n\r\n        }\r\n        fileReader.close();\r\n\r\n        //Заносим в список\r\n        for (Map.Entry<String, Double> pair : map.entrySet()) {\r\n            list.add(pair.getKey() + \" \" + pair.getValue());\r\n        }\r\n        //Сортируем список\r\n        Collections.sort(list, new Comparator<String>()\r\n        {\r\n            @Override\r\n            public int compare(String str1, String str2)\r\n            {\r\n                return str1.compareTo(str2);\r\n            }\r\n        });\r\n        //Выводим результат\r\n        for (String z : list) System.out.println(z);\r\n    }\r\n}[/JAVA]','a7a75ee6391597a70889af94458772da74875a6d',1,'2015-04-09 10:55:43','2015-04-09 10:55:43',1,4,NULL),(1715,'Исправить 1 ошибку (Супер-задача)','[B]Это код с ошибкой[/B]\r\n\r\n[JAVA]package com.javarush.test.level19.lesson10.home10;\r\n\r\nimport java.io.FileOutputStream;\r\nimport java.io.IOException;\r\nimport java.io.InputStream;\r\n\r\n/* Исправить ошибку\r\nПрограмма содержит всего 1 ошибку. Найди и исправь ее\r\n*/\r\n\r\npublic class Solution {\r\n    {\r\n        System.out.println(\"it\'s Solution class\");\r\n    }\r\n\r\n    public static void main(String... args) throws IOException {\r\n        try (\r\n                FileOutputStream outputStream = new FileOutputStream(\"c:/output.txt\");\r\n                InputStream is = Solution.class.getClassLoader().getResourceAsStream(\"/user/resources/avatar.gif\");\r\n        ) {\r\n            ;\r\n            byte[] b = new byte[is.available()];\r\n            outputStream.write(is.read(b));\r\n\r\n            int value = 123_456_789;\r\n            System.out.println(value);\r\n\r\n            Example result = null;\r\n            String s = \"a\";\r\n            switch (s) {\r\n                case \"a\": {\r\n                    result = new Solution().new A();\r\n                    break;\r\n                }\r\n                case \"b\": {\r\n                    result = new Solution().new B();\r\n                    break;\r\n                }\r\n                case \"c\": {\r\n                    result = new Solution().new C();\r\n                    break;\r\n                }\r\n            }\r\n\r\n            if (result instanceof A) {\r\n                C p = (C) result;\r\n                System.out.println(p.getClass().getSimpleName());\r\n            }\r\n\r\n        } catch (IOException e) {\r\n        }\r\n    }\r\n\r\n    interface Example {\r\n    }\r\n\r\n    class A implements Example {\r\n        {\r\n            System.out.println(\"it\'s A class\");\r\n        }\r\n    }\r\n\r\n    class B implements Example {\r\n        {\r\n            System.out.println(\"it\'s B class\");\r\n        }\r\n    }\r\n\r\n    class C extends A {\r\n        {\r\n            System.out.println(\"it\'s C class\");\r\n        }\r\n    }\r\n}\r\n[/JAVA]','26bf09f3ea2b8b94d37f1c64aeaa4a9519f7dbe8',1,'2015-04-09 12:28:30','2015-04-09 12:54:39',1,4,''),(1716,'Самый богатый','[JAVA]package com.javarush.test.level19.lesson10.home02;\r\n\r\n/* Самый богатый\r\nВ метод main первым параметром приходит имя файла.\r\nВ этом файле каждая строка имеет следующий вид:\r\nимя значение\r\nгде [имя] - String, [значение] - double. [имя] и [значение] разделены пробелом\r\n\r\nДля каждого имени посчитать сумму всех его значений\r\nВывести в консоль имена, у которых максимальная сумма\r\nИмена разделять пробелом либо выводить с новой строки\r\nЗакрыть потоки\r\n\r\nПример входного файла:\r\nПетров 0.501\r\nИванов 1.35\r\nПетров 0.85\r\n\r\nПример вывода:\r\nПетров\r\n*/\r\n\r\nimport java.io.FileReader;\r\nimport java.io.IOException;\r\nimport java.util.ArrayList;\r\nimport java.util.HashMap;\r\nimport java.util.Map;\r\nimport java.util.Scanner;\r\n\r\npublic class Solution {\r\n    public static void main(String[] args) throws IOException{\r\n        //Создаем поток чтения из файла\r\n        FileReader fileReader = new FileReader(args[0]);\r\n        Map<String, Double> map = new HashMap<String, Double>(); //словарь для гранения пары \"Фамилия ЗП\"\r\n        ArrayList<String> list = new ArrayList<String>(); //список для сортировки словаря\r\n        String input = \"\"; //строка для считанных данных с файла\r\n        String key = \"\"; //сторока \"Фамилия\"\r\n        Double val = 0.0; //значение ЗП\r\n        //Считываем содержимое файла, закрываем поток\r\n        while (fileReader.ready())\r\n        {\r\n            input = input + (char) fileReader.read();\r\n        }\r\n        fileReader.close();\r\n        //Делим на строки, если в словаре нет такой фамилии,\r\n        // то добавляем нового человека, иначе пересчитываем ЗП существующего\r\n        String[] lines = input.split(\"\\n\");\r\n        for (int i = 0; i < lines.length; i++) {\r\n            key = lines[i].split(\" \")[0];\r\n            val = Double.parseDouble(lines[i].split(\" \")[1]);\r\n            if (!map.containsKey(key)) {\r\n                map.put(key, val);\r\n            }\r\n            else {\r\n                for (Map.Entry<String, Double> pair : map.entrySet()) {\r\n                    if (pair.getKey().equals(key)) pair.setValue(pair.getValue() + val);\r\n                }\r\n            }\r\n\r\n        }\r\n        fileReader.close();\r\n        //Поиск максимума ЗП\r\n        double max = Double.MIN_VALUE;\r\n        for (Map.Entry<String, Double> pair : map.entrySet()) {\r\n            if (pair.getValue() > max) max = pair.getValue();\r\n        }\r\n        //Выводим челов с максимумом\r\n        for (Map.Entry<String, Double> pair : map.entrySet()) {\r\n            if (pair.getValue() == max) System.out.println(pair.getKey());\r\n        }\r\n    }\r\n}[/JAVA]','bfb617281b5a664e5060b8e54dd8c1d449382665',1,'2015-04-10 11:19:15','2015-04-10 11:19:15',1,4,NULL),(1718,'Unnamed #1718','[C_CPP]#include <iostream>\r\n#include <cmath>\r\n\r\ndouble f(double e)\r\n{\r\n    static const int MAGIC = 24829.38; //No-no-no, David Blaine, no-no-no! xD\r\n    e = 1. + e;\r\n    return MAGIC / e + MAGIC / pow(e, 2) + MAGIC / pow(e, 3) + MAGIC / pow(e, 4);\r\n}\r\n\r\nbool test(double e)\r\n{\r\n    return f(e) > 0.;\r\n}\r\n\r\nint ok(const double& e) {\r\n    std::cout << \"E: \" << e << std::endl << \"F(e): \" << f(e) << std::endl;\r\n    return 0;\r\n}\r\n\r\nint main(int argc, char *argv[])\r\n{\r\n    for(double e = -2.1; e <= 0.0; e += 0.001)\r\n        if(test(e))\r\n            return ok(e);\r\n    return 0;\r\n}[/C_CPP]','2642dc196a3fb7cbe1e32ec4ad5378cc4eda7153',1,'2015-04-14 02:39:53','2015-09-10 12:22:47',1,1,''),(1719,'Unnamed #1719','[C_CPP]#include <iostream>\r\n \r\nclass foo {\r\n    const int n;\r\n    public:\r\n        foo(int n) : n(n) {}\r\n        operator double()  {\r\n            // Перегрузка для double\r\n            return n + 1;\r\n        }\r\n        \r\n        operator int() {\r\n            // А здесь - для int\r\n            return n;\r\n        }\r\n};\r\n \r\nint main( ) {\r\n    double a = foo(1);\r\n    int b = foo(1);\r\n    \r\n    std::cout << a << \' \' << b;\r\n}[/C_CPP]','32544ac9a016690dcf72ab3e42116b76da4cbb59',1,'2015-04-19 08:44:13','2015-09-10 12:22:19',1,NULL,''),(1721,'JPassGen','[JAVA]package ru.ildwine.java.real.jpassgen;\r\n\r\nimport java.util.ArrayList;\r\nimport java.util.Collections;\r\nimport java.util.Random;\r\n\r\n/**\r\n * Created by ildwine on 24.04.2015.\r\n */\r\npublic class JPassGen {\r\n    //переменные класса\r\n    private final int N = 16;                                 //длина пароля\r\n    private final int Z = 6;                                  //число цифр\r\n    private final int uL = (N - Z) / 2;                       //число прописных букв\r\n    private ArrayList<String> pass = new ArrayList<String>(); //пароль\r\n    private Random random;                                    //генератор случайных чисел\r\n\r\n    public static void main(String[] args) {\r\n        JPassGen jPassGen = new JPassGen();\r\n        jPassGen.init();                                     //вызываем создание пароля\r\n        jPassGen.output();                                   //вызываем вывод\r\n    }\r\n\r\n    //создание пароля\r\n    private void init() {\r\n        //Инициируем Random\r\n        random = new Random();\r\n        //Инициируем массивы\r\n        for (int i = 0; i < N; i++) {\r\n            if (i < Z) pass.add((new Integer(random.nextInt(10))).toString());\r\n            else if (i <  Z + uL)  pass.add(new Character((char)(random.nextInt(26) + 65)).toString());\r\n            else if (i < N) pass.add(new Character((char)(random.nextInt(26)+97)).toString());\r\n        }\r\n        //перемешиваем массив символов\r\n        Collections.shuffle(pass);\r\n    }\r\n\r\n    //склеивание массива строк в строку...\r\n    private String plus(ArrayList<String> al) {\r\n        String z = \"\";\r\n        for (String x : al) {\r\n            z += x;\r\n        }\r\n        return z;\r\n    }\r\n\r\n    private void output() {\r\n        //выводим\r\n        System.out.println(plus(pass));\r\n    }\r\n}[/JAVA]','a68f5380130cb7b8875a51080453e255d4db12fd',1,'2015-04-24 13:59:00','2015-04-24 14:01:09',1,4,''),(13264,'Unnamed #13264','[JAVA]package ru.ildwine.java.test.wordtext;\r\n\r\n\r\n//Класс слово\r\npublic class Word {\r\n    private String word;\r\n\r\n    public Word(String word) {\r\n        this.word = word;\r\n    }\r\n\r\n    public String getWord() {\r\n        return word;\r\n    }\r\n\r\n    public void setWord(String word) {\r\n        this.word = word;\r\n    }\r\n}[/JAVA]\r\n\r\n\r\n[JAVA]package ru.ildwine.java.test.wordtext;\r\n\r\nimport java.util.ArrayList;\r\n\r\n//Класс предложение\r\npublic class Sentence {\r\n\r\n    private ArrayList<Word> sentence;\r\n    private String instance;\r\n\r\n    public Sentence(ArrayList<Word> sentence) {\r\n        this.sentence = sentence;\r\n        getInstance();\r\n    }\r\n\r\n    private String getSentence() {\r\n        for (int i = 0; i < sentence.size(); i++) {\r\n            instance = instance + sentence.get(i).getWord() + \" \";\r\n        }\r\n    }\r\n\r\n    public String getInstance() {\r\n        return instance;\r\n    }\r\n}[/JAVA]','2a18fc43e1337c2e80b10a6d5cbeb7d4bc0004e4',1,'2015-05-20 08:27:28','2015-05-20 08:27:28',1,NULL,NULL),(13265,'Данные флешки','Name: Kingston DataTraveler G3  (USB2.0)\r\n\r\nVID&PID: Vid_0951&Pid_1643\r\nSpeed: high speed\r\n\r\nVendor Description: \r\nProduct Description: \r\nSerial Number: \r\n\r\n\\\\.\\PHYSICALDRIVE6\r\n\\\\?\\usbstor#disk&ven_kingston&prod_datatraveler_g3&rev_1.00#5404a6f4e108fc81790123d4&0#{53f56307-b6bf-11d0-94f2-00a0c91efb8b}\r\nVendorID: Kingston\r\nProductID: DataTraveler G3\r\nProduct Revision: 1.00\r\nLogic Driver: H:\\  (Total Space: 0.00 MB, Free Space: 0.00 MB)\r\n','50e76b02d3fac1e2c44ea2b85118eeb55567fe7c',1,'2015-05-22 11:11:35','2015-05-22 11:11:35',1,NULL,NULL),(13266,'Вторая флеха','\r\n[XML]Volume: H:\r\nController: Phison 2151-56 (2136/2156)\r