 же хотят быть свободными от русских?\r\n- Да сэр, они хотят быть свободными от русских, но…\r\n- Что «но»?\r\n- Они потому и хотят быть свободными от русских…\r\n- Не понимаю вас, Смит…\r\n- С русскими у них и был порядок, сэр.\r\n- И что с того? Теперь у них будет свой порядок!\r\n- Они не хотят свой порядок, сэр. Они не хотят никакого порядка. Они для того и отделились от русских чтобы у них не было порядка, сэр.\r\n- Тогда объясните им… хм… замкнутый круг…\r\n- Да, сэр.\r\n- Но они же ненавидят русских!\r\n- Да, сэр.\r\n- Тогда объясните им, что им нужен свой порядок, чтобы не оказаться снова в лапах русских!\r\n- Так не получается, сэр.\r\n- Почему?\r\n- Они ненавидят порядок больше, чем русских, сэр…\r\n- Но позвольте, Смит! У вас же в подчинении есть психологи, политтехнологи… если нужно, мы дадим вам гипнотезеров! Можно же как-то приучить человека к порядку! Смит! Даже собаку можно!\r\n- Понимаете, сэр… даже не знаю, как вам объяснить…\r\n- Говорите, как есть, Смит!\r\n- Когда нам удается приучить украинца к порядку, он становится русским. Простите, сэр.\r\n[/TEX]','b30a4613276aa0c78266999e9ba4b1bb33f0b207',1,'2015-05-26 05:04:30','2015-05-26 05:04:30',1,NULL,NULL),(13269,'Код без анонимного слушателя','[JAVA]import javax.swing.*;\r\nimport java.awt.event.ActionEvent;\r\nimport java.awt.event.ActionListener;\r\n\r\npublic class wwwe {\r\n    JFrame frame;\r\n    JButton button;\r\n\r\n    public wwwe(){\r\n        frame = new JFrame(\"Windows\");//создать форму\r\n        frame.setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);\r\n        frame.setSize(100, 100);\r\n        button = new JButton(\"OK\"); //создать кнопку\r\n        button.addActionListener(new myListener()); //добавляем кнопке слушателя событий\r\n        frame.add(button); //добавить кнопку к форме\r\n        frame.setVisible(true); //отобразить форму\r\n    }\r\n\r\n    public static void main(String[] args) {\r\n        SwingUtilities.invokeLater(new Runnable() {\r\n            @Override\r\n            public void run() {\r\n                new wwwe();\r\n            }\r\n        });\r\n    }\r\n}\r\n\r\n// класс слушатель событий кнопки\r\nclass myListener implements ActionListener {\r\n\r\n    @Override\r\n    public void actionPerformed(ActionEvent e) {\r\n        if (e.getActionCommand().equals(\"OK\")) {\r\n            //какие то действия кнопки...\r\n            //например выход с проги\r\n            System.exit(0);\r\n        }\r\n    }\r\n}[/JAVA]','44b97f50429ee0d2b1982b09474a1bacabb78b67',1,'2015-05-27 17:58:26','2015-05-27 17:58:26',1,4,NULL),(13270,'Код с анонимным классом слушателем','[JAVA]import javax.swing.*;\r\nimport java.awt.event.ActionEvent;\r\nimport java.awt.event.ActionListener;\r\n\r\npublic class wwwe {\r\n    JFrame frame;\r\n    JButton button;\r\n\r\n    public wwwe(){\r\n        frame = new JFrame(\"Windows\");//создать форму\r\n        frame.setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);\r\n        frame.setSize(100, 100);\r\n        button = new JButton(\"OK\"); //создать кнопку\r\n        button.addActionListener(new ActionListener() {\r\n            @Override\r\n            public void actionPerformed(ActionEvent e) {\r\n                //какие то действия кнопки...\r\n                //например выход с проги\r\n                System.exit(0);\r\n            }\r\n        });\r\n        frame.add(button); //добавить кнопку к форме\r\n\r\n        frame.setVisible(true); //отобразить форму\r\n    }\r\n\r\n    public static void main(String[] args) {\r\n        SwingUtilities.invokeLater(new Runnable() {\r\n            @Override\r\n            public void run() {\r\n                new wwwe();\r\n            }\r\n        });\r\n    }\r\n}[/JAVA]','aad41a401cb73dfa330b6d0a37b18379894cc58b',1,'2015-05-27 18:08:49','2015-05-27 18:08:49',1,4,NULL),(13271,'Код с лямбдой вместо анонимного класса','[JAVA]import javax.swing.*;\r\nimport java.awt.event.ActionEvent;\r\nimport java.awt.event.ActionListener;\r\n\r\npublic class wwwe 