OOT . \'/protected/templates/\' . $page . \'.php\') || showError();\r\n\r\n//get title for current page\r\n$title = $pages[$page];\r\n//include needed template\r\ninclude ROOT . \'/protected/templates/layouts/main.php\';[/PHP]\r\n\r\n[B]protected/config.php[/B]\r\n[PHP]<?php\r\ndefined(\'HOME\') or define(\'HOME\', dirname($_SERVER[\'SCRIPT_NAME\'])); //home dir for URL\r\ndefined(\'ROOT\') or define(\'ROOT\', rtrim(realpath(__DIR__ . \'./../\'), \'/\')); //root dir for includes\r\ndefined(\'DEBUG\') or define(\'DEBUG\', true); //debug mode\r\ndefined(\'IS_GUEST\') or define(\'IS_GUEST\', empty($_SESSION[\'user_id\'])); //is guest?\r\n\r\n//allowed pages and title for them\r\n$pages = array(\r\n	\'main\' => \'Фонотека - список жанров\',\r\n	\'category\' => \'Просмотр жанра\',\r\n    \'songs\' => \'Список песен\',\r\n    \'add_song\' => \'Добавление песни\',\r\n    \'edit_song\' => \'Редактирование информации о песне\',\r\n    \'delete_song\' => \'Удаление песни\',\r\n    \'add_category\' => \'Добавление жанра\',\r\n    \'edit_category\' => \'Редактирование жанра\',\r\n    \'delete_category\' => \'Удаление жанра\',\r\n    \'authors\' => \'Список авторов\',\r\n    \'add_author\' => \'Добавление автора\',\r\n    \'edit_author\' => \'Редактирование автора\',\r\n    \'delete_author\' => \'Удаление автора\',\r\n);\r\n\r\n//if template for page doesn\'t exists then create it\r\nforeach($pages as $page => $v)\r\n	file_exists(ROOT . \'/protected/templates/\' . $page . \'.php\') || file_put_contents(ROOT . \'/protected/templates/\' . $page . \'.php\', NULL);[/PHP]\r\n[PHP]protected/db.php[/PHP]\r\n	[PHP]<?php\r\n//get DB connect\r\ntry {\r\n	$db = new PDO(\'mysql:host=localhost;dbname=record_library;port=3307\', \'root\', \'usbw\');\r\n	$db->exec(\'SET NAMES \"utf8\"\');\r\n	//set error level for database object\r\n	DEBUG && $db->setAttribute(PDO::ATTR_ERRMODE, PDO::ERRMODE_EXCEPTION);\r\n}\r\ncatch(PDOException $e) {\r\n    if(DEBUG)\r\n		echo $e->getMessage();\r\n	else\r\n		showError(\'Error! Please, check site\');\r\n}[/PHP]\r\n[B]protected/functions.php[/B]\r\n[PHP]<?php\r\n\r\n//escape string for protect from XSS and other\r\nfunction encode($text, $quote_style=ENT_QUOTES, $charset=\'UTF-8\', $double_encode=true) {\r\n	return htmlspecialchars($text, $quote_style, $charset, $double_encode);\r\n}\r\n\r\n//show given or default error and exit\r\nfunction showError($message=\'Error: Page Not Found\') {\r\n	exit($message);\r\n}\r\n\r\nfunction homeDir() {\r\n	return HOME;\r\n}\r\nfunction urlSuffix() {\r\n	return \'.html\';\r\n}\r\n\r\n//make path for css\r\nfunction cssUrl($file) {\r\n    return homeDir() . \'/css/\' . str_replace(\'.css\', \'\', $file) . \'.css\';\r\n}\r\n//make html-tag for css file\r\nfunction css($file) {\r\n    return \'<link href=\"\' . cssUrl($file) . \'\" rel=\"stylesheet\" type=\"text/css\">\';\r\n}\r\n//make path for js\r\nfunction jsUrl($file) {\r\n    return homeDir() . \'/js/\' . str_replace(\'.js\', \'\', $file) . \'.js\';\r\n}\r\n//make js-tag for js file\r\nfunction js($file) {\r\n    return \'<script src=\"\' . jsUrl($file) . \'\" type=\"text/javascript\"></script>\';\r\n}\r\n\r\n\r\n//create url for given path\r\nfunction createUrl() {\r\n	$url_parts = func_get_args();\r\n	//return NULL if nothing given\r\n	if(empty($url_parts))\r\n		return NULL;\r\n	//return created path for given url parts\r\n	return encode(homeDir() . DIRECTORY_SEPARATOR . trim(join(DIRECTORY_SEPARATOR, $url_parts), \'/\') . urlSuffix());\r\n	\r\n}\r\nfunction auth(PDO $db, array $values)\r\n{\r\n	if(!userExists($db, $values))\r\n		return false;\r\n	$res = $db->prepare(\'SELECT `user_id` FROM `users` WHERE `username` = ? AND `password` = ? LIMIT 1\');\r\n	$res->execute(array($values[\'username\'], sha1(\'$#Y*&$@*&^@#($)\' . $values[\'password\'] . \'$%&#$*@#^*%$#@%$#@^*#@$\')));\r\n	$row = $res->fetch(PDO::FETCH_NUM);\r\n	return $_SESSION[\'user_id\'] = $row[0];\r\n}\r\n\r\nfunction userExists(PDO $db, array $values) {\r\n	array_walk($values, \'trim\');\r\n	if(empty($values[\'username\']) || empty($values[\'password\']))\r\n		return false;\r\n	$res = $db->prepare(\'SELECT COUNT(1) FROM `users` WHERE `username` = ? AND `password` = ?\');\r\n	$res->execute(array($values[\'username\'], sha1(\'$#Y*&$@*&^@#($)\' . $values[\'password\'] . \'$%&#$*@#^*%$#@%$#@^*#@$\')));\r\n	$row = $res->fetch(PDO::FETCH_NUM);\r\n	return !empty($row[0]);\r\n}\r\nfunction isGuest() {\r\n	return empty($_SESSION[\'user_id\']);\r\n}\r\nfunction isAdmin(PDO $db) {\r\n	if(empty($_SESSION[\'user_id\']))\r\n		return false;\r\n	$res = $db->prepare(\'SELECT COUNT(1) FROM `users` WHERE `user_id` = ? AND `status` = 3\');\r\n	$res->execute(array((int) $_SESSION[\'user_id\']));\r\n	$row = $res->fetch(PDO::FETCH_NUM);\r\n	return !empty($row[0]);\r\n}\r\nfunction getUser(PDO $db)\r\n{\r\n	static $info = NULL;\r\n	if( IS_GUEST )\r\n		return (object) [\'username\' => \'\'];\r\n	if($info)\r\n		return $info;\r\n	$res = $db->prepare(\'SELECT * FROM `users` WHERE `user_id` = ? LIMIT 1\');\r\n	$res->execute(array((int) $_SESSION[\'user_id\']));\r\n	return $info = $res->fetch(PDO::FETCH_OBJ);\r\n}\r\n\r\n//transliteration for text, replace cyrillic to english letters\r\nfunction t($text) {\r\n	return strtr($text, array(\'а\'=>\'a\', \'б\'=>\'b\', \'в\'=>\'v\', \'г\'=>\'g\', \'д\'=>\'d\', \'е\'=>\'e\', \'ж\'=>\'g\', \'з\'=>\'z\', \'и\'=>\'i\', \'й\'=>\'y\', \'к\'=>\'k\', \'л\'=>\'l\', \'м\'=>\'m\', \'н\'=>\'n\', \'о\'=>\'o\', \'п\'=>\'p\', \'р\'=>\'r\', \'с\'=>\'s\', \'т\'=>\'t\', \'у\'=>\'u\', \'ф\'=>\'f\', \'ы\'=>\'i\', \'э\'=>\'e\', \'А\'=>\'A\', \'Б\'=>\'B\', \'В\'=>\'V\', \'Г\'=>\'G\', \'Д\'=>\'D\', \'Е\'=>\'E\', \'Ж\'=>\'G\', \'З\'=>\'Z\', \'И\'=>\'I\', \'Й\'=>\'Y\', \'К\'=>\'K\', \'Л\'=>\'L\', \'М\'=>\'M\', \'Н\'=>\'N\', \'О\'=>\'O\', \'П\'=>\'P\', \'Р\'=>\'R\', \'С\'=>\'S\', \'Т\'=>\'T\', \'У\'=>\'U\', \'Ф\'=>\'F\', \'Ы\'=>\'I\', \'Э\'=>\'E\', \'ё\'=>\'yo\', \'х\'=>\'h\', \'ц\'=>\'ts\', \'ч\'=>\'ch\', \'ш\'=>\'sh\', \'щ\'=>\'shch\', \'ъ\'=>\'\', \'ь\'=>\'\', \'ю\'=>\'yu\', \'я\'=>\'ya\', \'Ё\'=>\'YO\', \'Х\'=>\'H\', \'Ц\'=>\'TS\', \'Ч\'=>\'CH\', \'Ш\'=>\'SH\', \'Щ\'=>\'SHCH\', \'Ъ\'=>\'\', \'Ь\'=>\'\', \'Ю\'=>\'YU\', \'Я\'=>\'YA\'));\r\n}[/PHP]\r\n[B]protected/templates/layouts/main.php[/B]\r\n[PHP]<!DOCTYPE html>\r\n<html>\r\n<head>\r\n<meta charset=\"utf-8\">\r\n<title><?php echo encode($title); ?></title>\r\n<?php echo css(\'styles.css\'), PHP_EOL, js(\'javascript.js\'); ?>\r\n</head>\r\n<body>\r\n<div id=\"wrapper\">\r\n    <div id=\"menu\">\r\n		<?php if( ! IS_GUEST) : ?>\r\n			Добро пожаловать, <b><?php echo encode(getUser($db)->username); ?></b>\r\n			<br><a href=\"?exit\">Выйти</a><br><br>\r\n		<?php endif; ?>\r\n        <a href=\"<?php echo HOME; ?>\">Главная</a><br>\r\n        <hr>\r\n        <a href=\"<?php echo createUrl(\'add_category\'); ?>\">Добавить жанр</a><br>\r\n        <a href=\"<?php echo createUrl(\'edit_category\'); ?>\">Редактировать жанр</a><br>\r\n        <a href=\"<?php echo createUrl(\'delete_category\'); ?>\">Удалить жанр</a><br>\r\n        <hr>\r\n        <a href=\"<?php echo createUrl(\'songs\'); ?>\">Все песни</a><br>\r\n        <a href=\"<?php echo createUrl(\'add_song\'); ?>\">Добавить песню</a><br>\r\n        <a href=\"<?php echo createUrl(\'edit_song\'); ?>\">Редактировать песню</a><br>\r\n        <a href=\"<?php echo createUrl(\'delete_song\'); ?>\">Удалить песню</a><br>\r\n        <hr>\r\n        <a href=\"<?php echo createUrl(\'authors\'); ?>\">Все исполнители</a><br>\r\n        <a href=\"<?php echo createUrl(\'add_author\'); ?>\">Добавить исполнителя</a><br>\r\n        <a href=\"<?php echo createUrl(\'edit_author\'); ?>\">Редактировать исполнителя</a><br>\r\n        <a href=\"<?php echo createUrl(\'delete_author\'); ?>\">Удалить исполнителя</a><br>\r\n		<?php if(IS_GUEST) : ?>\r\n			<form method=\"post\">\r\n				<br>Логин:<br>\r\n				<input type=\"text\" name=\"username\" placeholder=\"username\">\r\n				<br>Пароль:<br>\r\n				<input type=\"password\" name=\"password\" placeholder=\"password\">\r\n				<br>\r\n				<input type=\"submit\" value=\"Войти\">\r\n				<br>\r\n				<br>\r\n			</form>\r\n		<?php endif; ?>\r\n    </div>\r\n    <div id=\"content\">\r\n        <?php include ROOT . \'/protected/templates/\' . $page . \'.php\'; ?>\r\n    </div>\r\n</div>\r\n</body>\r\n</html>[/PHP]\r\n[B]protected/templates/songs.php[/B]\r\n[PHP]<?php\r\n\r\n//get count of records in database\r\n$res = $db->query(\'SELECT COUNT(1) FROM `records`\');\r\n$count = $res->fetch(PDO::FETCH_NUM);\r\nif(empty($count[0])) : ?>\r\n	Песен не найдено..\r\n<?php else :\r\n	//get records from database\r\n	$res = $db->query(\'SELECT * FROM `records`\r\n		LEFT JOIN `authors` USING(`author_id`)\r\n		LEFT JOIN `categories` USING(`category_id`)\r\n		LEFT JOIN `albums` USING(`album_id`)\r\n		ORDER BY `surname`, `song_name`\');\r\n	while($song = $res->fetch(PDO::FETCH_OBJ)) : ?>\r\n	<?php if(!file_exists(ROOT . \'/songs/\' . encode($song->path)))\r\n				continue; ?>\r\n		<div class=\"song\">\r\n			<?php echo encode(trim($song->surname . \' \' . $song->name)), \' - \', encode($song->song_name); ?>:<br>\r\n			<audio src=\"<?php echo HOME; ?>/songs/<?php echo encode($song->path); ?>\" controls>\r\n				Ваш браузер не поддерживает тег <?php echo encode(\'<audio>\'); ?>\r\n			</audio>\r\n			<br>\r\n			<small><i>\r\n			Description: <?php echo encode($song->title); ?><br>\r\n			Rate: <?php echo (int) $song->rate; ?><br>\r\n			</i></small>\r\n			<hr>\r\n		</div>\r\n<?php endwhile;\r\nendif;[/PHP]','321fe62a4dac18ea9599807a565b28ca5d62ba11',1,'2015-07-11 10:41:24','2015-07-11 16:19:59',1,1,''),(13275,'111','[CSHARP]using System;\r\nusing System.Collections.Generic;\r\nusing System.Linq;\r\nusing System.Text;\r\n\r\nusing System.Runtime.InteropServices;\r\n\r\nnamespace ConsoleApplication1 {\r\n    class Program {\r\n        [DllImport(\"usbdm.4.dll\", EntryPoint=\"USBDM_Init@0\")]\r\n        static extern int USBDM_Init();\r\n        [DllImport(\"usbdm.4.dll\", EntryPoint=\"USBDM_FindDevices@4\")]\r\n        static extern void USBDM_FindDivices(ref int count);\r\n        static unsafe void Main(string[] args) {\r\n            try {\r\n                int result = USBDM_Init();\r\n                int count = 0;\r\n                USBDM_FindDivices(ref count);\r\n            }\r\n            catch (Exception ex) {\r\n                Console.WriteLine(ex.Message);\r\n            }\r\n            Console.ReadLine(); \r\n        }\r\n    }\r\n}\r\n[/CSHARP]','f52e46b2009a1bfaf570df5f4c9ae9a3de29c28a',1,'2015-08-07 19:45:28','2015-08-07 19:45:28',1,NULL,NULL),(13276,'Макрос VBA','[VISUALBASIC]Sub Macro1()\r\n    Range(\"A4\").Select\r\n    ActiveCell.FormulaR1C1 = \"20000\"\r\n    Range(\"B4\").Select\r\n    ActiveCell.FormulaR1C1 = \"3/12/2015\"\r\n    Range(\"C4\").Select\r\n    ActiveCell.FormulaR1C1 = \"Сосновское ЛПУ МГ\"\r\n    Range(\"D4\").Select\r\n    ActiveCell.FormulaR1C1 = \"Сидоров О. А.\"\r\n    Range(\"E4\").Select\r\n    ActiveCell.FormulaR1C1 = \"принтер HP LJ 1300\"\r\n    Range(\"F4\").Select\r\n    ActiveCell.FormulaR1C1 = \"CNBD123456\"\r\n    Range(\"G4\").Select\r\n    ActiveCell.FormulaR1C1 = \"QWE-123333\"\r\n    Range(\"H4\").Select\r\n    ActiveCell.FormulaR1C1 = \"плохое качество печати\"\r\n    Range(\"I4\").Select\r\n    ActiveCell.FormulaR1C1 = \"Иванов А. В.\"\r\n    Range(\"J4\").Select\r\n    ActiveCell.FormulaR1C1 = \"с картриджем\"\r\n    Range(\"K4\").Select\r\n    ActiveCell.FormulaR1C1 = \"срочно!\"\r\n    Range(\"K5\").Select\r\nEnd Sub[/VISUALBASIC]','55c95cfe7717bfcc8a4bd4f2f28069558f52f247',1,'2015-08-18 11:31:38','2015-08-18 11:32:58',1,4,''),(13277,'Helper (TreeFrog)','[C_CPP]#include \"applicationhelper.h\"\r\n\r\nQString ApplicationHelper::paginationLinks(const int& pageNumber, const int& pagesCount, const QString& linkName, const int& show)\r\n{\r\n    QString links = \"\";\r\n\r\n    if(pagesCount == 1)\r\n        return links;\r\n\r\n    if(pageNumber > 1)\r\n    {\r\n        links.append(\r\n                    QString(\r\n                        \"<a class=\\\"first_page\\\" href=\\\"?%1=1\\\"> «« </a>\"\r\n                        \"<a class=\\\"previous_page\\\" rel=\\\"prev\\\" href=\\\"?%1=%2\\\"> « </a>\"\r\n                        ).arg(linkName).arg(pageNumber - 1)\r\n                    );\r\n    }\r\n\r\n    int start = pageNumber - show;\r\n    if(start < 1)\r\n        start = 1;\r\n    int end = pageNumber + show;\r\n    if(end > pagesCount)\r\n        end = pagesCount;\r\n\r\n    for(int i = start; i <= end; ++i)\r\n    {\r\n        if(pageNumber == i)\r\n            links += QString(\"<em class=\\\"current\\\">%1</em>\").arg(i);\r\n        else\r\n            links += QString(\"<a href=\\\"?%1=%2\\\">%2</a>\").arg(linkName).arg(i);\r\n    }\r\n\r\n    if(pageNumber < pagesCount)\r\n    {\r\n        links.append(QString(\"<a class=\\\"next_page\\\" rel=\\\"next\\\" href=\\\"?%1=%2\\\"> » </a>\"\r\n                             \"<a class=\\\"last_page\\\" href=\\\"?%1=%4\\\"> »» </a>\").arg(linkName).arg(pageNumber + 1).arg(pagesCount));\r\n    }\r\n    return links;\r\n}\r\n\r\nQString ApplicationHelper::truncate(const QString& str, const int& size, const QString& separator)\r\n{\r\n    if(str.size() > size)\r\n        return str.left(size) + separator;\r\n    return str;\r\n}\r\nQUrl ApplicationHelper::createUrl(const QString& url, const QString& page)\r\n{\r\n    return createUrl(url, page.toInt());\r\n}\r\n\r\nQUrl ApplicationHelper::createUrl(const QStringList &urlParts, const QString& page)\r\n{\r\n    return createUrl(urlParts.join(\'/\'), page);\r\n}\r\n\r\nQUrl ApplicationHelper::createUrl(const QString& url, const int& page)\r\n{\r\n    const QString urlSuffix = url.endsWith(\".html\") ? \"\" : \".html\";\r\n    const QString urlRoot = url.startsWith(\'/\') ? \"\": \"/\";\r\n    if(page < 2)\r\n        return QUrl(urlRoot + url + urlSuffix);\r\n    return QUrl(QString(\"%1%2%3?page=%4\").arg(urlRoot, url, urlSuffix).arg(page));\r\n}\r\n\r\nQString ApplicationHelper::parseCode(const QString &code, bool getLangOnly)\r\n{\r\n    QFile f(\"./languages.txt\");\r\n\r\n    if(!f.open(QIODevice::ReadOnly))\r\n        return code;\r\n    QString languages = \"\";\r\n\r\n    QTextStream in(&f);\r\n    while(!in.atEnd())\r\n    {\r\n        QString line = in.readLine();\r\n        line.resize(line.indexOf(\':\'));\r\n        line = line.trimmed();\r\n        languages += line + \'|\';\r\n    }\r\n    f.close();\r\n\r\n    if(languages.size())\r\n        languages.resize(languages.length() - 1);\r\n    languages = languages.toUpper();\r\n\r\n    QString result = code;\r\n\r\n    QRegExp rx(\"\\\\[(\" + languages + \")\\\\](.*)\\\\[/\\\\1\\\\]\", Qt::CaseInsensitive);\r\n    rx.setMinimal(true);\r\n\r\n    int s = -1;\r\n\r\n    while((s = rx.indexIn(result, s+1)) >= 0)\r\n    {\r\n        QString name = codeFile(rx.cap(1).trimmed().toUpper());\r\n        if(getLangOnly)\r\n            return rx.cap(1);\r\n        result.replace(rx.cap(0), QString(\"<h6><b>%1 %2</b></h6><pre class=\'editor\' lang=\'%3\'>%4</pre>\").arg(\r\n           H::tr(\"Code\"), codeTitle(name).toHtmlEscaped(), name.toHtmlEscaped(), rx.cap(2).toHtmlEscaped()\r\n        ));\r\n        s+= rx.cap(1).length();\r\n    }\r\n\r\n    rx.setPattern(\"\\\\[img\\\\](https?://[^<>]+)\\\\[/img\\\\]\");\r\n    result.replace(rx, \"<a href=\'\\\\1\' rel=\'prettyPhoto[gallery]\'><img src=\\\\1\' class=\'attach\'></a>\");\r\n\r\n    const int BB_CODES_COUNT = 4;\r\n    const QString classes[BB_CODES_COUNT] = {\"bold\", \"cursive\", \"underline\", \"del\"};\r\n    const QString bb_codes[BB_CODES_COUNT] = {\"b\", \"i\", \"u\", \"s\"};\r\n\r\n    for(int i = 0; i < BB_CODES_COUNT; ++i)\r\n    {\r\n        rx.setPattern(\"\\\\[\" + bb_codes[i] + \"\\\\](.*)\\\\[/\" + bb_codes[i] + \"\\\\]\");\r\n        result.replace(rx, \"<span class=\'\" + classes[i] + \"\'>\\\\1</span>\");\r\n    }\r\n\r\n\r\n    return result;\r\n}\r\n\r\nQString ApplicationHelper::codeFile(const QString &tagName)\r\n{\r\n    QFile f(\"./languages.txt\");\r\n    if(!f.open(QIODevice::ReadOnly))\r\n        return tagName;\r\n\r\n    QTextStream in(&f);\r\n    while(!in.atEnd())\r\n    {\r\n        QString line = in.readLine().trimmed();\r\n        if(line.isEmpty())\r\n            continue;\r\n        QStringList words = line.left(line.indexOf(\':\')).trimmed().toUpper().split(\'|\');\r\n        line = line.mid(line.indexOf(\':\') + 1).trimmed();\r\n\r\n        for(const auto& word: words)\r\n            if(word == tagName)\r\n                return line;\r\n    }\r\n    f.close();\r\n\r\n    return \"php\";\r\n}\r\n\r\nQString ApplicationHelper::codeTitle(const QString &tagName)\r\n{\r\n    QFile f(\"./languages_titles.txt\");\r\n    if(!f.open(QIODevice::ReadOnly))\r\n        return tagName;\r\n\r\n    QTextStream in(&f);\r\n    while(!in.atEnd())\r\n    {\r\n        QString line = in.readLine().trimmed();\r\n        if(line.isEmpty())\r\n            continue;\r\n        QString word = line.left(line.indexOf(\':\')).trimmed();\r\n\r\n        if(word == tagName)\r\n            return line.mid(line.indexOf(\':\') + 1).trimmed();\r\n    }\r\n\r\n    f.close();\r\n\r\n    return tagName;\r\n}\r\n\r\nQString ApplicationHelper::getFlash(const QMap<QString, QString>& flash)\r\n{\r\n    if(flash.empty())\r\n        return \"\";\r\n    QMap<QString, QString> classes;\r\n    classes.insert(\"notice\", \"info\");\r\n    classes.insert(\"alert\", \"danger\");\r\n    classes.insert(\"success\", \"success\");\r\n    classes.insert(\"warning\", \"warning\");\r\n\r\n    QString result = \"\";\r\n\r\n    for(const auto& msg: flash.toStdMap())\r\n    {\r\n        if(!classes.contains(msg.first) || msg.second.trimmed().isEmpty())\r\n            continue;\r\n        result += QString(\"<div class=\\\"alert alert-%1\\\">%2</div>\\n\").arg(classes[msg.first], msg.second);\r\n    }\r\n    return result;\r\n}\r\n\r\nQMap<QString, QString> ApplicationHelper::codesTitles()\r\n{\r\n    QFile f(\"./languages_titles.txt\");\r\n    if(!f.open(QIODevice::ReadOnly))\r\n        return QMap<QString, QString>();\r\n\r\n    QMap<QString, QString> result;\r\n\r\n    QTextStream in(&f);\r\n    while(!in.atEnd())\r\n    {\r\n        QString line = in.readLine().trimmed();\r\n        if(line.isEmpty())\r\n            continue;\r\n        QStringList tag = line.trimmed().split(\": \");\r\n        result[tag[1].trimmed()] = tag[0].trimmed();\r\n    }\r\n\r\n    f.close();\r\n\r\n    return result;\r\n}\r\n\r\nQString ApplicationHelper::userStatusImage(const bool& isOnline)\r\n{\r\n    return QString(\"<img src=\\\"/images/user_%1line.gif\\\">\").arg(isOnline ? \"on\" : \"off\");\r\n}\r\n\r\nQString ApplicationHelper::language(const bool &updateNeeded)\r\n{\r\n    static QString lang;\r\n\r\n    if(lang.isEmpty() || updateNeeded)\r\n    {\r\n        QFile file(\"./translations/tr_language.txt\");\r\n\r\n        if(!file.open(QIODevice::ReadOnly))\r\n            return \"en\";\r\n\r\n        lang = file.readAll().trimmed();\r\n\r\n        file.close();\r\n    }\r\n    return lang;\r\n}\r\n\r\nQString ApplicationHelper::tr(const char *sourceText, const char *disambiguation, int n)\r\n{\r\n    static QTranslator translator;\r\n    static QString lang = language();\r\n\r\n    if(translator.isEmpty() || lang != language())\r\n    {\r\n        lang = language();\r\n        if(!translator.load(language(), \"./translations/\"))\r\n            return sourceText;\r\n    }\r\n\r\n    return translator.translate(\"H\", sourceText, disambiguation, n);\r\n}\r\n\r\nQString ApplicationHelper::imageResize(const QString& imagePath, const QString& imageType, const int &MAX_WIDTH, const int &MAX_HEIGHT, const bool &isAvatar)\r\n{\r\n    //generate new image name\r\n    const QString& hash = QCryptographicHash::hash(std::to_string(QDateTime::currentMSecsSinceEpoch()).c_str(), QCryptographicHash::Sha256).toHex();\r\n    const QString& dir = QString(\"./public/images/%1/\").arg(isAvatar ? \"avatars\" : \"uploads\");\r\n    const QString& newImageName = QString(\"image%1.%2\").arg(hash).arg(imageType.toLower());\r\n\r\n    //min size of image to scale\r\n    const int MIN_WIDTH = 150;\r\n    const int MIN_HEIGHT = 150;\r\n\r\n\r\n    //open image\r\n    QImage img(imagePath, imageType.toStdString().c_str());\r\n\r\n    //scale image if needed\r\n    if(img.width() >= MAX_WIDTH || img.height() >= MAX_HEIGHT)\r\n        img = img.scaled(MAX_WIDTH, MAX_HEIGHT, Qt::KeepAspectRatio, Qt::SmoothTransformation);\r\n    if(img.width() <= MIN_WIDTH || img.height() <= MIN_HEIGHT)\r\n        img = img.scaled(MIN_WIDTH, MIN_HEIGHT, Qt::IgnoreAspectRatio, Qt::FastTransformation);\r\n\r\n\r\n    //create file\r\n    QFile file(dir + newImageName);\r\n    file.open(QIODevice::WriteOnly);\r\n\r\n    //save image\r\n    bool saved = img.save(&file, imageType.toStdString().c_str());\r\n\r\n    file.close();\r\n    return saved ? newImageName : QString();\r\n}\r\n\r\nQString ApplicationHelper::specifiedClass(const QString &value)\r\n{\r\n    return value.trimmed().isEmpty() ? \" class=\'not_specified\'\" : \"\";\r\n}\r\nQString ApplicationHelper::specifiedText(const QString &value, const QString &returnValue)\r\n{\r\n    return value.trimmed().isEmpty() ? \"not_specified\" : (returnValue.isEmpty() ? value : returnValue);\r\n}\r\n\r\nbool ApplicationHelper::imageExists(const QString &path)\r\n{\r\n    QFileInfo checkFile(\"./public/images/\" + path);\r\n    return checkFile.exists() && checkFile.isFile();\r\n}\r\n\r\nQString ApplicationHelper::cycle(const QStringList& values)\r\n{\r\n    if(values.empty())\r\n        return QString();\r\n\r\n    static QStringListIterator it = values;\r\n\r\n    if(it.hasNext())\r\n        return it.next();\r\n    it.toFront();\r\n    return it.next();\r\n}[/C_CPP]','a69a468a486d9e827dbf7661472e7fd83e47220c',1,'2015-09-06 13:13:46','2015-09-27 13:12:12',1,1,''),(13278,'Unnamed #13278','[SQL]mysql> SELECT * FROM `products`;\r\n+------------+-----------+\r\n| product_id | product   |\r\n+------------+-----------+\r\n|          1 | Product 1 |\r\n|          2 | Product 2 |\r\n|          3 | Product 3 |\r\n|          4 | Product 4 |\r\n+------------+-----------+\r\n4 rows in set (0.00 sec)\r\n\r\nmysql> SELECT * FROM `images`;\r\n+----------+------------+------------+\r\n| image_id | product_id | image_path |\r\n+----------+------------+------------+\r\n|        1 |          1 | image_1    |\r\n|        2 |          1 | image_2    |\r\n|        3 |          1 | image_3    |\r\n|        4 |          2 | image_4    |\r\n+----------+------------+------------+\r\n4 rows in set (0.00 sec)\r\n\r\nmysql> SELECT *, GROUP_CONCAT(`image_path`) `product_images`\r\n    -> FROM `products`\r\n    -> LEFT JOIN `images` USING(`product_id`)\r\n    -> GROUP BY `product_id`;\r\n+------------+-----------+----------+------------+-------------------------+\r\n| product_id | product   | image_id | image_path | product_images          |\r\n+------------+-----------+----------+------------+-------------------------+\r\n|          1 | Product 1 |        1 | image_1    | image_1,image_2,image_3 |\r\n|          2 | Product 2 |        4 | image_4    | image_4                 |\r\n|          3 | Product 3 |     NULL | NULL       | NULL                    |\r\n|          4 | Product 4 |     NULL | NULL       | NULL                    |\r\n+------------+-----------+----------+------------+-------------------------+\r\n4 rows in set (0.00 sec)\r\n\r\nmysql>[/SQL]','33d0c95f960f2f1795d8e45fd2ebfd0bb5a88752',1,'2015-09-13 13:04:44','2015-09-13 13:07:48',1,1,''),(13279,'Unnamed #13279','[PHP]<?php\r\n   define(\'myeshop\', true);\r\n   include(\"include/db_connect.php\"); \r\n   include(\"functions/functions.php\");\r\n   \r\n   \r\n   $cat = clear_string($_GET[\"cat\"]);\r\n   $type = clear_string($_GET[\"type\"]);\r\n   \r\n   $sorting = $_GET[\"sort\"];   \r\n \r\nswitch ($sorting)\r\n{\r\n    case 