ng\">\r\n<p id=\"nav-breadcrumbs\"><a href=\"index.php\" >Главная страница</a> \\ <span>Все товары</span></p>\r\n<ul id=\"options-list\">\r\n<li>Вид: </li>\r\n<li><img id=\"style-grid\" src=\"/images/icon-grid.png\" /></li>\r\n<li><img id=\"style-list\" src=\"/images/icon-list.png\" /></li>\r\n<li>Сортировать:</li>\r\n<li><a id=\"select-sort\">\'.$sort_name.\'</a>\r\n<ul id=\"sorting-list\">\r\n<li><a href=\"view_cat.php?\'.$catlink.\'type=\'.$type.\'&sort=price-asc\" >От дешевых к дорогим</a></li>\r\n<li><a href=\"view_cat.php?\'.$catlink.\'type=\'.$type.\'&sort=price-desc\" >От дорогих к дешевым</a></li>\r\n<li><a href=\"view_cat.php?\'.$catlink.\'type=\'.$type.\'&sort=popular\" >Популярное</a></li>\r\n<li><a href=\"view_cat.php?\'.$catlink.\'type=\'.$type.\'&sort=news\" >Новинки</a></li>\r\n<li><a href=\"view_cat.php?\'.$catlink.\'type=\'.$type.\'&sort=brand\" >От А до Я</a></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</div>\r\n        <ul id=\"block-tovar-grid\">\r\n        \r\n        \';\r\n        \r\n        \r\n        do {\r\nif  ($row[\"image\"] != \"\" && file_exists(\"./uploads_images/\".$row[\"image\"]))\r\n{\r\n$img_path = \'./uploads_images/\'.$row[\"image\"];\r\n$max_width = 190; \r\n$max_height = 190; \r\n list($width, $height) = getimagesize($img_path); \r\n$ratioh = $max_height/$height; \r\n$ratiow = $max_width/$width; \r\n$ratio = min($ratioh, $ratiow); \r\n$width = intval($ratio*$width); \r\n$height = intval($ratio*$height);    \r\n}else\r\n{\r\n$img_path = \"/images/no-image.png\";\r\n$width = 200;\r\n$height = 200;\r\n} \r\n            echo \'\r\n            \r\n            <li>\r\n            <div class=\"manufacturer-grid\"><strong>Производитель: </strong><a href=\"\'.$row[\"link\"].\'\">\'.$row[\"manufacturer\"].\'</a></div>\r\n            <div class=\"block-images-grid\" >\r\n            \r\n            <img src=\"\'.$img_path.\'\" width=\"\'.$width.\'\" height=\"\'.$height.\'\" />\r\n            </div>\r\n\r\n            <p class=\"style-title-grid\"><a href=\"\">\'.$row[\"title\"].\'</a></p>\r\n            \r\n            <ul class=\"reviews-and-counts-grid\">\r\n            <li><img src=\"/images/eye-icon.png\"/><p>0</p></li>\r\n            <li><img src=\"/images/comment-icon.png\"/><p>0</p></li>\r\n            </ul>\r\n            \r\n            <div id=\"datasheet\"><img src=\"/images/pdf.png\"/><a target=\"_blank\" href=\"datasheet/\'.$datasheet_path.$row[\"datasheet\"].\'\">Datasheet</a></div>\r\n            <div id=\"check\"><img src=\"/images/check.png\"/><p class=\"quantity\">В наличии: <strong>\'.$row[\"quantity\"].\' шт.</strong></p></div>\r\n            \r\n            <a class=\"add-cart-style-grid\"><img src=\"/images/cart-icon.png\"/><p class=\"style-price-grid\">\'.$row[\"price\"].\'<strong>р.</strong></p></a>\r\n            \r\n            </li>\r\n            \';\r\n        }\r\n        while ($row = mysql_fetch_array($result));\r\n    \r\n?>\r\n</ul>\r\n\r\n<ul id=\"block-tovar-list\" >\r\n\r\n<?php\r\n	\r\n  $result = mysql_query(\"SELECT * FROM table_products WHERE visible=\'1\' $querycat ORDER BY $sorting $qury_start_num\",$link);  \r\n\r\nif (mysql_num_rows($result) > 0)\r\n{\r\n $row = mysql_fetch_array($result); \r\n \r\n do\r\n {\r\n\r\nif  ($row[\"image\"] != \"\" && file_exists(\"./uploads_images/\".$row[\"image\"]))\r\n{\r\n$img_path = \'./uploads_images/\'.$row[\"image\"];\r\n$max_width = 150; \r\n$max_height = 150; \r\n list($width, $height) = getimagesize($img_path); \r\n$ratioh = $max_height/$height; \r\n$ratiow = $max_width/$width; \r\n$ratio = min($ratioh, $ratiow); \r\n$width = intval($ratio*$width); \r\n$height = intval($ratio*$height);    \r\n}else\r\n{\r\n$img_path = \"/images/noimages80x70.png\";\r\n$width = 80;\r\n$height = 70;\r\n} \r\n  \r\n  echo \'\r\n            \r\n            <li>\r\n            <div class=\"block-images-list\" >\r\n            <img src=\"\'.$img_path.\'\" width=\"\'.$width.\'\" height=\"\'.$height.\'\" /></div>\r\n            <div id=\"block