ords (echo, print, for, ...)\r\n    replace(\"(?<!\\\\$)\\\\b(?:\" + keywords1 + \")\\\\b\", \"[color=#b1b100]\\\\0[/color]\", expr);\r\n    //other keywords (new, class, ...)\r\n    replace(\"(?<!\\\\$)\\\\b(?:\" + keywords2 + \")\\\\b\", \"[color=#000]\\\\0[/color]\", expr);\r\n    //functions\r\n    replace(\"(?<!\\\\$)\\\\b(?:\" + functions + \")\\\\b\", \"[color=#900]\\\\0[/color]\", expr);\r\n    //strings\r\n    replace(\"([\\\"\']).*?\\\\1\", \"[color=#00f]\\\\0[/color]\", expr);\r\n    //numbers\r\n    replace(\"(?<!\\\\[color=#)\\\\b\\\\d+\\\\b\", \"[color=#c6c]\\\\0[/color]\", expr);\r\n\r\n\r\n    std::cout << std::endl << expr << std::endl << std::endl;\r\n}[/C_CPP]\r\n\r\n[SH]kopoji@kopoji-System-Product-Name:~/Documents/CPP$ ./php\r\n\r\nEnter expr: \r\nfor($i = 0; $i < $res; ++$i) { echo \"Hello, $user!\"; }\r\n\r\n[color=#b1b100]for[/color][color=#090]([/color][color=#008]$i[/color] [color=#090]=[/color] [color=#c6c]0[/color][color=#090];[/color] [color=#008]$i[/color] [color=#090]<[/color] [color=#008]$res[/color][color=#090];[/color] [color=#090]++[/color][color=#008]$i[/color][color=#090])[/color] [color=#090]{[/color] [color=#b1b100]echo[/color] [color=#00f]\"Hello[color=#090],[/color] [color=#008]$user[/color][color=#090]![/color]\"[/color][color=#090];[/color] [color=#090]}[/color]\r\n\r\nkopoji@kopoji-System-Product-Name:~/Documents/CPP$[/SH]','aae78a8e9f1c153ca47f22615324a5c9ebc098dd',1,'2015-09-26 16:37:15','2015-09-26 17:30:23',1,1,''),(13292,'IC 0.5','Весь текст с тегами тут\r\n\r\n[C_CPP]Представляю новый UserScript: [b]IndentChanger[/b].\r\nОн позволяет уменьшать или увеличивать отступ кода прямо в окне редактирования сообщения или нового сообщения.\r\nНачинающие программисты часто копируют код прямо из сред разработки, причём участок кода может быть глубоко вложенным, поэтому может выглядеть некрасиво, вот так, например\r\n[csharp]textBox103.Text = Val[0];\r\n                     textBox104.Text = Val[1];\r\n                     textBox105.Text = Val[2];\r\n                     if (Val[3] != null) {\r\n                         textBox106.Text = Val[3];\r\n}[/csharp]\r\nЕсли у вас нет под рукой возможности изменить отступ вашего кода, то тут скрипт будет в самый раз.\r\n\r\n[b]Как пользоваться?[/b] Выделите в области редактирования или нового сообщения код, для которого вам необходимо изменить отступ и нажмите [i]Shift+Tab[/i] для уменьшения отступа и [i]Tab[/i] для увеличения отступа.\r\n\r\n[img]http://www.cyberforum.ru/members/268103/albums/600/5356.jpg[/img]\r\n\r\nОтступ по-умолчанию равен 4 пробелам, однако вы можете изменить его величину в поле внизу.\r\n\r\nПолный код тут:\r\n[spoiler][js]// ==UserScript==\r\n// @name       IndentChanger\r\n// @version    0.5\r\n// @match      http://www.cyberforum.ru/*\r\n// @author     tezaurismosis, Vlad_IT, KOPOJI\r\n// @grant      none\r\n// ==/UserScript==\r\n \r\nvar interval = setInterval(function() {\r\n    if(!document.getElementById(\'vB_Editor_QR_textarea\'))\r\n        return;\r\n    clearInterval(interval)\r\n    \r\n    var tab_size = 4, //размер табуляции по умолчанию\r\n        links = document.querySelectorAll(\'a[href*=editpost]\')\r\n    \r\n    this.onkeydown = catchKeyCombination\r\n    \r\n    for(var i = 0; i < links.length; ++i)\r\n        links[i].attachEvent ? links[i].attachEvent(\'onclick\', linksEdit) : links[i].addEventListener(\'click\', linksEdit)\r\n    \r\n    function linksEdit() {\r\n        var timer = setInterval(function() {\r\n            clearInterval(timer);\r\n            \r\n            document.querySelectorAll(\"input[id*=vB_Editor_QE]\")[0].parentNode.innerHTML += \r\n                \'<br>Размер отступов: <input id=\"tab_size_1\" type=\"number\" style=\"width:40px\" value=\"\' + tab_size + \'\"> \'\r\n            document.getElementById(\'tab_size_1\').onchange = function() {\r\n                tab_size = parseInt(this.value)\r\n                if(document.getElementById(\'tab_size\').value != this.value)\r\n                    document.getElementById(\'tab_size\').value = tab_size\r\n            }\r\n        }, 300)\r\n    }\r\n    \r\n    // Отключаем назначенные клавишам действия по-умолчанию\r\n    function preventActions(evt) {\r\n        if (evt.cancelable)\r\n            evt.preventDefault()\r\n    }\r\n    \r\n    if(!document.getElementById(\'tab_size\'))        \r\n        document.getElementById(\'cb_signature\').parentNode.parentNode.parentNode.innerHTML +=\r\n            \'Размер отступов: <input id=\"tab_size\" type=\"number\" style=\"width:40px\" value=\"\' + tab_size + \'\">\'\r\n    document.getElementById(\'tab_size\').onchange = function() {\r\n        tab_size = parseInt(this.value)\r\n        if(document.getElementById(\'tab_size_1\') && document.getElementById(\'tab_size_1\').value != this.value)\r\n            document.getElementById(\'tab_size_1\').value = tab_size\r\n    }\r\n    \r\n    function catchKeyCombination(evt) {\r\n        if(!document.activeElement || document.activeElement.tagName.toLowerCase() != \'textarea\')\r\n            return\r\n        evt = evt || window.event\r\n        \r\n        var focused = document.activeElement;\r\n        // Ничего не выделено - ничего не делаем\r\n        if ((focused && focused.selectionEnd - focused.selectionStart > 0) == false)\r\n            return\r\n        \r\n        //Shift + Tab\r\n        // Уменьшаем отступ\r\n        if (evt.shiftKey && evt.keyCode == 9) {\r\n            preventActions(evt)\r\n            decreaseIndent(focused)\r\n        }\r\n     \r\n        // Tab\r\n        // Увеличиваем отступ\r\n        if (!evt.shiftKey && evt.keyCode == 9) {\r\n            preventActions(evt)\r\n            increaseIndent(focused)\r\n        }\r\n        return\r\n    }\r\n     \r\n    // Возвращает количество пробелов в начале строки\r\n    function getStartSpacesCount(str) {\r\n        var index = 0\r\n        while (str[index++] == \" \")\r\n            ;\r\n        return --index\r\n    }\r\n    function getTabs()\r\n    {\r\n        var ret = \'\'\r\n        for(var i = 0; i < tab_size; ++i)\r\n            ret += \' \'\r\n        return ret\r\n    }\r\n     \r\n    // Увеличивает отступ\r\n    function increaseIndent(element) {\r\n        if (!element)\r\n            return;\r\n        var str = element.value.slice(element.selectionStart, element.selectionEnd),\r\n            lines = str.split(\"\\n\"),\r\n            result = \"\",\r\n            tabs = getTabs()\r\n        \r\n        for (var i = 0; i < lines.length; ++i)\r\n            result += tabs + lines[i] + \"\\n\"  // пробелы\r\n \r\n        // Убираем последний \\n\r\n        element.setRangeText(result.trimRight())\r\n    }\r\n     \r\n    // Уменьшает отступ\r\n    function decreaseIndent(element) {\r\n        if (!element)\r\n            return\r\n        // используем value\r\n        var str = element.value.slice(element.selectionStart, element.selectionEnd),\r\n            lines = str.split(\"\\n\"),\r\n            result = \"\",\r\n            tabs = getTabs()\r\n        for (var i = 0; i < lines.length; ++i)\r\n            if (getStartSpacesCount(lines[i]) >= tab_size)\r\n                result += lines[i].substring(tab_size, lines[i].length) + \"\\n\"\r\n            else\r\n                result += lines[i].trimLeft() + \"\\n\"\r\n \r\n        // Удаляем последний \\n\r\n        element.setRangeText(result.trimRight());\r\n    }\r\n}, 300)[/js][/spoiler]\r\n\r\nВыражаю благодарность [nick]Vlad_IT[/nick] за доведение первой версии скрипта до ума.\r\nОтдельная благодарность Михаилу ([nick]KOPOJI[/nick]) за добавление функционала изменения отступа, работу с Tab и другие многочисленные улучшения скрипта :handshake:[/C_CPP]','7999cbfc48dcfcb2e9e6bf0c02ad46ecb2c8a6c9',1,'2015-09-26 23:52:25','2015-09-27 13:31:55',1,NULL,''),(13293,'IC 0.5 2','Весь текст с тегами тут\r\n[C_CPP][CSHARP]\r\n[CODE]Представляю новый UserScript: [b]IndentChanger[/b].\r\nОн позволяет уменьшать или увелич