val($ratio*$width); \r\n$height = intval($ratio*$height);    \r\n\r\n}\r\n\r\nif(!empty($img_path1)) {\r\n    $img_path1 = \'./uploads_images/\'.$row[\"second_image\"];\r\n$max_width = 150; \r\n$max_height = 150; \r\n list($width, $height) = getimagesize($img_path); \r\n$ratioh = $max_height/$height; \r\n$ratiow = $max_width/$width; \r\n$ratio = min($ratioh, $ratiow); \r\n$width = intval($ratio*$width); \r\n$height = intval($ratio*$height);    \r\n}  \r\n  \r\n  echo \'\r\n            \r\n            <li>\r\n            \r\n            <div id=\"notebook_model\">Модель ноутбука: \'.$row[\"notebook_model\"].\'\r\n            \r\n            <ul class=\"reviews-and-counts-schemes\">\r\n            <li><img src=\"/images/eye-icon.png\"/><p>0</p></li>\r\n            <li><img src=\"/images/comment-icon.png\"/><p>0</p></li>\r\n            </ul>\r\n            \r\n            </div>\r\n            \r\n  \r\n            <div class=\"block-images-grid\" >\r\n            <img src=\"\'.$img_path.\'\" width=\"\'.$width.\'\" height=\"\'.$height.\'\" />\r\n            <img src=\"\'.$img_path1.\'\" width=\"\'.$width.\'\" height=\"\'.$height.\'\" />\r\n            </div>\r\n            \r\n             \r\n              \r\n            \r\n            <p class=\"scheme_description\">\'.$row[\"scheme_description\"].\'</p>\r\n            \r\n            </li>\r\n            \';\r\n        }\r\n    while ($row = mysql_fetch_array($result));\r\n     \r\n}\r\n}else\r\n{\r\n    echo \'<h3>Категория не доступна или не создана!</3>\';\r\n}    \r\n\r\necho \'</ul>\';\r\n\r\nif ($page != 1){ $pstr_prev = \'<li><a class=\"pstr-prev\" href=\"view_cat.php?page=\'.($page - 1).\'\">&lt;</a></li>\';}\r\nif ($page != $total) $pstr_next = \'<li><a class=\"pstr-next\" href=\"view_cat.php?page=\'.($page + 1).\'\">&gt;</a></li>\';\r\n\r\n\r\n// Формируем ссылки со страницами\r\nif($page - 5 > 0) $page5left = \'<li><a href=\"view_cat.php?\'.$catlink.\'type=\'.$type.\'&sort=\'.$_GET[\"sort\"].\'&page=\'.