uth-loading\").show();\r\n    \r\n  $.ajax({\r\n  type: \"POST\",\r\n  url: \"/include/remind-pass.php\",\r\n  data: \"email=\"+recall_email,\r\n  dataType: \"html\",\r\n  cache: false,\r\n  success: function(data) {\r\n\r\n  if (data == \'yes\')\r\n  {\r\n     $(\".auth-loading\").hide();\r\n     $(\"#button-remind\").show();\r\n     $(\'#message-remind\').attr(\"class\",\"message-remind-success\").html(\"На ваш e-mail выслан пароль.\").slideDown(400);\r\n     \r\n     setTimeout(\"$(\'#message-remind\').html(\'\').hide(),$(\'#block-remind\').hide(),$(\'#input-email-pass\').show()\", 3000);\r\n \r\n  }else\r\n  {\r\n      $(\".auth-loading\").hide();\r\n      $(\"#button-remind\").show();\r\n      $(\'#message-remind\').attr(\"class\",\"message-remind-error\").html(data).slideDown(400);\r\n      \r\n  }\r\n  }\r\n});[/JAVASCRIPT]\r\n\r\n===========================================================\r\n\r\n[PHP]<?php\r\nif($_SERVER[\"REQUEST_METHOD\"] == \"POST\")\r\n{\r\ndefine(\'myeshop\', true);    \r\ninclude(\"db_connect.php\");\r\ninclude(\"../functions/functions.php\");\r\n\r\n$email = clear_string($_POST[\"email\"]);\r\n\r\nif ($email != \"\")\r\n{\r\n    \r\n   $result = mysql_query(\"SELECT email FROM reg_user WHERE email=\'$email\'\",$link);\r\nIf (mysql_num_rows($result) > 0)\r\n{\r\n    \r\n// Генерация пароля.\r\n    $newpass = fungenpass();\r\n    \r\n// Шифрование пароля.\r\n    $pass   = md5($newpass);\r\n    $pass   = strrev($pass);\r\n    $pass   = strtolower(\"9nm2rv8q\".$pass.\"2yo6z\");    \r\n \r\n// Обновление пароля на новый.\r\n$update = mysql_query (\"UPDATE reg_user SET pass=\'$pass\' WHERE email=\'$email\'\",$link);\r\n\r\n    \r\n// Отправка нового пароля.\r\n   \r\n	         send_mail( \'noreply@shop.ru\',\r\n			             $email,\r\n						\'Новый пароль для сайта MyShop.ru\',\r\n						\'Ваш пароль: \'.$newpass);   \r\n   \r\n   echo \'yes\';\r\n    \r\n}else\r\n{\r\n    echo \'Данный E-mail<br/ >не найден!\';\r\n}\r\n\r\n}\r\nelse\r\n{\r\n    echo \'Укажите свой E-mail\';\r\n}\r\n\r\n}\r\n\r\n\r\n\r\n?>[/PHP]\r\n\r\n======================================================\r\n\r\n[PHP]<?php\r\nfunction fungenpass()\r\n{\r\n    $number = 7;\r\n\r\n    $arr = array(\'a\',\'b\',\'c\',\'d\',\'e\',\'f\',\r\n\r\n                 \'g\',\'h\',\'i\',\'j\',\'k\',\'l\',\r\n\r\n                 \'m\',\'n\',\'o\',\'p\',\'r\',\'s\',\r\n\r\n                 \'t\',\'u\',\'v\',\'x\',\'y\',\'z\',\r\n\r\n                 \'1\',\'2\',\'3\',\'4\',\'5\',\'6\',\r\n\r\n                 \'7\',\'8\',\'9\',\'0\');\r\n\r\n    // Генерируем пароль\r\n\r\n    $pass = \"\";\r\n\r\n    for($i = 0; $i < $number; $i++)\r\n\r\n    {\r\n\r\n      // Вычисляем случайный индекс массива\r\n\r\n      $index = rand(0, count($arr) - 1);\r\n\r\n      $pass .= $arr[$index];\r\n\r\n    }\r\n\r\n\r\nreturn $pass;\r\n}\r\n\r\n\r\nfunction send_mail($from,$to,$subject,$body)\r\n{\r\n	$charset = \'utf-8\';\r\n	mb_language(\"ru\");\r\n	$headers  = \"MIME-Version: 1.0 \\n\" ;\r\n	$headers .= \"From: <\".$from.\"> \\n\";\r\n	$headers .= \"Reply-To: <\".$from.\"> \\n\";\r\n	$headers .= \"Content-Type: text/html; charset=$charset \\n\";\r\n	\r\n	$subject = \'=?\'.$charset.\'?B?\'.base64_encode($subject).\'?=\';\r\n\r\n	mail($to,$subject,$body,$headers);\r\n}?>\r\n[/PHP]','1c1dc99ca8f57568c48070602353890f99006d1f',1,'2015-09-30 17:14:56','2015-09-30 17:14:56',1,NULL,NULL),(13304,'Парсер','[PHP]<?php header(\'Content-type: text/plain;charset=utf-8\');\r\n\r\nerror_reporting(-1);\r\nini_set(\'display_errors\', 1);\r\n\r\nset_time_limit(0);\r\nini_set(\'memory_limit\', \'128M\');\r\n\r\ninclude \'./simplehtmldom/simple_html_dom.php\';\r\n\r\ndefined(\'SITE\') or define(\'SITE\', \'http://online.semenasad.ru\');\r\n\r\nfunction debug($msg)\r\n{\r\n    printf(\"%s\\n\", $msg);\r\n}\r\n\r\nfunction parseCategory($url, $withPagination = true, $debug = true)\r\n{\r\n    $products = array();\r\n\r\n    $ch = curl_init($url);\r\n    curl_setopt($ch, CURLOPT_HEADER, 0);\r\n    curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);\r\n\r\n    $doc = str_get_html(curl_exec($ch));\r\n\r\n    $debug && debug(PHP_EOL . str_repeat(\'-\', 20) . PHP_EOL . \'Parsing products from url \"\' . $url . \'\"...\' . PHP_EOL . str_repeat(\'-\', 20));\r\n\r\n    foreach($doc->find(\'div[class=product]\') as $product)\r\n    {\r\n        $url = SITE . $product->find(\'div[class=price_box]\', 0)->find(\'a\', 0)->href;\r\n\r\n        $debug && debug(\'Parsing product \"\' . $url . \'\"...\');\r\n\r\n        curl_setopt($ch, CURLOPT_URL, $url);\r\n\r\n        $products[] = parseProduct($ch, $product->find(\'img[class=new_hit]\', 0));\r\n    }\r\n    $next = $doc->find(\'img.pagers_btns[title=Следующая]\', 0);\r\n\r\n    if($withPagination)\r\n    {\r\n        while(isset($next))\r\n        {\r\n            $a = $next->parent();\r\n            if(!isset($a, $a->href))\r\n                break;\r\n\r\n            curl_setopt($ch, CURLOPT_URL, SITE . $a->href);\r\n\r\n            $debug && debug(PHP_EOL . str_repeat(\'-\', 20) . PHP_EOL . \'Parsing products from url \"\' . SITE . $a->href . \'\"...\' . PHP_EOL . str_repeat(\'-\', 20));\r\n\r\n            $doc = str_get_html(curl_exec($ch));\r\n            foreach($doc->find(\'div[class=product]\') as $product)\r\n            {\r\n                $url = SITE . $product->find(\'div[class=price_box]\', 0)->find(\'a\', 0)->href;\r\n\r\n                curl_setopt($ch, CURLOPT_URL, $url);\r\n\r\n                $debug && debug(\'Parsing product \"\' . $url . \'\"...\');\r\n\r\n                $products[] = parseProduct($ch, $product->find(\'img[class=new_hit]\', 0));\r\n            }\r\n\r\n            $next = $doc->find(\'img.pagers_btns[title=Следующая]\', 0);\r\n        }\r\n    }\r\n\r\n    curl_close($ch);\r\n\r\n    return $products;\r\n}\r\n\r\nfunction parseProduct($ch, $isHit = NULL)\r\n{\r\n\r\n    $doc = str_get_html(curl_exec($ch));\r\n\r\n    $product = array();\r\n    $name = $doc->find(\'h1[class=name]\', 0);\r\n    if(!isset($name))\r\n        return NULL;\r\n    $product[\'name\'] = $name->plaintext;\r\n    $product[\'sub_name\'] = \'\';\r\n\r\n    if(NULL !== $doc->find(\'span[class=sub_name]\', 1))\r\n    {\r\n        $product[\'sub_name\'] = $doc->find(\'span[class=sub_name]\', 0)->plaintext;\r\n        $product[\'article\'] = $doc->find(\'span[class=sub_name]\', 1)->plaintext;\r\n    }\r\n    else\r\n        $product[\'article\'] = $doc->find(\'span[class=sub_name]\', 0)->plaintext;\r\n\r\n    $product[\'article\'] = preg_replace(\'~\\\\D+~\', \'\', $product[\'article\']);\r\n\r\n    $weight = $doc->find(\'span[class=count]\', 0);\r\n    $product[\'weight\'] = isset($weight) ? trim(preg_replace(\'~[^\\\\d,.]+~iu\', \'\', $weight->plaintext), \'.,\') : NULL;\r\n\r\n    $price = $doc->find(\'span[class=price]\', 0);\r\n    $product[\'price\'] = isset($price) ? trim(preg_replace(\'~[^\\\\d,.]+~iu\', \'\', $price->plaintext), \'.,\') : NULL;\r\n\r\n    $description = $doc->find(\'div[class=description] > p\', 0);\r\n    $product[\'description\'] = isset($description) ? trim($description->plaintext) : NULL;\r\n\r\n    $image = $doc->find(\'a[class=highslide]\', 0);\r\n    $product[\'image\'] = isset($image) ? SITE . $doc->find(\'a[class=highslide]\', 0)->href : NULL;\r\n\r\n    array_walk($product, \'trim\');\r\n\r\n    $product[\'hit\'] = isset($isHit);\r\n\r\n    //file_put_contents(\'test.jpg\', fopen($product[\'image\'], \'r\'));\r\n\r\n    return $product;\r\n}\r\n\r\n\r\nvar_export(parseCategory(\'http://online.semenasad.ru/catalog/vegetables_seeds-colorful-bags/index.html\'));[/PHP]','3f5e45a681e4517de887117b4abf8d9a8ee02cc8',0,'2015-10-11 18:23:46','2015-10-12 15:23:54',0,1,'cyberforum.ru'),(13305,'','Тест...',NULL,1,'2015-10-12 17:16:14','2015-10-13 00:24:45',1,0,'');
