INSERT INTO `private_messages` VALUES (1,1,2,'Привет =)','Тест o_O\r\nПока на мыло вроде ничего не должно прийти.. Сервак SMTP надо настраивать, но в общем пользоваться вроде можно. Правда, редактирование я пока убрал. Удаление - только у себя.. Просмотренные лс отображаются нежирным, непрочитанные - жирным (в отправленных также, пока получатель не просмотрит)\r\nКак-то так пока что :)\r\nЕдинственное - просьба, большие файлы не грузить, сервак валится... ((','file2bb13d4745d30b5dc3fd73147b2794464ce6edc98b8866aa75.docx',1,0,1,'2014-06-19 17:49:51','2014-06-26 15:46:19',NULL),(2,1,2,'Привет =)','Тест o_O\r\nПока на мыло вроде ничего не должно прийти.. Сервак SMTP надо настраивать, но в общем пользоваться вроде можно. Правда, редактирование я пока убрал. Удаление - только у себя.. Просмотренные лс отображаются нежирным, непрочитанные - жирным (в отправленных также, пока получатель не просмотрит)\r\nКак-то так пока что :)\r\nЕдинственное - просьба, большие файлы не грузить, сервак валится... ((','file1786dc3a5f056317146ce51bae92eda7d625152349c67238fe.docx',1,0,1,'2014-06-19 17:50:15','2014-06-26 15:46:17',NULL),(3,1,NULL,'Привет :)','Привет :смайл:\r\n:D',NULL,1,0,0,'2014-06-20 03:48:02','2014-06-20 13:45:53',NULL),(4,1,2,'Привет :)','Привет :смайл: \r\n:D',NULL,1,0,1,'2014-06-20 03:53:30','2014-06-26 15:46:16',NULL),(5,2,1,'Тыщ)','Михайло, допиливай)',NULL,0,0,1,'2014-06-20 11:25:16','2014-06-20 13:45:37',NULL),(6,2,1,'Код','[VISUALBASIC]Code[/VISUALBASIC]',NULL,0,0,1,'2014-06-21 11:24:47','2014-06-21 11:32:02',NULL),(7,1,NULL,'Test','[ERB]<% @message = user_to_id.present? || @private_message.text.blank? ? PrivateMessage.new : @private_message; %>\r\n\r\n<%= simple_form_for @message do |f| %>\r\n    <% if @message.errors.any? %>\r\n        <div id=\"error_explanation\">\r\n          <% if locale == :ru %>\r\n              <h2>Пожалуйста, исправьте следующие ошибки (<%= @message.errors.count %>):</h2>\r\n          <% else %>\r\n              <h2><%= pluralize(@message.errors.count, \'error\') %> prohibited\r\n                this message from being sent:</h2>\r\n          <% end %>\r\n\r\n          <ul>\r\n            <% @message.errors.full_messages.each do |msg| %>\r\n                <li><%= msg %></li>\r\n            <% end %>\r\n          </ul>\r\n        </div>\r\n    <% end %>\r\n\r\n    <div class=\"form-inputs\">\r\n      <% if user_to_id.present? && to_message_id.present? %>\r\n          <%= f.hidden_field :user_to_id, value: user_to_id.to_i %>\r\n          <%= f.hidden_field :to_message_id, value: to_message_id.to_i %>\r\n      <% else %>\r\n          <%= f.label :user_to_id, t(:user_to_id) %>\r\n          <%= f.collection_select :user_to_id, User.where.not(id: current_user.id).order(:username), :id, :username, include_blank: true %>\r\n      <% end %>\r\n      <%= f.label :title, t(:message_title) %>\r\n      <%= f.text_field :title, style: \'width: 600px\', autofocus: true, value: (to_message_id.present? && !@private_message.title.starts_with?(\'Re: \') ? \'Re: \' + @private_message.title : @private_message.title) %>\r\n\r\n      <% if @private_message.text.present? %>\r\n          <div style=\"padding: 5px;margin:14px\">\r\n          <%= nl2br(parse_bb_codes(@private_message.text).html_safe.bbcode_to_html(quote, false).gsub(/(?<=<strong>)&quot;(.*?)&quot;/uim, \'\\\\1\')).html_safe %>\r\n          </div>\r\n          <div class=\"field\">\r\n            <%#= render \'codes/bbcode\' %>\r\n          </div>\r\n          <%= f.text_area :text, style: \'width: 800px;height:300px\', value: \"[QUOTE=\\\"#{@private_message.user_from.username}\\\"]#{@private_message.text}[/QUOTE]\\n\" %>\r\n      <% else %>\r\n          <div class=\"field\">\r\n            <%#= render \'codes/bbcode\' %>\r\n          </div>\r\n          <%= f.label :text, t(:text) %>\r\n          <%= f.text_area :text, style: \'width: 800px;height:300px\', \'data-editor\' => \'javascript\' %>\r\n      <% end %>\r\n\r\n\r\n      <%= f.label :file, t(:file) %>\